insert into `craft_content` values('1','1','en_us',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'0000',null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-05-10 01:07:35','2014-07-29 02:59:47','8525d1fc-cd96-4c36-831f-c90fc22f11d0'),
 ('2','2','en_us','Homepage','Welcome to Corben.dev!','<p>Its true, this site doesnt have a whole lot of content yet, but dont worry. Our web developers have just installed the CMS, and theyre setting things up for the content editors this very moment. Soon Corben.dev will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'0000',null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-05-10 01:07:38','2014-08-05 02:20:23','1ea0db99-794b-419c-92bf-deb2c1c1d031'),
 ('4','4','en_us',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'0000',null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-05-10 01:19:53','2014-06-25 02:52:36','ffce016f-fe5c-48de-b14c-ffe3dcbaccbd'),
 ('5','5','en_us','Place',null,null,'<p>Suite 14, 40 Yeo St</p><p>\r\n	Neutral Bay, NSW 2089</p>','+61 (02) 9904 1844','+61 (02) 9904 1855','mail@corben.com.au','<iframe width=\"1470\" height=\"480\" frameborder=\"0\" style=\"border:0\" src=\"https://www.google.com/maps/embed/v1/place?q=Suite%2014%2C%2040%20Yeo%20St%20Neutral%20Bay%2C%20NSW%202089&key=AIzaSyBiAD2tlzv1CXVhOPFqf-bLDk_nM4k1EC8&maptype=satellite\"></iframe>','<p>Our office is on the ground floor.&nbsp;<br>The entrance is on Barry St (not Yeo St)</p><p>There is metered parking in Barry St and there is a car&nbsp;park opposite the office, entered from Olive Lane and Barry St.<br><br><strong style=\"font-size: 14px; background-color: initial;\">GETTING HERE</strong></p><p><strong>From the City/South:</strong></p><p> Sydney Harbour Tunnel or Bridge on the M1<br>Take the Mosman exit (the inside lane)<br>Right onto Military Road<br>Right onto Watson St<br>Left onto Yeo St<br>Left onto Barry St</p><p> <strong>From the North East:</strong></p><p> West on Military Rd<br>Left onto Wycombe Rd<br>Right onto Yeo St<br>Right onto Barry St</p><p> <strong>From the West:</strong></p><p> East on Falcon St<br>Continue onto Military Rd<br>Right onto Watson St<br>Left onto Yeo St<br>Left onto Barry St</p>','Place','Contact Details','How to Find Us','Email Us',null,null,null,null,null,null,null,null,null,null,null,null,null,null,'0000',null,null,null,null,null,null,null,null,null,null,'Thank you for contacting us, we will be in touch shortly.',null,null,'2014-06-05 03:01:30','2014-07-02 23:00:46','36dc6877-3158-49cc-9c64-9f1241f06ab5'),
 ('6','6','en_us','Philip  Corben',null,null,null,null,null,null,null,null,null,null,null,null,'Philip ','Corben','Managing Director','B.Sc. (Arch) B Arch (Hon) FRAIA Registration number 4616','<p>Architect, sailor, snow skier, surfer, cyclist, yoga enthusiast.</p><p>Philip worked for ten years with the respected firms of Cox Architects, Clarke Perry Blackmore and Architecture Oceania. In 1990, he established Corben Architects with the overriding commitment to quality design and a high level of client service.</p><p>Whilst Philip overviews every project within the office he is predominantly involved in the client liaison and design review. As the Managing Director, Philip is also responsible for the business management of the practice, assisted by office manager Janelle Alexander and book keeper Debra Lane. </p><p>Outside work, Philip shares his time between his outgoing wife Lucy,his three daughters and also tries to find time for his love of competitive sailing, long board surfing, the slopes of Thredbo, cycling, &nbsp;yoga and escaping to his beachside hideaway in Byron Bay.</p>','director','[\"true\"]',null,null,null,null,null,null,null,'0000',null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-05 23:43:39','2014-08-06 06:51:32','fef79d6b-e23e-4fc0-b30e-4bfde45177c5'),
 ('7','7','en_us','Mohit Keni',null,null,null,null,null,null,null,null,null,null,null,null,'Mohit','Keni','Director','M.Arch (UNSW)','<p><p>Architect, computer guru, cricketer and keen golfer.</p><p>After graduating in Architecture from India in 1992, Mohit moved to Sydney to undertake his Masters degree from University of NSW. Mohit then worked at Baker Associate Architects for 4 years before joining Corben Architects in 1999. Mohit is responsible for the IT development and management of the CADD systems and given his strong design and documentation skills, acts as one of the Directors in charge of the medium to large-scale high quality domestic residential projects in the office. Mohit was appointed an Associate  in 2000 and a Director in 2007.</p><p>Outside of work, Mohit shares his time between the two loves of his life, his young family and sport. He is passionate about cricket and still chasing that elusive \'ace\' on the golf course.</p></p>','director','[\"true\"]',null,null,null,null,null,null,null,'0000',null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-05 23:59:00','2014-08-06 06:52:08','a1ee7972-8953-4d67-9b8f-459ecb39930b'),
 ('8','8','en_us','Mark Clark',null,null,null,null,null,null,null,null,null,null,null,null,'Mark','Clark','Director','LLB., B.Arch (hons) (UA)','<p><p>Architect, art lover, northern beaches escapist.</p><p>Following a five year career as a solicitor, Mark moved to Architecture and graduated with Honors in 1995. He worked for Andre Porebski and Associates for three-years and joined Corben Architects in 1998 to work on the Wylde Street Apartment project in Potts Point. Mark now acts as one of the Directors in charge on the large scale domestic residential projects in the office. Mark has strong design and documentation skills and is an excellent communicator. He was appointed an Associate in 2000 and a Director in 2007.</p><p>He has a strong interest in art, architecture and landscape design. While Mark enjoys city life during the week, he often escapes to his Palm Beach residence where he spends most weekends.</p></p>','director','[\"true\"]',null,null,null,null,null,null,null,'0000',null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-06 00:01:04','2014-08-06 06:52:47','99d0f587-1b68-4915-97b7-408f6ad2e946'),
