 ('15','17','en_us','Disclaimer',null,'<h4>DISCLAIMER</h4><p><strong>General</strong><br>The materials presented in the Corben Architects web pages are provided voluntarily as a service to our clients.</p><p><strong>Disclaimer of Liability</strong><br>While every effort will be made to ensure that the information contained within the Website is accurate and up to date, Corben Architects makes no warranty, representation or undertaking whether expressed or implied, nor does it assume any legal liability, whether direct or indirect, or responsibility for the accuracy, completeness, or usefulness of any information.</p><p><strong>Copyright</strong><br>Unless otherwise stated, copyright of all material published within this website is reserved by Corben Architects. All rights are reserved.<br>As permitted under the provisions of the Copyright Act 1968, no part may be reproduced or re-used for any purposes whatsoever without the prior written permission of Corben Architects.</p><p>For further information please contact Corben Architects via email: mail@corben.com.au</p>',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'0000',null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-06 04:01:51','2014-07-01 07:37:11','6568bde2-f6b0-4d7b-9543-578794c7cb62'),
 ('16','18','en_us','Privacy Policy',null,'<h4>YOUR PRIVACY</h4><p><br>At Corben Architects we respect your right to privacy and we understand that, as a visitor to corben.com.au, you prefer to control your own personal information. For this reason, we may ask you to register or to provide personal information when you request information.<br>We will guard the personal information you share with us When you provide Corben Architects with your name, e-mail address, mailing address, or telephone number, and you do not \'opt out,\' Corben Architects may use the provided information to alert you to updated information, new services, and other Corben Architects information. Corben Architects does not offer or allow the selling of any user-provided information to third parties.</p><p>Corben Architects respects the rights users give us when opting to receive e-mail communications and enforces internal policies to preserve those rights. It is our objective to retain the long-term ability to continue to communicate with our users.</p><p>If you do not want Corben Architects to contact you, you may \"opt out\" of this preference at any time, whether you\'re online or contacting Corben Architects directly.</p><p><strong>Contact Us</strong><br>You can help Corben Architects maintain the accuracy of your personal information by notifying us when you change your e-mail address. If at any time you wish to update your information or you prefer to stop receiving communication from Corben Architects, feel free to contact us at any time.<br>mail@corben.com.au</p><p><br>If you change your e-mail or postal address, please contact Corben Architects. In order to make the appropriate corrections, please include both your old and new address. Corben Architects may occasionally update, amend, or change this Privacy Policy based on user feedback and as needed or appropriate. If we decide to materially change our privacy policy, we will post those changes to this privacy statement, and will e-mail the information to our users so that they are always aware of what information we collect, how we use it, and under what circumstances, if any, we disclose it. We will use information in accordance with the privacy policy under which the information was collected.<br>Users will always have a choice as to whether or not we use their information in accordance with, and in respect to, the posted privacy policy. If users have opted out of all communication with the site, or deleted/deactivated their account, then they will not be contacted</p><p><strong>Links</strong><br>The Corben Architects website may contain links to other sites. Corben Architects assumes no responsibility for the content or the privacy policies and practices of such websites. Corben Architects encourages you to read the privacy statements of these linked sites; their privacy practices may differ from ours.</p>',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'0000',null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-06 04:02:34','2014-07-01 07:36:17','e6393ae6-78b0-4ff3-99ad-ed1b4fa416af'),
 ('17','19','en_us','About',null,'<h2>ABOUT</h2><p> Corben Architects is an experienced, Sydney based, architectural practice committed to the creation of great buildings.</p><p> The practice specialises in sophisticated and distinctive residential projects, ranging from high quality individual houses to large, multi-unit, apartment developments. Corben Architect\'s work encompasses a wide variety of architectural design approaches ranging from heritage restoration to innovative contemporary design.</p><p> The practice predominantly undertakes work in Sydney within the Municipalities of Sydney City, Mosman, Manly, North Sydney, Willoughby, Warringah, Pittwater and Woollahra. We have also designed and built beach houses, mountain lodges and rural estates throughout Australia.</p><p> Our success is a reflection of our ability to carefully listen to our client\'s brief, assess their needs, fulfil their vision and exceed their expectations by creating buildings that are functional, practical and comfortable living and working environments.</p><p> All our work is the direct result of client recommendations and referrals.</p><p>At Corben Architects we provide practical advice whilst controlling budgets and meeting deadlines. We work as a team with our clients to meet our mutual primary objective; to ensure our clients are as proud of their projects as we are of our architecture.</p>',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'0000',null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-06 04:06:51','2014-08-05 04:43:55','517468fd-15ea-4ce7-a030-f769a41b2d08'),
 ('18','20','en_us','Architecture',null,'<h2>ARCHITECTURE</h2><p> Corben Architects approach to every project is to analyse the brief and context of the site to arrive at a clear design and planning solution.This approach is undertaken without limiting design innovation to achieve practical, cost effective design solutions that create great looking buildings and comfortable, living and working environments.</p><p> Able to adapt to a wide variety of project styles, from historic restorations to contemporary modern design, the key objective of each commision is to design and build projects that fit comfortably within their urban context or natural surrounding. This approach is extended in the integration between old and new architecture.</p><p>As part of the overall project strategy, we keep the design principles simple and uncomplicated to allow our ideas to develop with clarity. Our buildings are distinctive by their individuality rather than their similarity.</p>',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'0000',null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-06 04:07:19','2014-08-06 23:00:48','aa249431-bdaf-4d5e-9cf9-78e30a0898de'),
 ('19','21','en_us','Service',null,'<h2>SERVICE</h2><p>The team of architects, designers, project managers and support staff at Corben Architects are dedicated to excellence and motivated by client satisfaction.</p><p> As Managing Director, Philip Corben maintains a personal involvement in all the design work and client liaison. The execution of the projects is undertaken by an experienced staff, comprising three Directors , two Associates and nine Project Architects assisted by CAD draftspersons and administration staff.</p><p> The practice utilises sophisticated computer systems including Archicad and Vectorworks CAD software for 2D design and documentation and 3D modelling and Total Synergy for back of house office management.</p><p> Corben Architects has a close liaison with a broad range of experienced consultants and building contractors who readily combine together on a project by project basis to provide a total and comprehensive service.</p><p>The practice is renowned for providing practical advice to fulfil client and project briefs and control budgets whilst meeting their deadlines. At Corben Architects we work as a team with our clients to meet our mutual primary objective; to ensure our clients are as proud of their projects as we are of our architecture.</p>',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'0000',null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-06 04:07:49','2014-08-05 04:56:21','98b6d099-32d1-4708-8dc5-eb5b62173dcb'),
 ('20','22','en_us','FEES',null,'<h2>FEES</h2><p> Although we work on a variety of fee arrangements, most  residential projects are undertaken on a percentage fee, based on the final cost of the project including all internal fitout, external works and landscaping (exc gst). We adopt this approach as it is the fairest means of remuneration for the work we actually design, document and administer during construction.</p><p> The percentage fee for a full services commission on a new domestic project range from 9-15% depending on the value of the project and the level of finish. Alterations and additions generally attract an additional fee depending on the complexity of the works and the degree of alteration. Multi unit residential projects generally attract a lesser fee in the range of 5-9% depending the value of the project, the number of units, the degree of repetition and the level of finish and detail.</p><p> Percentage based fees are generally divided into the following stages:?Master planning / initial sketch design 5%?Full sketch design 5%?Design development to Development Application 15%?Contract documentation to Construction Certificate 20%?Contract documentation to tender 20%?Tendering and contract negotiation 5%?Contract administration during construction 30%</p><p> We also work on a time plus disbursements basis or a lump sum fee for a defined stage or specific scope of work.</p><p> Due to the adhoc nature of the Development Application assessment process and inevitable neighbour objections, all council and neighbour negotiations are undertaken on a time and disbursement basis.</p><p> We are able to provide partial services as may be required although we do not encourage this approach as we maintain the finest and most successful projects are the result of the architect maintaining a close involvement throughout the entire design, documentation and construction process.</p><p>Whilst our fees are consistent with the industry standard we provide a high level of skill and expertise and an even higher level of client service.</p>',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'0000',null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-06 04:08:32','2014-08-05 05:02:21','6230dc52-fc86-4bd9-8e1c-b5ce2913f53a'),
 ('22','24','en_us','New Houses',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'0000',null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-07 23:09:56','2014-06-07 23:09:56','f329ed5b-b653-4185-95ac-ef740185eb61'),
