 ('24','26','en_us','HOPETOUN AVENUE',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>Located on a steep site, this modern 5 level home was designed to maximize the views and take advantage of its northern orientation.  The buildings form combines horizontal bands of rendered masonry which are complimented by a vertical double height glazed entry volume. The large skillion roof completes the building providing shade to the outdoor terraces.</p>','HOPETOUN AVENUE','MOSMAN','2006','SF Hough Pty Ltd','515 sqm','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-07 23:37:05','2014-08-05 04:31:52','341a092c-e487-4217-baa9-53c5ab39bc36'),
