 ('61','79','en_us','?BALMORAL AVENUE',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>Located on a steeply sloping north-facing site, this modern 3 level home was designed to maximise views on each level. The top level is a light filled steel and timber framed pavilion resting on a masonry base. The roof is a simple floating skillion that follows the topography. Below are 2 levels providing bedrooms and a second living area that links to the swimming pool and the garden. Controlled material palettes both inside and outside reflect the simple functional design approach.</p>','?BALMORAL AVENUE','MOSMAN','2003','Yuncken Construction Group','309 sqm','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-25 02:13:36','2014-08-05 04:29:26','b598af93-d657-4fe2-a48e-893b2dbe9b9c'),
