 ('71','96','en_us','HAMPDEN STREET',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>This modern family home is designed as 2 volumes separated by a single storey entry core and a north facing central courtyard. At the street side is a 3 storey volume containing garaging, living areas and bedrooms, at the rear a 2 storey volume contains the main living area with further bedrooms above. This leads onto the rear garden with wet edge pool. Strategically placed large window openings flood the home with light while maintaining privacy.</p>','HAMPDEN STREET','MOSMAN','2005','Tifad Developments Pty Ltd','390 sqm','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-25 02:44:05','2014-08-05 06:53:17','e7caf337-1739-422b-a042-11020e8c4ad5'),
