 ('145','204','en_us','WAMBERAL',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>This beachfront home sits on top of sand dunes overlooking Wamberal Beach and rests on 25 metre deep concrete piers. The home was designed as two separate pavilions. A two storey beach side pavillion contains living areas and kitchen with a master bedroom suite, a study and sitting room above. The second street side pavillion  accommodates a double garage, storerooms with guest bedrooms and self contained living areas above. The design is a sophisticated reinterpretation of the skillion roofed beach shack. It combines sandstone, rendered masonry, timber floors doors and windows to create a warm and inviting beach house retreat.</p>','WAMBERAL','BEACH','2009','Gledhill Developments','435 sqm','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-25 03:34:15','2014-08-06 02:25:37','d8d038e7-9d4e-4c37-821a-96c2551871e5'),
 ('146','213','en_us','SWR Warringah Road',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-25 03:40:33','2014-06-25 03:40:33','43fac213-4c16-4ca4-a117-65c2d03adc74'),
 ('157','224','en_us','WARRINGAH ROAD',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>This contemporary 3 level home sits on a battle-axe site. The careful placement ensured neighbours water views were protected. The sensitive design maintains privacy to both owners and neighbours. The strong rectangular form comprises planes of concrete and masonry separated by panels of timber battens, split face sandstone and large expanses of glazing. This is a sophisticated contemporary home inserted into a challenging site.</p>','WARRINGAH ROAD','MOSMAN','2009','SX Projects','450 sqm','Alina Gozina','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-25 03:44:50','2014-08-06 02:29:15','c75083ee-cbd0-447b-982c-e9914068ff08'),
 ('158','234','en_us','PALM Bronte Road',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-25 03:50:50','2014-06-25 03:50:50','0296cf23-7fc3-42eb-ac11-1cd13bbfd101'),
 ('159','235','en_us','BRONTE ROAD',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>This contemporary home, located on a wedge shaped site on the headland overlooking Bronte Beach, takes maximum advantage of the the beach and coastal views. The linear footprint of the home ensures all rooms enjoy the northeast views. A large skillion roof shelters the upper level. This contains the entry and living areas, a study and master bedroom suite. The lower floor provides more bedrooms and a playroom. The use of operable louvres provides semi transparency to the external terraces, this is balanced by sandstone walls and rendered masonry below.</p>','BRONTE ROAD','BRONTE','2010','F S Hough Pty Ltd','445 sqm','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-25 03:50:57','2014-08-06 03:15:55','95cfa523-db86-46e7-96b3-9482f2a7beac'),
 ('169','253','en_us','AWH Carrington Avenue',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-25 04:06:45','2014-06-25 04:06:45','45df6f2d-a2c9-431a-b87e-bbaaf80a2233'),
 ('170','254','en_us','CARRINGTON AVENUE',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>This modern 3 level home is located on a north facing waterfront site overlooking Quakers Hat Bay. It is a composition of sharp rectangular forms clad with a mix of timber, painted render, zinc and sandstone. The home presents to the street front a predominantly opaque faade, but inside the homes central circulation core is flooded with natural light from clerestory windows. At the rear, the house is predominantly translucent, large areas of glazing open up to terraces. Living areas are located on the middle entry level, bedrooms are above and the lowest level includes a gym, playroom and self contained flat. A lawn leads onto a large pool and entertainment terrace to extend the living areas.</p>','CARRINGTON AVENUE','MOSMAN','2010','FS Hough','560 sqm','Steve Back','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-25 04:06:50','2014-08-06 03:17:34','71f8a734-126c-402e-a342-abd6d3816d73'),
 ('180','272','en_us','AWH Carrington Avenue 1',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-25 04:11:34','2014-06-25 04:11:34','8eac21cb-d289-41fa-9ede-f89d69007473'),
 ('181','273','en_us','DORSET ROAD',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>Designed to exploit its position, this 5 level contemporary home steps up a steep hill creating large roof terraces that maximise views over Middle Harbour. The home is wide and is typically 1 room deep. The glazed circulation space with stairs and a lift create a vertical tower at one end. Counterpoint to this, are the horizontal bands created by a bedroom wing with roof terrace above. Living areas are located on the upper level with a large terrace and access to the garden, while the master bedroom is on the top level.</p>','DORSET ROAD','NORTHBRIDGE','2011','Yuncken Construction Group','405 sqm','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-25 04:11:52','2014-08-06 03:27:09','e1500927-ba07-414a-94aa-9d46838b2561'),
 ('191','291','en_us','LRB Lighthouse Road Stage 1',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-25 04:19:56','2014-06-25 04:19:56','3564aa62-fa1e-4dec-95b7-b77a315044f8'),
 ('192','292','en_us','LIGHTHOUSE ROAD',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>This home is situated on a beachfront property overlooking Byron Bay. It was designed as part of a 2 home subdivision and incorporates local weathered basalt stone, fibre cement sheet cladding, dark stained timber and a large metal skillion roof with large eaves. The floor plan efficiently utilizes the available space and allows for generous living areas and 4 bedrooms. Timber framed sliding doors and louvered windows with wide covered decks create the ideal sub-tropical beach house.</p>','LIGHTHOUSE ROAD','BYRON BAY','2011','Todd Knaus Constructions SX Projects','250 sqm','Saul Goodwin','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-25 04:20:15','2014-08-06 03:29:13','7bf6c2da-a06f-475b-875d-9179462ef219'),
 ('214','323','en_us','MINNAMURRA ROAD',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>Overlooking Sailors Bay, this contemporary low maintenance home was designed for a large family. The home is organised around a central circulation spine.  An open timber stair allows through views from the middle level entry. Living areas and a study/guest room are also at this level. The upper level includes 5 bedrooms, dressing rooms, bathrooms and access to the garage. The lowest level provides a rumpus room, gym, music room and another bathroom. This leads out to the swimming pool and terraced lawn. The skillion roof follows the sites gradient. Materials include sandstone walls, spotted gum floors, aluminium framed windows and privacy screens.</p>','MINNAMURRA ROAD','NORTHBRIDGE','2011','Joe Motherway Constructions','470 sqm','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-25 04:26:52','2014-08-06 03:30:53','bdc5b817-e258-470f-a261-9e3e35be329f'),
 ('215','333','en_us','BERTHONG',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>Berthong is a significant historic property in Elizabeth Bay. Having undergone many alterations and a recent conversion into two duplex apartments, we were commissioned to restore the building back to a family home.</p><p>The building fabric was extensively renewed, a new entry hall was created, stairs were rebuilt, a kitchen and bulters pantry was relocated to a more prominent position and 6 bathrooms were built. A large rear stone paved terrace and stairs was added to connect the house to the waterfront. This is a finely detailed grand property. The home received the MBA award in 2005.</p>','BERTHONG','ELIZABETH BAY','2004','Sandlik Constructions Pty Ltd','','','[\"showSuburb\",\"showCompleted\",\"showBuilder\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-27 01:07:56','2014-08-06 03:57:06','2e9e4bfe-e510-4bee-90cf-d30dd2fed800'),
 ('227','345','en_us','WINDWARD ROAD',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>This large Federation home required significant restoration and upgrading of living, dining and kitchen areas. Two new covered terraces were added using detailing sympathetic to the original features. These now provide additional outdoor living areas and enjoy views over Sydney Harbour. The careful integration of old and new with selective use of materials gives a traditional home a new lease of life.</p>','WINDWARD ROAD','MOSMAN','2007','J Motherway Constructions Pty Ltd','420 sqm','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-27 01:16:06','2014-08-06 03:55:37','f0848cf4-1d07-44d3-86c1-ba41eda95517'),
 ('228','346','en_us','RIX Windward Road Mosman',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-27 01:16:29','2014-06-27 01:16:29','9b1a2a19-dc1e-4c20-81fb-72fb9101350e'),
 ('229','347','en_us','ALEX Parriwi Rd Mosman',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-27 01:19:26','2014-06-27 01:19:26','0e6bf802-a57e-472b-ae15-c751ec50d7c3'),
 ('238','356','en_us','PARRIWI ROAD',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>This is a major renovation of a classic 1970s home located on a steep site overlooking Sydney Harbour and Chinamans Beach. Spread over 3 main levels the confined internal spaces were opened up and enlarged. New services were incorporated, together with an internal lift. A steel framed covered terrace with operable roof was added to the rear of the home and a new roof with clerestory brings light and ventilation to the core of the home. The interior designer introduced contemporary artwork and furnishings to compliment the reinvigorated living spaces.</p>','PARRIWI ROAD','MOSMAN','2008','J Wallace Constructions Pty Ltd','420 sqm','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-27 01:20:48','2014-08-06 03:59:07','3004dfaa-dca8-406d-8356-d0931764767a'),
 ('246','364','en_us','EUROBIN AVENUE',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>This heritage listed 1930s duplex apartment has been converted to a single family home. The street faade was retained but the interior was reorganised and a new addition covered terrace added at the rear. Living areas located on the upper level now enjoy views over Manly lagoon. The lower level includes bedrooms and rumpus room opening onto the north-facing terrace. A 2-storey void at the centre of the home provides an immediate connection between the entry and the upper levels. Traditional detailing was carried throughout the home and combined with more modern and custom joinery.</p>','EUROBIN AVENUE','MANLY','2008','J Motherway Constructions Pty Ltd','345','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-27 01:26:22','2014-08-06 04:02:38','750744b6-0e3f-4b6d-b03f-da370b0f8b7f'),
 ('255','373','en_us','MJM Fairfax Rd Mosman I',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-27 01:31:34','2014-06-27 01:31:34','cb900fef-fcc4-4f6c-916c-e5b68fad7f93'),
 ('264','382','en_us','FAIRFAX ROAD',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>What was originally a 1970s home with awkward hexagonal shaped spaces has been significantly rebuilt to provide a more streamlined home. Internal walls were removed to provide larger open plan living areas, the roofline was squared off and windows were replaced to provide larger opening to optimize light ventilation and the view. New interior finishes of limestone, timber veneer and metallic polyurethane maintain the modern approach</p>','FAIRFAX ROAD','MOSMAN','2008','J Motherway Constructions','420 sqm','Crag Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-27 01:35:02','2014-08-06 04:05:04','a7930ce0-6ee8-4f57-9d5e-971a517ce138'),
 ('265','383','en_us','COLE Pearl Bay Avenue',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-27 01:38:17','2014-06-27 01:38:17','94846da6-7bf8-4527-8ee2-74ac566a7c88'),
 ('266','384','en_us','PEARL BAY AVENUE',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>We were commissioned to redesign a 1950s home perched on a cliff face overlooking a harbour reserve. The existing brick walls of the middle level were rendered and a 3<sup style=\"font-family: Arial, Helvetica, Verdana, Tahoma, sans-serif; \">rd</sup> level, added using reverse brick veneer construction with a stained cedar cladding for the external skin. The lowest level was expanded and opened up. The middle entry level containing living areas was also opened up and extended to link with a northfacing terrace covered by a timer framed pergola. The approach to the home is through a lush tropical garden and it is entered via stepping stones set over a fishpond. Dark stained timber floors, crisp white walls create a sophisticated and relaxed family home.</p>','PEARL BAY AVENUE','MOSMAN','2009','Northside Constructions','360 sqm','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-27 01:38:48','2014-08-06 02:20:58','44978be1-6685-4d5f-9bc5-4afeb8400500'),
 ('283','401','en_us','INNER WEST WAREHOUSE',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>The project involved converting a vacant warehouse into a florist workshop and a luxurious residence. This mixed use building was designed to accommodate a large family and a collection of racing cars. The lower floor living areas revolve around the kitchen that features a 9 metre long polished concrete bench. It is a unique component of the design, folding out of the floor and floating over it. The upper floor contains bedroom suites and a second living space. A central courtyard garden was carved into the building and fills the living areas and bedrooms with sunlight and natural ventilation. The result is a rare living and working environment in an industrial context</p>','INNER WEST WAREHOUSE','','2009','Wentworth Projects ','500 sqm','Steve Back','[\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','',null,null,null,null,null,null,null,null,'2014-06-27 01:48:20','2014-08-06 04:21:05','e2409b48-48af-4eaa-9f9a-cf8101be9008'),
 ('290','408','en_us','FWB Cremorne Rd Cremorne Point',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-27 01:52:32','2014-06-27 01:52:32','f06c3158-24c3-4dcb-8f9e-576fd0843508'),
 ('291','409','en_us','CREMORNE ROAD ',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>A large federation home with views over Mosman Bay was refurbished and restored. The approach balanced the retention of many period architectural features with the removal of walls and refurbishment of rooms to create a stronger connection between spaces. This allowed light and views to rooms that were otherwise deprived. A palette of dark stained floors, white walls, American walnut veneer and white polyurethane, together with careful selection of furniture and artwork by the interior designer results in a clean aesthetic to compliment the period details.</p>','CREMORNE ROAD ','CREMORNE POINT','2009','John Thew Constructions','300 sqm','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-27 01:52:54','2014-08-06 04:23:43','9c8520ef-9b1e-46d9-b4d5-8fc05f898995');
insert into `craft_content` values('302','420','en_us','MARINE PARADE',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>The project is a transformation of a Victorian terrace house on a waterfront site into a modern open plan 4 bedroom home. While the building shell was retained, the internal layout was reconfigured. A 3<sup style=\"font-family: Arial, Helvetica, Verdana, Tahoma, sans-serif; \">rd</sup> level attic was removed to reduce the building scale. A zinc-clad faade frames the home; steel and timber framework and coloured glass balustrade add greater complexity. A sophisticated steel interior design with a controlled use of strong colours further enriches the home.</p>','MARINE PARADE','DOUBLE BAY','2010','Gartner Rose','480 sqm','Steve Back','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-27 01:59:22','2014-08-06 04:38:32','78fe46cc-ff52-4336-a158-7fedf9f981a8'),
 ('303','421','en_us','SEAFORTH CRESCENT',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>This challenging project involved the remodelling of a 1960s 5 level waterfront home on a precipitous south facing site. The house was stripped back to its concrete framework. A new circulation stair and lift was attached to the rear of the home and a new steel framed structure was attached to the waterfront side supporting balconies for all levels.  A two storey void on the living area floods these spaces with northern light. The restrained&nbsp;palette&nbsp;of materials of white walls, blackbutt timber floors and pietra grey marble enhance the sharp design. A&nbsp;crumbling 1960s home has been transformed into a striking contemporary home that now engagtes with its context.</p>','SEAFORTH CRESCENT','SEAFORTH','2011','FS Hough Pty Ltd','500','Craig Bryant ','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-27 02:07:43','2014-08-06 04:44:56','f14741a9-ac9a-4499-bed7-5addae8a1a8b'),
 ('310','428','en_us','MAV North Avoca House',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-27 02:17:17','2014-06-27 02:17:17','b1455659-64c0-47e6-93ae-cbdea2fde09a'),
 ('320','438','en_us','NORTH AVOCA',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>A 1970s two storey home occupied this prime waterfront property and our clients had plans to demolish it and build a new home.  We convinced them to retain the home, reorganise the layout and extend it to improve the relationship with the beachfront. A new single level&nbsp;pavilion&nbsp;was added to the rear and a new covered terrace and kitchen connects this to the original home. The existing building was reorganised to&nbsp;provide 5 bedrooms and a light filled entrance hall.  The home is now a sharp contemporary beach house with a direct connection to the garden and beach beyond.</p>','NORTH AVOCA','','2012','J & S Mitchell Pty Ltd','315 sqm','Craig Bryant','[\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','',null,null,null,null,null,null,null,null,'2014-06-27 02:18:21','2014-08-06 04:47:52','2949004c-f5c7-4326-94aa-e9c5048f5b56'),
 ('321','439','en_us','LMP Waiwera St McMahons Point',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-27 02:38:47','2014-06-27 02:38:47','b7df7264-bd55-4681-85d0-3448209d3eab'),
 ('330','448','en_us','WAIWERA STREET ',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'','WAIWERA STREET ','McMAHONS POINT','2013','Dobsonei','245 sqm','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-27 02:39:43','2014-08-06 04:50:20','ff15f671-17b7-45d5-a87c-4fd42cfd5039'),
 ('332','450','en_us','WARWICK AVENUE',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>Like many of its kind, this federation home required the usual removal of poorly considered additions in order to reach its potential. A small 1980s kitchen and bathroom on the northern side blocked access to the garden and sunlight. Once removed a new large living space was created linking to the garden. A second level was incorporated into the roof and provides study, master bedroom suite and balcony. Original rooms were refurnished allowing the owners to enjoy a beautiful character filled home with living areas bathed in sunlight.</p>','WARWICK AVENUE','CAMMERAY','2012','Bellamy Builders Pty Ltd ','269 sqm','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-27 02:43:19','2014-08-06 04:52:47','2445eb58-47bf-4a14-bd40-1a320bea0caf'),
 ('333','451','en_us','WALD Warwick Ave Cammeray',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-27 02:44:03','2014-06-27 02:44:03','dec2ec5d-219d-46f3-a851-d04843b732f7'),
 ('351','469','en_us','SHELLBANK AVENUE III',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>We were commissioned to undertake a major renovation to this large waterfront home. The property comprises a two storey garage building, a three storey home and a boatshed. Once stripped back to the bare floor plates, all three buildings were transformed with large window openings, a new zinc roof and sandstone, zinc and stained cedar cladding. Rooms were reorganized and streamlined with a sophisticated interior design by Interni, including the sculptural central staircase. The swimming pool was rebuilt in a new location to improve the connection to the waterfront and the Dangar Group provided a contemporary garden employing interlocking zinc clad boxes with lush planting to complete the design.</p>','SHELLBANK AVENUE III','MOSMAN','2009','Sandlik Constructions','760','Richard Glover','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-27 02:48:10','2014-08-06 03:39:42','519202c8-8ee9-4cfc-bdac-69253b4cb9d4'),
 ('352','470','en_us','CCM Shadforth St Mosman',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-27 02:50:39','2014-06-27 02:50:39','b3917cca-a6f1-46a0-a51e-c1383abcf2e1'),
 ('360','478','en_us','SHADFORTH STREET',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>This home exemplifies a clever integration of contemporary design with a traditional Federation dwelling. The original cottage was carefully restored and a new two storey living and bedroom pavilion was constructed behind, detached from the house by a courtyard and glass lined circulation volume. Main living areas open out to the rear garden and back to the sheltered courtyard. What was a small cottage is now a generous light filled family home.</p>','SHADFORTH STREET','MOSMAN','2013','J Motherway Constructions     ','400 sqm','Craig Byrant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-27 02:51:26','2014-08-06 05:03:36','54c4e818-be6e-4f90-ba0e-1df22996618b'),
 ('368','486','en_us','WONGA ROAD II',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>We were commissioned to design alterations and additions to a newly built 3 level waterfront home recently purchased by our clients. The brief was to add a lift, wine cellar, guest bathroom and generally refurbish the home to provide a richer background for the clients possessions.</p><p>The lift shaft has 2 walls of full height glazing to reduce the additional building bulk and afford views to the passengers. These windows are screened with vertical aluminium battens. The wine cellar enjoys water views through the lift shaft into the courtyard beyond. The new bathroom was crafted from a space that was two bathrooms. Interior stylist, Lucy Purchas worked closely with the clients, commissioning new furniture, selecting wall finishes to compliment the clients extensive collection of art work and sculpture. Hugh Main of Spirit Level landscape design created a series of unique garden spaces, grounding the home in a visually striking landscape.&nbsp;</p>','WONGA ROAD II','CREMORNE','2014','JP Thew Constructions Pty Ltd','470m2','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-27 02:55:49','2014-08-06 05:07:45','9c2f1bd3-faaf-469f-897b-c182eb08d0dc'),
 ('369','487','en_us','EST The Esthers',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-06-27 02:59:40','2014-06-27 02:59:40','bea2aa19-4183-4910-bcf8-2be105421b44'),
 ('379','497','en_us','THE ESTHERS',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>This contemporary duplex apartment complex sits on a prominent corner close to the beach. The upper level apartment includes large decks and a wet edge pool, the lower level apartment has a large north facing garden. A central courtyard ensures northern light reaches the complexs core. Spacious internal rooms, which combine a casual beachside feel with luxurious finishes, seamlessly connect to outdoor terraces and gardens. The result is a beautiful beachside apartment development cleverly integrated with its surroundings.</p>','THE ESTHERS','MOSMAN','2007','SX Projects Pty Ltd','755 sqm','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-27 03:00:34','2014-08-06 05:28:28','5874f85a-7ec4-4cef-b746-388b462774c7'),
 ('386','504','en_us','SWERVE &amp; CO CAFE',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>We were commissioned to design the fit-out of a new caf-bar-restaurant inserted in a long narrow commercial space. The space is organised with the work and serving area on one side and a long banquette dining space on the other. A horizontal band of backlit mirror and pendant lighting reinforce the linear arrangement and enhance the dining space. Patterns feature strongly in the timber slat detailing to shelving and wall panels of colourful striped fabric.</p>','SWERVE & CO CAFE','MOSMAN','2010','Kevin Brown','100 sqm','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-06-27 03:04:06','2014-08-06 06:11:07','69bee576-9179-442f-a6d6-d966debf103b'),
