 ('429','552','en_us','Andrew Vingilis',null,null,null,null,null,null,null,null,null,null,null,null,'Andrew','Vingilis','Associate Director','B.Arch (UTS), NSW ARAIA','<p><p>Andrew commenced working in Architectural Practice in 1981, graduating from the University of Technology Sydney in 1989.</p><p>Andrew worked for several Sydney practices including Tanner Architects, Feiko Bouman Architects, Andre Porebski and Associates and Stokes, Hayes and Kanas Pty Ltd as the Design and Project Architect on numerous single and multi unit residential projects, large educational, commercial and heritage projects.</p><p>Prior to joining Corben Architects in 2007 Andrew worked in his own practice for 5 years specializing in single and multi unit residential projects throughout New South Wales.  Andrew was appointed as an Associate Director to Corbens in 2011.</p></p>','director','[\"true\"]',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-08-05 04:08:59','2014-08-06 06:53:14','dd45818d-670f-496c-94da-127211306e1a'),
 ('430','553','en_us','Anita Kane',null,null,null,null,null,null,null,null,null,null,null,null,'Anita','Kane','Associate','B.Arch, NSW ARAIA','<p><p>Architect, beach & music lover, sports enthusiast & adventurer.</p><p>Anita commenced her architectural professional from an early age, providing drafting services for her father, a sole practitioner before working with Mark Hurcum Design Practice as an Architectural Assistant. &nbsp;In 2003, Anita graduated from the University of Sydney and joined the team at Corben Architects. Anita was instrumental in establishing Corben Architects CAD protocol and is responsible for managing small to medium sized high-end residential projects.Anita was appointed an Associate in 2007.</p><p>In 2009, Anita took an extended honeymoon, cycle touring through South America and Cuba, covering some ten thousand kilometers on a bicycle. In May 2010, she returned to Corben Architects to resume her position.</p><p>Outside of work, Anita shares her time between a busy social life, discovering Sydneys art scene, sampling many of the northern beaches culinary delights, enjoying the outdoors or chasing her husband up a mountain.</p></p>','director','[\"true\"]',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-08-05 04:11:15','2014-08-06 06:54:07','df9e1213-919f-48b1-a188-fc033f5fd7f9'),
