 ('798','923','en_us','POMEROY',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>This classically styled apartment complex includes 39 luxury apartments and a commercial space. The building has 11 levels and the lift core services 6 apartments per level. It was designed as an infill to the adjacent heritage listed apartment buildings of Macleay Street. All apartments include generous living spaces, large undercover terraces and high quality finishes and joinery elements.</p>','POMEROY','POTTS POINT','2004','A W Edwards Pty Ltd','12,600m2','Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-08-06 06:04:03','2014-08-06 06:04:03','a3143dfc-f171-4bc8-ae32-69f6a5937a01'),
 ('799','924','en_us','WYLDE STREET',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>Located on a large site in Potts Point overlooking Elizabeth Bay this 8 level building comprises 24 luxury 2 and 3 bedroom apartments and 2 penthouses. The building is divided into 2 parts with 2 lift cores. At the street level the building is spread over 4 levels with an indoor swimming pool on the lowest floor. At the rear the apartments are spread over 8 levels. Each apartment benefits from large covered terraces, many with retractable louvres for sun control and privacy. High quality finishes and detailed joinery have been used throughout.</p>','WYLDE STREET','POTTS POINT','2000','Abigroup','7,200m2',': Craig Bryant','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-08-06 06:08:32','2014-08-06 06:08:32','40d26853-95ae-4552-9b89-ec85affcfc00'),
