 ('814','939','en_us','D ALBORA THUMB',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'2014-08-06 06:31:43','2014-08-06 06:31:43','88ca5680-f6bc-48e8-97a0-aa1ab75a90c0'),
 ('815','940','en_us','PRINCES STREET MARINA',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>This project involved the rebuilding of a 1970s steel framed marina workshop. The building was stripped back to the original frame and a new floor structure was inserted within the 2- storey height workshop space. The structure was re-clad in compressed fc sheet, and a new cantilevered verandah wraps around the building providing access to upper level offices. This addition breaks down the faade creating 2 distinct levels. The new roof sheeting extends down the upper section of walls to further reduce the buildings scale. The refurbishment upgraded the marina facility and provided an extra 500m<sup>2 </sup>of additional floor space within the existing structure and received a BHP award in 1996.</p>','PRINCES STREET MARINA','NEWPORT','1996','Construction Pacific','1000m2','','[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-08-06 06:39:30','2014-08-06 06:39:30','15a86bec-b19c-4722-87dd-49c6d4143882'),
 ('816','941','en_us','D&#039;ALBORA MARINA',null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,'<p>We have been commissioned to design a new commercial marina to replace the existing building and marina facility. The new building will provide workshops, boat showroom, management offices for charter boat hire, yacht brokerage and a restaurant and kiosk. An additional 35 marina berths will be added to the existing facility. In keeping with the clean marina approach, the new facility will incorporate recycled building materials, rainwater harvesting and photovoltaic panels for energy generation. Importantly, the new facility will improve public access to the waterfront.</p>','D\'ALBORA MARINA','MOSMAN','','','','','[\"showSuburb\"]','[\"showSuburb\"]',null,null,null,null,null,null,null,null,'2014-08-06 06:41:28','2014-08-06 06:42:11','0b2d7427-fce5-458b-8e83-52a07688405c'),
