 ('127','160','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"GORDON STREET\",\"slug\":\"gordon-street\",\"postDate\":1403666533,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"350 sqm\",\"37\":\"Northern Building Pty Ltd\",\"42\":[\"24\"],\"36\":\"2009\",\"33\":\"<p>This house adopts an \\u2018H\\u2019 plan, the connecting link contains the entry and circulation spaces with living spaces at either end. The principal living area has 3.3m high ceilings with sliding doors that retract into the walls to provide a clean opening to a terrace, which leads onto the lawn and swimming pool area. A large reflection pond sits adjacent to the stair and is separated by 2 storey high sliding glass doors. While the core of the home has large expanses of glazing flooding the home with light, dense bamboo planting provides privacy. A colour palette of black zinc, white walls, grey stone floors reinforce the clean contemporary design.<\\/p>\",\"46\":\"\",\"47\":\"\",\"40\":\"\",\"39\":\"Sharrin Rees\",\"43\":\"\",\"35\":\"MOSMAN\",\"41\":\"\",\"34\":\"GORDON STREET\"}}','2014-06-25 03:22:13','2014-06-25 03:22:13','06e1ce29-3fad-4533-86e6-0c98a96dfc3c'),
