 ('130','204','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WAMBERAL\",\"slug\":\"wamberal\",\"postDate\":1403667255,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"435 sqm\",\"37\":\"Gledhill Developments\",\"42\":\"\",\"36\":\"2009\",\"33\":\"<p>This beachfront home sits on top of sand dunes overlooking Wamberal Beach and rests on 25 metre deep concrete piers. The home was designed as two separate pavilions. A two storey beach side pavillion contains living areas and kitchen with a master bedroom suite, a study and sitting room above. The second street side pavillion  accommodates a double garage, storerooms with guest bedrooms and self contained living areas above. The design is a sophisticated reinterpretation of the skillion roofed beach shack. It combines sandstone, rendered masonry, timber floors doors and windows to create a warm and inviting beach house retreat.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"203\"],\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"BEACH\",\"41\":\"\",\"34\":\"WAMBERAL\"}}','2014-06-25 03:34:15','2014-06-25 03:34:15','fe633a86-e346-483a-aad5-95dd8b206183'),
