 ('134','235','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"BRONTE RD\",\"slug\":\"bronte-rd\",\"postDate\":1403668257,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"445 sqm\",\"37\":\"F S Hough Pty Ltd\",\"42\":[\"24\"],\"36\":\"2010\",\"33\":\"<p>This contemporary home, located on a wedge shaped site on the headland overlooking Bronte Beach, takes maximum advantage of the the beach and coastal views. The linear footprint of the home ensures all rooms enjoy the northeast views. A large skillion roof shelters the upper level. This contains the entry and living areas, a study and master bedroom suite. The lower floor provides more bedrooms and a playroom. The use of operable louvres provides semi transparency to the external terraces, this is balanced by sandstone walls and rendered masonry below.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"234\"],\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"BRONTE\",\"41\":\"\",\"34\":\"BRONTE RD\"}}','2014-06-25 03:50:57','2014-06-25 03:50:57','fa1c0078-2dc7-4028-87c6-a0d71b479892'),
