 ('136','254','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"CARRINGTON AVE\",\"slug\":\"carrington-ave\",\"postDate\":1403669210,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"560 sqm\",\"37\":\"FS Hough\",\"42\":[\"24\"],\"36\":\"2010\",\"33\":\"<p>This modern 3 level home is located on a north facing waterfront site overlooking Quaker\\u2019s Hat Bay. It is a composition of sharp rectangular forms clad with a mix of timber, painted render, zinc and sandstone. The home presents to the street front a predominantly opaque fa\\u00e7ade, but inside the home\\u2019s central circulation core is flooded with natural light from clerestory windows. At the rear, the house is predominantly translucent, large areas of glazing open up to terraces. Living areas are located on the middle entry level, bedrooms are above and the lowest level includes a gym, playroom and self contained flat. A lawn leads onto a large pool and entertainment terrace to extend the living areas.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"253\"],\"39\":\"Steve Back\",\"43\":\"\",\"35\":\"MOSMAN\",\"41\":\"\",\"34\":\"CARRINGTON AVE\"}}','2014-06-25 04:06:50','2014-06-25 04:06:50','5114edb4-1f53-4e0f-9c22-cfae19d4efcb'),
