 ('139','254','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"CARRINGTON AVE\",\"slug\":\"carrington-ave\",\"postDate\":1403669160,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"560 sqm\",\"37\":\"FS Hough\",\"42\":[\"24\"],\"36\":\"2010\",\"33\":\"<p>This modern 3 level home is located on a north facing waterfront site overlooking Quaker\\u2019s Hat Bay. It is a composition of sharp rectangular forms clad with a mix of timber, painted render, zinc and sandstone. The home presents to the street front a predominantly opaque fa\\u00e7ade, but inside the home\\u2019s central circulation core is flooded with natural light from clerestory windows. At the rear, the house is predominantly translucent, large areas of glazing open up to terraces. Living areas are located on the middle entry level, bedrooms are above and the lowest level includes a gym, playroom and self contained flat. A lawn leads onto a large pool and entertainment terrace to extend the living areas.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"253\"],\"39\":\"Steve Back\",\"43\":{\"264\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"262\"],\"altText\":\"\"}},\"265\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"255\"],\"altText\":\"\"}},\"266\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"256\"],\"altText\":\"\"}},\"267\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"257\"],\"altText\":\"\"}},\"268\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"258\"],\"altText\":\"\"}},\"269\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"259\"],\"altText\":\"\"}},\"270\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"260\"],\"altText\":\"\"}},\"271\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"261\"],\"altText\":\"\"}}},\"35\":\"MOSMAN\",\"41\":[\"263\"],\"34\":\"CARRINGTON AVE\"}}','2014-06-25 04:12:18','2014-06-25 04:12:18','8d70315c-3ce6-4614-89f6-91f24a56089e'),
 ('140','273','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"DORSET RD\",\"slug\":\"dorset-rd\",\"postDate\":1403669460,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"405 sqm\",\"37\":\"Yuncken Construction Group\",\"42\":[\"24\"],\"36\":\"2011\",\"33\":\"<p>Designed to exploit its position, this 5 level contemporary home steps up a steep hill creating large roof terraces that maximise views over Middle Harbour. The home is wide and is typically 1 room deep. The glazed circulation space with stairs and a lift create a vertical tower at one end. Counterpoint to this, are the horizontal bands created by a bedroom wing with roof terrace above. Living areas are located on the upper level with a large terrace and access to the garden, while the master bedroom is on the top level.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"NORTHBRIDGE\",\"41\":\"\",\"34\":\"DORSET RD\"}}','2014-06-25 04:14:18','2014-06-25 04:14:18','d391e769-5867-4132-aa5d-be7572fa4605'),
