 ('143','292','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"LIGHTHOUSE RD\",\"slug\":\"lighthouse-rd\",\"postDate\":1403670015,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"250 sqm\",\"37\":\"Todd Knaus Constructions SX Projects\",\"42\":\"\",\"36\":\"2011\",\"33\":\"<p>This home is situated on a beachfront property overlooking Byron Bay. It was designed as part of a 2 home subdivision and incorporates local weathered basalt stone, fibre cement sheet cladding, dark stained timber and a large metal skillion roof with large eaves. The floor plan efficiently utilizes the available space and allows for generous living areas and 4 bedrooms. Timber framed sliding doors and louvered windows with wide covered decks create the ideal sub-tropical beach house.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"291\"],\"39\":\"Saul Goodwin\",\"43\":\"\",\"35\":\"BYRON BAY\",\"41\":\"\",\"34\":\"LIGHTHOUSE RD\"}}','2014-06-25 04:20:15','2014-06-25 04:20:15','0000e9f9-90bb-406f-87e7-3bdda2674113'),
