 ('145','323','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"MINNAMURRA ROAD\",\"slug\":\"minnamurra-road\",\"postDate\":1403670412,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"470 sqm\",\"37\":\"Joe Motherway Constructions\",\"42\":\"\",\"36\":\"2011\",\"33\":\"<p>Overlooking Sailors Bay, this contemporary low maintenance home was designed for a large family. The home is organised around a central circulation spine.  An open timber stair allows through views from the middle level entry. Living areas and a study\\/guest room are also at this level. The upper level includes 5 bedrooms, dressing rooms, bathrooms and access to the garage. The lowest level provides a rumpus room, gym, music room and another bathroom. This leads out to the swimming pool and terraced lawn. The skillion roof follows the site\\u2019s gradient. Materials include sandstone walls, spotted gum floors, aluminium framed windows and privacy screens.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"43\":{\"new1\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"314\"],\"altText\":\"\"}},\"new2\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"315\"],\"altText\":\"\"}},\"new3\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"316\"],\"altText\":\"\"}},\"new4\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"317\"],\"altText\":\"\"}},\"new5\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"318\"],\"altText\":\"\"}},\"new6\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"319\"],\"altText\":\"\"}},\"new7\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"321\"],\"altText\":\"\"}},\"new8\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"320\"],\"altText\":\"\"}},\"new9\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"321\"],\"altText\":\"\"}}},\"35\":\"NORTHBRIDGE\",\"41\":[\"322\"],\"34\":\"MINNAMURRA ROAD\"}}','2014-06-25 04:26:52','2014-06-25 04:26:52','920df51c-64ec-45ce-af39-73d470578c8c'),
 ('146','323','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"MINNAMURRA ROAD\",\"slug\":\"minnamurra-road\",\"postDate\":1403670360,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"470 sqm\",\"37\":\"Joe Motherway Constructions\",\"42\":\"\",\"36\":\"2011\",\"33\":\"<p>Overlooking Sailors Bay, this contemporary low maintenance home was designed for a large family. The home is organised around a central circulation spine.  An open timber stair allows through views from the middle level entry. Living areas and a study\\/guest room are also at this level. The upper level includes 5 bedrooms, dressing rooms, bathrooms and access to the garage. The lowest level provides a rumpus room, gym, music room and another bathroom. This leads out to the swimming pool and terraced lawn. The skillion roof follows the site\\u2019s gradient. Materials include sandstone walls, spotted gum floors, aluminium framed windows and privacy screens.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"43\":{\"324\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"314\"],\"altText\":\"\"}},\"325\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"315\"],\"altText\":\"\"}},\"326\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"316\"],\"altText\":\"\"}},\"327\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"317\"],\"altText\":\"\"}},\"328\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"318\"],\"altText\":\"\"}},\"329\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"319\"],\"altText\":\"\"}},\"330\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"321\"],\"altText\":\"\"}},\"331\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"320\"],\"altText\":\"\"}}},\"35\":\"NORTHBRIDGE\",\"41\":[\"322\"],\"34\":\"MINNAMURRA ROAD\"}}','2014-06-25 04:27:33','2014-06-25 04:27:33','d3b763a2-4ccb-4d9b-9903-52815a938227'),
 ('147','6','4','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"Philip  Corben\",\"slug\":\"ryan-belisle\",\"postDate\":1402011780,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"18\":\"<p>Architect, sailor, snow skier, surfer, cyclist, yoga enthusiast.<\\/p><p>Philip worked for ten years with the respected firms of Philip Cox and Partners, Clarke Perry Blackmore and Architecture Oceania. In 1990, he established Corben Architects with the overriding commitment to quality design and a high level of client service.<\\/p><p>Whilst Philip overviews every project within the office he is predominantly involved in the client liaison and design review. As the Managing Director, Philip is also responsible for the business management of the practice, assisted by Sarah Lahey, Pennie Hablethwaite and Marita Hermansson. <\\/p><p>Outside work, Philip shares his time between his outgoing wife Lucy,his three daughters and also tries to find time for his love of competitive sailing, long board surfing, the slopes of Thredbo, early morning yoga sessions and escaping to his beachside hideaway in Byron Bay.<\\/p>\",\"17\":\"B.Sc. (Arch) B Arch (Hon) FRAIA\\u00a0 Registration number 4616\",\"21\":[\"true\"],\"14\":\"Philip \",\"15\":\"Corben\",\"19\":[\"9\"],\"16\":\"Managing Director\",\"20\":\"director\"}}','2014-06-26 00:15:05','2014-06-26 00:15:05','dfe62880-936a-4a5f-8ed3-c2b9f4f156a8'),
 ('148','333','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"BERTHONG\",\"slug\":\"berthong\",\"postDate\":1403831276,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"37\":\"Sandlik Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2004\",\"33\":\"<p>Berthong is a significant historic property in Elizabeth Bay. Having undergone many alterations and a recent conversion into two duplex apartments, we were commissioned to restore the building back to a family home.<\\/p><p>The building fabric was extensively renewed, a new entry hall was created, stairs were rebuilt, a kitchen and bulters pantry was relocated to a more prominent position and 6 bathrooms were built. A large rear stone paved terrace and stairs was added to connect the house to the waterfront. This is a finely detailed grand property. The home received the MBA award in 2005.<\\/p>\",\"46\":[\"showCompleted\",\"showBuilder\"],\"47\":\"\",\"40\":\"\",\"39\":\"\",\"43\":\"\",\"35\":\"\",\"41\":\"\",\"34\":\"BERTHONG\"}}','2014-06-27 01:07:57','2014-06-27 01:07:57','3849984f-08f0-4ec1-bee8-b926793a457f'),
 ('149','333','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"BERTHONG\",\"slug\":\"berthong\",\"postDate\":1403831220,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"37\":\"Sandlik Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2004\",\"33\":\"<p>Berthong is a significant historic property in Elizabeth Bay. Having undergone many alterations and a recent conversion into two duplex apartments, we were commissioned to restore the building back to a family home.<\\/p><p>The building fabric was extensively renewed, a new entry hall was created, stairs were rebuilt, a kitchen and bulters pantry was relocated to a more prominent position and 6 bathrooms were built. A large rear stone paved terrace and stairs was added to connect the house to the waterfront. This is a finely detailed grand property. The home received the MBA award in 2005.<\\/p>\",\"46\":[\"showCompleted\",\"showBuilder\"],\"47\":\"\",\"40\":\"\",\"39\":\"\",\"43\":\"\",\"35\":\"\",\"41\":[\"334\"],\"34\":\"BERTHONG\"}}','2014-06-27 01:12:31','2014-06-27 01:12:31','925886df-dbcc-48da-9a7a-511324534956'),
 ('150','345','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WINDWARD\",\"slug\":\"windward\",\"postDate\":1403831766,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"420 sqm\",\"37\":\"J Motherway Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2007\",\"33\":\"<p>This large Federation home required significant restoration and upgrading of living, dining and kitchen areas. Two new covered terraces were added using detailing sympathetic to the original features. These now provide additional outdoor living areas and enjoy views over Sydney Harbour. The careful integration of old and new with selective use of materials gives a traditional home a new lease of life.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"MOSMAN\",\"41\":[\"341\"],\"34\":\"WINDWARD\"}}','2014-06-27 01:16:06','2014-06-27 01:16:06','f1f84a16-c315-4ad6-9652-a0c2ab1140c6'),
 ('151','345','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WINDWARD\",\"slug\":\"windward\",\"postDate\":1403831760,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"420 sqm\",\"37\":\"J Motherway Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2007\",\"33\":\"<p>This large Federation home required significant restoration and upgrading of living, dining and kitchen areas. Two new covered terraces were added using detailing sympathetic to the original features. These now provide additional outdoor living areas and enjoy views over Sydney Harbour. The careful integration of old and new with selective use of materials gives a traditional home a new lease of life.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"346\"],\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"MOSMAN\",\"41\":[\"341\"],\"34\":\"WINDWARD\"}}','2014-06-27 01:16:35','2014-06-27 01:16:35','51f0d00d-fa8b-44be-8617-89611850e259');
insert into `craft_entryversions` values('152','356','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"PARRIWI RD\",\"slug\":\"parriwi-rd\",\"postDate\":1403832048,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"420 sqm\",\"37\":\"J Wallace Constructions Pty Ltd\",\"42\":\"\",\"36\":\"2008\",\"33\":\"<p>This is a major renovation of a classic 1970\\u2019s home located on a steep site overlooking Sydney Harbour and Chinaman\\u2019s Beach. Spread over 3 main levels the confined internal spaces were opened up and enlarged. New services were incorporated, together with an internal lift. A steel framed covered terrace with operable roof was added to the rear of the home and a new roof with clerestory brings light and ventilation to the core of the home. The interior designer introduced contemporary artwork and furnishings to compliment the reinvigorated living spaces.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"347\"],\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"MOSMAN\",\"41\":[\"348\"],\"34\":\"PARRIWI RD\"}}','2014-06-27 01:20:48','2014-06-27 01:20:48','89014994-1a8e-4aaa-8002-c39369a6a9d4'),
 ('153','356','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"PARRIWI RD\",\"slug\":\"parriwi-rd\",\"postDate\":1403832000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"420 sqm\",\"37\":\"J Wallace Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2008\",\"33\":\"<p>This is a major renovation of a classic 1970\\u2019s home located on a steep site overlooking Sydney Harbour and Chinaman\\u2019s Beach. Spread over 3 main levels the confined internal spaces were opened up and enlarged. New services were incorporated, together with an internal lift. A steel framed covered terrace with operable roof was added to the rear of the home and a new roof with clerestory brings light and ventilation to the core of the home. The interior designer introduced contemporary artwork and furnishings to compliment the reinvigorated living spaces.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"347\"],\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"MOSMAN\",\"41\":[\"348\"],\"34\":\"PARRIWI RD\"}}','2014-06-27 01:21:09','2014-06-27 01:21:09','ad79fa7a-4a76-449a-94e2-1fad54416dac'),
 ('154','364','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"EUROBIN AVE\",\"slug\":\"eurobin-ave\",\"postDate\":1403832382,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"345\",\"37\":\"J Motherway Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2008\",\"33\":\"<p>This heritage listed 1930\\u2019s duplex apartment has been converted to a single family home. The street fa\\u00e7ade was retained but the interior was reorganised and a new addition covered terrace added at the rear. Living areas located on the upper level now enjoy views over Manly lagoon. The lower level includes bedrooms and rumpus room opening onto the north-facing terrace. A 2-storey void at the centre of the home provides an immediate connection between the entry and the upper levels. Traditional detailing was carried throughout the home and combined with more modern and custom joinery.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"MANLY\",\"41\":[\"357\"],\"34\":\"EUROBIN AVE\"}}','2014-06-27 01:26:22','2014-06-27 01:26:22','03024c47-4765-486a-ac42-c95dfe455642'),
 ('155','382','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"FAIRFAX RD\",\"slug\":\"fairfax-rd\",\"postDate\":1403832902,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"420\",\"37\":\"J Motherway Constructions\",\"42\":[\"34\"],\"36\":\"2008\",\"33\":\"<p>What was originally a 1970\\u2019s home with awkward hexagonal shaped spaces has been significantly rebuilt to provide a more streamlined home. Internal walls were removed to provide larger open plan living areas, the roofline was squared off and windows were replaced to provide larger opening to optimize light ventilation and the view. New interior finishes of limestone, timber veneer and metallic polyurethane maintain the modern approach<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"373\"],\"39\":\"Crag Bryant\",\"43\":\"\",\"35\":\"MOSMAN\",\"41\":[\"374\"],\"34\":\"FAIRFAX RD\"}}','2014-06-27 01:35:02','2014-06-27 01:35:02','de82cf6e-c228-4468-b5d5-b8e8d3fc23c3'),
 ('156','384','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"PEARL BAY AVENUE\",\"slug\":\"pearl-bay-avenue\",\"postDate\":1403833128,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"360 sqm\",\"37\":\"Northside Constructions\",\"42\":[\"34\"],\"36\":\"2009\",\"33\":\"<p>We were commissioned to redesign a 1950\\u2019s home perched on a cliff face overlooking a harbour reserve. The existing brick walls of the middle level were rendered and a 3<sup style=\\\"font-family: Arial, Helvetica, Verdana, Tahoma, sans-serif; background-color: initial;\\\">rd<\\/sup> level, added using reverse brick veneer construction with a stained cedar cladding for the external skin. The lowest level was expanded and opened up. The middle entry level containing living areas was also opened up and extended to link with a northfacing terrace covered by a timer framed pergola. The approach to the home is through a lush tropical garden and it is entered via stepping stones set over a fishpond. Dark stained timber floors, crisp white walls create a sophisticated and relaxed family home.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"383\"],\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"MOSMAN\",\"41\":\"\",\"34\":\"PEARL BAY AVENUE\"}}','2014-06-27 01:38:48','2014-06-27 01:38:48','911d447e-dd0e-4dcf-9903-3bd4768e6453'),
