 ('158','382','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"FAIRFAX ROAD\",\"slug\":\"fairfax-rd\",\"postDate\":1403832900,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"420 sqm\",\"37\":\"J Motherway Constructions\",\"42\":[\"34\"],\"36\":\"2008\",\"33\":\"<p>What was originally a 1970\\u2019s home with awkward hexagonal shaped spaces has been significantly rebuilt to provide a more streamlined home. Internal walls were removed to provide larger open plan living areas, the roofline was squared off and windows were replaced to provide larger opening to optimize light ventilation and the view. New interior finishes of limestone, timber veneer and metallic polyurethane maintain the modern approach<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"373\"],\"39\":\"Crag Bryant\",\"43\":\"\",\"35\":\"MOSMAN\",\"41\":[\"374\"],\"34\":\"FAIRFAX ROAD\"}}','2014-06-27 01:41:24','2014-06-27 01:41:24','901f6929-7266-4d72-a31a-69b7730ff052'),
 ('159','26','6','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"HOPETOUN AVENUE\",\"slug\":\"hopetoun-avenue-house\",\"postDate\":1402184220,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"515 sqm\",\"37\":\"SF Hough Pty Ltd\",\"42\":[\"24\"],\"36\":\"2006\",\"33\":\"<p>Located on a steep site, this modern 5 level home was designed to maximize the views and take advantage of its northern orientation.  The building\\u2019s form combines horizontal bands of rendered masonry which are complimented by a vertical double height glazed entry volume. The large skillion roof completes the building providing shade to the outdoor terraces.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"43\":{\"29\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"36\"],\"altText\":\"Slide One\"}},\"30\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"37\"],\"altText\":\"Slide Two\"}},\"31\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"38\"],\"altText\":\"\"}},\"43\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"39\"],\"altText\":\"\"}},\"44\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"40\"],\"altText\":\"\"}},\"45\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"41\"],\"altText\":\"\"}},\"46\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"42\"],\"altText\":\"\"}}},\"35\":\"MOSMAN\",\"41\":[\"36\"],\"34\":\"HOPETOUN AVENUE\"}}','2014-06-27 01:41:42','2014-06-27 01:41:42','bb972d31-57fe-4dda-bdcb-77da5520547f'),
 ('160','235','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"BRONTE ROAD\",\"slug\":\"bronte-rd\",\"postDate\":1403668200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"445 sqm\",\"37\":\"F S Hough Pty Ltd\",\"42\":[\"24\"],\"36\":\"2010\",\"33\":\"<p>This contemporary home, located on a wedge shaped site on the headland overlooking Bronte Beach, takes maximum advantage of the the beach and coastal views. The linear footprint of the home ensures all rooms enjoy the northeast views. A large skillion roof shelters the upper level. This contains the entry and living areas, a study and master bedroom suite. The lower floor provides more bedrooms and a playroom. The use of operable louvres provides semi transparency to the external terraces, this is balanced by sandstone walls and rendered masonry below.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"234\"],\"39\":\"Craig Bryant\",\"43\":{\"245\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"243\"],\"altText\":\"\"}},\"246\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"236\"],\"altText\":\"\"}},\"247\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"237\"],\"altText\":\"\"}},\"248\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"238\"],\"altText\":\"\"}},\"249\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"239\"],\"altText\":\"\"}},\"250\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"241\"],\"altText\":\"\"}},\"251\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"240\"],\"altText\":\"\"}},\"252\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"242\"],\"altText\":\"\"}}},\"35\":\"BRONTE\",\"41\":[\"244\"],\"34\":\"BRONTE ROAD\"}}','2014-06-27 01:42:01','2014-06-27 01:42:01','d91f9ba5-1b38-4601-9635-4ed7d01d1782'),
 ('161','254','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"CARRINGTON AVENUE\",\"slug\":\"carrington-ave\",\"postDate\":1403669160,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"560 sqm\",\"37\":\"FS Hough\",\"42\":[\"24\"],\"36\":\"2010\",\"33\":\"<p>This modern 3 level home is located on a north facing waterfront site overlooking Quaker\\u2019s Hat Bay. It is a composition of sharp rectangular forms clad with a mix of timber, painted render, zinc and sandstone. The home presents to the street front a predominantly opaque fa\\u00e7ade, but inside the home\\u2019s central circulation core is flooded with natural light from clerestory windows. At the rear, the house is predominantly translucent, large areas of glazing open up to terraces. Living areas are located on the middle entry level, bedrooms are above and the lowest level includes a gym, playroom and self contained flat. A lawn leads onto a large pool and entertainment terrace to extend the living areas.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"253\"],\"39\":\"Steve Back\",\"43\":{\"264\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"262\"],\"altText\":\"\"}},\"265\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"255\"],\"altText\":\"\"}},\"266\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"256\"],\"altText\":\"\"}},\"267\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"257\"],\"altText\":\"\"}},\"268\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"258\"],\"altText\":\"\"}},\"269\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"259\"],\"altText\":\"\"}},\"270\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"260\"],\"altText\":\"\"}},\"271\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"261\"],\"altText\":\"\"}}},\"35\":\"MOSMAN\",\"41\":[\"263\"],\"34\":\"CARRINGTON AVENUE\"}}','2014-06-27 01:42:17','2014-06-27 01:42:17','2de32214-268f-4049-b46d-b1f948667295'),
 ('162','356','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"PARRIWI ROAD\",\"slug\":\"parriwi-rd\",\"postDate\":1403832000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"420 sqm\",\"37\":\"J Wallace Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2008\",\"33\":\"<p>This is a major renovation of a classic 1970\\u2019s home located on a steep site overlooking Sydney Harbour and Chinaman\\u2019s Beach. Spread over 3 main levels the confined internal spaces were opened up and enlarged. New services were incorporated, together with an internal lift. A steel framed covered terrace with operable roof was added to the rear of the home and a new roof with clerestory brings light and ventilation to the core of the home. The interior designer introduced contemporary artwork and furnishings to compliment the reinvigorated living spaces.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"347\"],\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"MOSMAN\",\"41\":[\"348\"],\"34\":\"PARRIWI ROAD\"}}','2014-06-27 01:42:29','2014-06-27 01:42:29','ed5c6f75-2bc3-4152-9e5e-56c5015aed87'),
