 ('164','292','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"LIGHTHOUSE ROAD\",\"slug\":\"lighthouse-rd\",\"postDate\":1403670000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"250 sqm\",\"37\":\"Todd Knaus Constructions SX Projects\",\"42\":\"\",\"36\":\"2011\",\"33\":\"<p>This home is situated on a beachfront property overlooking Byron Bay. It was designed as part of a 2 home subdivision and incorporates local weathered basalt stone, fibre cement sheet cladding, dark stained timber and a large metal skillion roof with large eaves. The floor plan efficiently utilizes the available space and allows for generous living areas and 4 bedrooms. Timber framed sliding doors and louvered windows with wide covered decks create the ideal sub-tropical beach house.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"291\"],\"39\":\"Saul Goodwin\",\"43\":{\"305\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"293\"],\"altText\":\"\"}},\"306\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"295\"],\"altText\":\"\"}},\"307\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"296\"],\"altText\":\"\"}},\"308\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"294\"],\"altText\":\"\"}},\"309\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"298\"],\"altText\":\"\"}},\"310\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"299\"],\"altText\":\"\"}},\"311\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"297\"],\"altText\":\"\"}},\"312\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"300\"],\"altText\":\"\"}},\"313\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"302\"],\"altText\":\"\"}}},\"35\":\"BYRON BAY\",\"41\":[\"304\"],\"34\":\"LIGHTHOUSE ROAD\"}}','2014-06-27 01:42:53','2014-06-27 01:42:53','b4800a6d-ab7b-4320-a5a6-116c8e1cc2a4'),
 ('165','273','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"DORSET ROAD\",\"slug\":\"dorset-rd\",\"postDate\":1403669460,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"405 sqm\",\"37\":\"Yuncken Construction Group\",\"42\":[\"24\"],\"36\":\"2011\",\"33\":\"<p>Designed to exploit its position, this 5 level contemporary home steps up a steep hill creating large roof terraces that maximise views over Middle Harbour. The home is wide and is typically 1 room deep. The glazed circulation space with stairs and a lift create a vertical tower at one end. Counterpoint to this, are the horizontal bands created by a bedroom wing with roof terrace above. Living areas are located on the upper level with a large terrace and access to the garden, while the master bedroom is on the top level.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"43\":{\"283\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"277\"],\"altText\":\"\"}},\"284\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"274\"],\"altText\":\"\"}},\"285\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"275\"],\"altText\":\"\"}},\"286\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"276\"],\"altText\":\"\"}},\"287\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"278\"],\"altText\":\"\"}},\"288\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"279\"],\"altText\":\"\"}},\"289\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"280\"],\"altText\":\"\"}},\"290\":{\"type\":\"slide\",\"enabled\":\"1\",\"fields\":{\"image\":[\"281\"],\"altText\":\"\"}}},\"35\":\"NORTHBRIDGE\",\"41\":[\"282\"],\"34\":\"DORSET ROAD\"}}','2014-06-27 01:43:09','2014-06-27 01:43:09','52f1b3cd-1781-4a40-b0a3-ae3b02ff88c9'),
 ('166','401','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"INNER WEST\",\"slug\":\"inner-west\",\"postDate\":1403833700,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"500 sqm\",\"37\":\"Wentworth Projects \",\"42\":[\"34\"],\"36\":\"2009\",\"33\":\"<p>The project involved converting a vacant warehouse into a florist workshop and a luxurious residence. This mixed use building was designed to accommodate a large family and a collection of racing cars. The lower floor living areas revolve around the kitchen that features a 9 metre long polished concrete bench. It is a unique component of the design, folding out of the floor and floating over it. The upper floor contains bedroom suites and a second living space. A central courtyard garden was carved into the building and fills the living areas and bedrooms with sunlight and natural ventilation. The result is a rare living and working environment in an industrial context<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Steve Back\",\"43\":\"\",\"35\":\"WAREHOUSE\",\"41\":[\"392\"],\"34\":\"INNER WEST\"}}','2014-06-27 01:48:20','2014-06-27 01:48:20','018fb73f-6a84-478f-ba02-9f6f4d725270'),
 ('167','409','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"CREMORNE ROAD \",\"slug\":\"cremorne-road\",\"postDate\":1403833974,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"300 sqm\",\"37\":\"John Thew Constructions\",\"42\":\"\",\"36\":\"2009\",\"33\":\"<p>A large federation home with views over Mosman Bay was refurbished and restored. The approach balanced the retention of many period architectural features with the removal of walls and refurbishment of rooms to create a stronger connection between spaces. This allowed light and views to rooms that were otherwise deprived. A palette of dark stained floors, white walls, American walnut veneer and white polyurethane, together with careful selection of furniture and artwork by the interior designer results in a clean aesthetic to compliment the period details.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"408\"],\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"CREMORNE POINT\",\"41\":[\"402\"],\"34\":\"CREMORNE ROAD \"}}','2014-06-27 01:52:54','2014-06-27 01:52:54','2f3d12a8-771d-426a-b732-24680bcaa0e5'),
