 ('170','409','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"CREMORNE ROAD \",\"slug\":\"cremorne-road\",\"postDate\":1403833920,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"300 sqm\",\"37\":\"John Thew Constructions\",\"42\":[\"34\"],\"36\":\"2009\",\"33\":\"<p>A large federation home with views over Mosman Bay was refurbished and restored. The approach balanced the retention of many period architectural features with the removal of walls and refurbishment of rooms to create a stronger connection between spaces. This allowed light and views to rooms that were otherwise deprived. A palette of dark stained floors, white walls, American walnut veneer and white polyurethane, together with careful selection of furniture and artwork by the interior designer results in a clean aesthetic to compliment the period details.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"408\"],\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"CREMORNE\",\"41\":[\"402\"],\"34\":\"CREMORNE ROAD \"}}','2014-06-27 01:56:19','2014-06-27 01:56:19','f41c51b8-2aaf-40c5-8231-b8de9f87cdee'),
 ('171','420','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"MARINE PARADE\",\"slug\":\"marine-parade\",\"postDate\":1403834362,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"480 sqm\",\"37\":\"Gartner Rose\",\"42\":[\"34\"],\"36\":\"2010\",\"33\":\"<p>The project is a transformation of a Victorian terrace house on a waterfront site into a modern open plan 4 bedroom home. While the building shell was retained, the internal layout was reconfigured. A 3<sup style=\\\"font-family: Arial, Helvetica, Verdana, Tahoma, sans-serif; background-color: initial;\\\">rd<\\/sup> level attic was removed to reduce the building scale. A zinc-clad fa\\u00e7ade frames the home; steel and timber framework and coloured glass balustrade add greater complexity. A sophisticated steel interior design with a controlled use of strong colours further enriches the home.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Steve Back\",\"43\":\"\",\"35\":\"DOUBLE BAY\",\"41\":[\"411\"],\"34\":\"MARINE PARADE\"}}','2014-06-27 01:59:22','2014-06-27 01:59:22','c4858038-c6dc-44b5-afad-1ae061105e50'),
 ('172','421','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SEAFORTH CRESCENT\",\"slug\":\"seaforth-crescent\",\"postDate\":1403834863,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"500\",\"37\":\"FS Hough Pty Ltd\",\"42\":\"\",\"36\":\"2011\",\"33\":\"<p>This challenging project involved the remodelling of a 1960\\u2019s 5 level waterfront home on a precipitous south facing site. The house was stripped back to its concrete framework. A new circulation stair and lift was attached to the rear of the home and a new steel framed structure was attached to the waterfront side supporting balconies for all levels.  A two storey void on the living area floods these spaces with northern light. The restrained&nbsp;palette&nbsp;of materials of white walls, blackbutt timber floors and pietra grey marble enhance the sharp design. A&nbsp;crumbling 1960\\u2019s home has been transformed into a striking contemporary home that now engagtes with its context.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant \",\"43\":\"\",\"35\":\"SEAFORTH\",\"41\":\"\",\"34\":\"SEAFORTH CRESCENT\"}}','2014-06-27 02:07:43','2014-06-27 02:07:43','18663755-5c17-478f-996f-3b517a2a15f4'),
