 ('175','438','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"NORTH\",\"slug\":\"north\",\"postDate\":1403835501,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"315 sqm\",\"37\":\"J & S Mitchell Pty Ltd\",\"42\":[\"34\"],\"36\":\"2012\",\"33\":\"<p>A 1970\\u2019s two storey home occupied this prime waterfront property and our clients had plans to demolish it and build a new home.  We convinced them to retain the home, reorganise the layout and extend it to improve the relationship with the beachfront. A new single level&nbsp;pavilion&nbsp;was added to the rear and a new covered terrace and kitchen connects this to the original home. The existing building was reorganised to&nbsp;provide 5 bedrooms and a light filled entrance hall.  The home is now a sharp contemporary beach house with a direct connection to the garden and beach beyond.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"428\"],\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"AVOCA\",\"41\":[\"429\"],\"34\":\"NORTH\"}}','2014-06-27 02:18:21','2014-06-27 02:18:21','fbeeabcf-3785-40a3-a1fc-b857d2adc0f1'),
 ('176','448','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WAIWERA STREET \",\"slug\":\"waiwera-street\",\"postDate\":1403836783,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"245 sqm\",\"37\":\"Dobsonei\",\"42\":[\"34\"],\"36\":\"2013\",\"33\":\"\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"439\"],\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"McMAHONS POINT\",\"41\":[\"440\"],\"34\":\"WAIWERA STREET \"}}','2014-06-27 02:39:43','2014-06-27 02:39:43','925170a5-4b6c-44a9-80da-1b0dacda7740'),
 ('177','450','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WARWICK AVENUE\",\"slug\":\"warwick-avenue\",\"postDate\":1403836999,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"269 sqm\",\"37\":\"Bellamy Builders Pty Ltd\",\"42\":\"\",\"36\":\"2012\",\"33\":\"<p>Like many of its kind, this federation home required the usual removal of poorly considered additions in order to reach its potential. A small 1980\\u2019s kitchen and bathroom on the northern side blocked access to the garden and sunlight. Once removed a new large living space was created linking to the garden. A second level was incorporated into the roof and provides study, master bedroom suite and balcony. Original rooms were refurnished allowing the owners to enjoy a beautiful character filled home with living areas bathed in sunlight.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"439\"],\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"CAMMERAY\",\"41\":\"\",\"34\":\"WARWICK AVENUE\"}}','2014-06-27 02:43:19','2014-06-27 02:43:19','aaa4ff51-40db-4a74-b47d-5e0a5fa809ea'),
 ('178','450','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WARWICK AVENUE\",\"slug\":\"warwick-avenue\",\"postDate\":1403836980,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"269 sqm\",\"37\":\"Bellamy Builders Pty Ltd \",\"42\":[\"34\"],\"36\":\"2012\",\"33\":\"<p>Like many of its kind, this federation home required the usual removal of poorly considered additions in order to reach its potential. A small 1980\\u2019s kitchen and bathroom on the northern side blocked access to the garden and sunlight. Once removed a new large living space was created linking to the garden. A second level was incorporated into the roof and provides study, master bedroom suite and balcony. Original rooms were refurnished allowing the owners to enjoy a beautiful character filled home with living areas bathed in sunlight.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"451\"],\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"CAMMERAY\",\"41\":[\"452\"],\"34\":\"WARWICK AVENUE\"}}','2014-06-27 02:45:06','2014-06-27 02:45:06','9d0f1ffe-2f91-40a8-881e-5463ae29e147'),
 ('179','469','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SHELLBANK AVENUE\",\"slug\":\"shellbank-avenue-1\",\"postDate\":1403837290,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"760\",\"37\":\"Sandlik Constructions\",\"42\":[\"34\"],\"36\":\"2009\",\"33\":\"<p>We were commissioned to undertake a major renovation to this large waterfront home. The property comprises a two storey garage building, a three storey home and a boatshed. Once stripped back to the bare floor plates, all three buildings were transformed with large window openings, a new zinc roof and sandstone, zinc and stained cedar cladding. Rooms were reorganized and streamlined with a sophisticated interior design by Interni, including the sculptural central staircase. The swimming pool was rebuilt in a new location to improve the connection to the waterfront and the Dangar Group provided a contemporary garden employing interlocking zinc clad boxes with lush planting to complete the design.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Richard Glover\",\"43\":\"\",\"35\":\"MOSMAN\",\"41\":[\"460\"],\"34\":\"SHELLBANK AVENUE\"}}','2014-06-27 02:48:10','2014-06-27 02:48:10','32ec07cb-b920-4c61-ae43-32070812ca05'),
 ('180','478','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SHADFORTH STREET\",\"slug\":\"shadforth-street\",\"postDate\":1403837486,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"400 sqm\",\"37\":\"J Motherway Constructions     \",\"42\":[\"34\"],\"36\":\"2013\",\"33\":\"<p>This home exemplifies a clever integration of contemporary design with a traditional Federation dwelling. The original cottage was carefully restored and a new two storey living and bedroom pavilion was constructed behind, detached from the house by a courtyard and glass lined circulation volume. Main living areas open out to the rear garden and back to the sheltered courtyard. What was a small cottage is now a generous light filled family home.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"470\"],\"39\":\"Craig Byrant\",\"43\":\"\",\"35\":\"MOSMAN\",\"41\":[\"477\"],\"34\":\"SHADFORTH STREET\"}}','2014-06-27 02:51:26','2014-06-27 02:51:26','1c05e1d4-c651-4950-acee-b494c4b997ce'),
 ('181','486','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WONGA ROAD\",\"slug\":\"wonga-road\",\"postDate\":1403837749,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"37\":\"JP Thew Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2014\",\"33\":\"\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"CREMORNE\",\"41\":[\"479\"],\"34\":\"WONGA ROAD\"}}','2014-06-27 02:55:49','2014-06-27 02:55:49','fbcac9db-678a-4268-afcf-6fe9d5663eff'),
 ('182','497','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"THE ESTHERS\",\"slug\":\"the-esthers\",\"postDate\":1403838034,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"755 sqm\",\"37\":\"SX Projects Pty Ltd\",\"42\":[\"32\"],\"36\":\"2007\",\"33\":\"<p>This contemporary duplex apartment complex sits on a prominent corner close to the beach. The upper level apartment includes large decks and a wet edge pool, the lower level apartment has a large north facing garden. A central courtyard ensures northern light reaches the complex\\u2019s core. Spacious internal rooms, which combine a casual beachside feel with luxurious finishes, seamlessly connect to outdoor terraces and gardens. The result is a beautiful beachside apartment development cleverly integrated with its surroundings.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":\"\",\"40\":[\"487\"],\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"\",\"41\":[\"488\"],\"34\":\"THE ESTHERS\"}}','2014-06-27 03:00:34','2014-06-27 03:00:34','ab791acf-08d6-4373-bdd9-80f37aeb215a'),
 ('183','504','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SWERVE &amp; CO \",\"slug\":\"swerve-amp-co\",\"postDate\":1403838246,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"100 sqm\",\"37\":\"Kevin Brown\",\"42\":[\"33\"],\"36\":\"2010\",\"33\":\"<p>We were commissioned to design the fit-out of a new caf\\u00e9-bar-restaurant inserted in a long narrow commercial space. The space is organised with the work and serving area on one side and a long banquette dining space on the other. A horizontal band of backlit mirror and pendant lighting reinforce the linear arrangement and enhance the dining space. Patterns feature strongly in the timber slat detailing to shelving and wall panels of colourful striped fabric.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"43\":\"\",\"35\":\"CAFE\",\"41\":[\"503\"],\"34\":\"SWERVE & CO \"}}','2014-06-27 03:04:07','2014-06-27 03:04:07','4b479f1d-79c6-4e0c-81e6-2e30b704ca54'),
