 ('202','21','5','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"Service\",\"slug\":\"service\",\"postDate\":1402027620,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h4>Service<\\/h4><p>The team of architects, designers, project managers and support staff at Corben Architects are dedicated to excellence and motivated by client satisfaction.<\\/p><p> As Managing Director, Philip Corben maintains a personal involvement in all the design work and client liaison. The execution of the projects is undertaken by an experienced staff, comprising three Directors , two Associates and nine Project Architects assisted by CAD draftspersons and administration staff.<\\/p><p> The practice utilises sophisticated computer systems including Archicad and Vectorworks CAD software for 2D design and documentation and 3D modelling and Total Synergy for back of house office management.<\\/p><p> Corben Architects has a close liaison with a broad range of experienced consultants and building contractors who readily combine together on a project by project basis to provide a total and comprehensive service.<\\/p><p>The practice is renowned for providing practical advice to fulfil client and project briefs and control budgets whilst meeting their deadlines. At Corben Architects we work as a team with our clients to meet our mutual primary objective; to ensure our clients are as proud of their projects as we are of our architecture.<\\/p>\",\"32\":[\"16\"]}}','2014-07-01 03:41:52','2014-07-01 03:41:52','940e1f81-1c4f-46d1-997b-0f7dd7c02a24'),
