 ('204','20','5','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"Architecture\",\"slug\":\"architecture\",\"postDate\":1402027620,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h4>Architecture&nbsp;<\\/h4><p> Corben Architects approach to every project is to analyse the brief and context of the site to arrive at a clear design and planning solution.This approach is undertaken without limiting design innovation to achieve practical, cost effective design solutions that create great looking buildings and comfortable, living and working environments.<\\/p><p> Able to adapt to a wide variety of project styles, from historic restorations to contemporary modern design, the key objective of each commision is to design and build projects that fit comfortably within their urban context or natural surrounding. This approach is extended in the integration between old and new architecture.<\\/p><p>As part of the overall project strategy, we keep the design principles simple and uncomplicated to allow our ideas to develop with clarity. Our buildings are distinctive by their individuality rather than their similarity.<\\/p>\",\"32\":[\"16\"]}}','2014-07-01 03:48:34','2014-07-01 03:48:34','4a20c757-f4df-4e6a-a81c-1f55ee497c00'),
 ('205','22','5','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"Fees\",\"slug\":\"fees\",\"postDate\":1402027680,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h4>Fees&nbsp;<\\/h4><p> Although we work on a variety of fee arrangements, most  residential projects are undertaken on a percentage fee, based on the final cost of the project including all internal fitout, external works and landscaping (exc gst). We adopt this approach as it is the fairest means of remuneration for the work we actually design, document and administer during construction.<\\/p><p> The percentage fee for a full services commission on a new domestic project range from 9-15% depending on the value of the project and the level of finish. Alterations and additions generally attract an additional fee depending on the complexity of the works and the degree of alteration. Multi unit residential projects generally attract a lesser fee in the range of 5-9% depending the value of the project, the number of units, the degree of repetition and the level of finish and detail.<\\/p><p> Percentage based fees are generally divided into the following stages:\\u2028Master planning \\/ initial sketch design 5%\\u2028Full sketch design 5%\\u2028Design development to Development Application 15%\\u2028Contract documentation to Construction Certificate 20%\\u2028Contract documentation to tender 20%\\u2028Tendering and contract negotiation 5%\\u2028Contract administration during construction 30%<\\/p><p> We also work on a time plus disbursements basis or a lump sum fee for a defined stage or specific scope of work.<\\/p><p> Due to the adhoc nature of the Development Application assessment process and inevitable neighbour objections, all council and neighbour negotiations are undertaken on a time and disbursement basis.<\\/p><p> We are able to provide partial services as may be required although we do not encourage this approach as we maintain the finest and most successful projects are the result of the architect maintaining a close involvement throughout the entire design, documentation and construction process.<\\/p><p>Whilst our fees are consistent with the industry standard we provide a high level of skill and expertise and an even higher level of client service.<\\/p>\",\"32\":\"\"}}','2014-07-01 03:49:40','2014-07-01 03:49:40','41402729-8e2b-4446-babf-309db820d748'),
