architect maintaining a close involvement throughout the entire design, documentation and construction process.<\\/p><p>Whilst our fees are consistent with the industry standard we provide a high level of skill and expertise and an even higher level of client service.<\\/p>\",\"32\":\"\"}}','2014-07-01 03:49:50','2014-07-01 03:49:50','09754619-7e76-470e-b895-011a852d5e26'),
 ('207','19','5','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"About\",\"slug\":\"about\",\"postDate\":1402027560,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h4>About&nbsp;<\\/h4><p> Corben Architects is an experienced, Sydney based, architectural practice committed to the creation of great buildings.<\\/p><p> The practice specialises in sophisticated and distinctive residential projects, ranging from high quality individual houses to large, multi-unit, apartment developments. Corben Architect\'s work encompasses a wide variety of architectural design approaches ranging from heritage restoration to innovative contemporary design.<\\/p><p> The practice predominantly undertakes work in Sydney within the Municipalities of Sydney City, Mosman, Manly, North Sydney, Willoughby, Warringah, Pittwater and Woollahra. We have also designed and built beach houses, mountain lodges and rural estates throughout Australia.<\\/p><p> Our success is a reflection of our ability to carefully listen to our client\'s brief, assess their needs, fulfil their vision and exceed their expectations by creating buildings that are functional, practical and comfortable living and working environments.<\\/p><p> All our work is the direct result of client recommendations and referrals.<\\/p><p>At Corben Architects we provide practical advice whilst controlling budgets and meeting deadlines. We work as a team with our clients to meet our mutual primary objective; to ensure our clients are as proud of their projects as we are of our architecture.<\\/p>\",\"32\":\"\"}}','2014-07-01 03:51:13','2014-07-01 03:51:13','2cb84620-0bb1-4fd3-b98c-2f11e19427ef'),
