insert into `craft_entryversions` values('212','18','5','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"Privacy Policy\",\"slug\":\"privacy-policy\",\"postDate\":1402027320,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h4>YOUR PRIVACY<\\/h4><p><br>At Corben Architects we respect your right to privacy and we understand that, as a visitor to corben.com.au, you prefer to control your own personal information. For this reason, we may ask you to register or to provide personal information when you request information.<br>We will guard the personal information you share with us When you provide Corben Architects with your name, e-mail address, mailing address, or telephone number, and you do not \'opt out,\' Corben Architects may use the provided information to alert you to updated information, new services, and other Corben Architects information. Corben Architects does not offer or allow the selling of any user-provided information to third parties.<\\/p><p>Corben Architects respects the rights users give us when opting to receive e-mail communications and enforces internal policies to preserve those rights. It is our objective to retain the long-term ability to continue to communicate with our users.<\\/p><p>If you do not want Corben Architects to contact you, you may \\\"opt out\\\" of this preference at any time, whether you\'re online or contacting Corben Architects directly.<\\/p><p><strong>Contact Us<\\/strong><br>You can help Corben Architects maintain the accuracy of your personal information by notifying us when you change your e-mail address. If at any time you wish to update your information or you prefer to stop receiving communication from Corben Architects, feel free to contact us at any time.<br>mail@corben.com.au<\\/p><p><br>If you change your e-mail or postal address, please contact Corben Architects. In order to make the appropriate corrections, please include both your old and new address. Corben Architects may occasionally update, amend, or change this Privacy Policy based on user feedback and as needed or appropriate. If we decide to materially change our privacy policy, we will post those changes to this privacy statement, and will e-mail the information to our users so that they are always aware of what information we collect, how we use it, and under what circumstances, if any, we disclose it. We will use information in accordance with the privacy policy under which the information was collected.<br>Users will always have a choice as to whether or not we use their information in accordance with, and in respect to, the posted privacy policy. If users have opted out of all communication with the site, or deleted\\/deactivated their account, then they will not be contacted<\\/p><p><strong>Links<\\/strong><br>The Corben Architects website may contain links to other sites. Corben Architects assumes no responsibility for the content or the privacy policies and practices of such websites. Corben Architects encourages you to read the privacy statements of these linked sites; their privacy practices may differ from ours.<\\/p>\",\"32\":[\"16\"]}}','2014-07-01 07:35:07','2014-07-01 07:35:07','7e47d995-781f-45eb-83db-d34a4bcce845'),
