ser feedback and as needed or appropriate. If we decide to materially change our privacy policy, we will post those changes to this privacy statement, and will e-mail the information to our users so that they are always aware of what information we collect, how we use it, and under what circumstances, if any, we disclose it. We will use information in accordance with the privacy policy under which the information was collected.<br>Users will always have a choice as to whether or not we use their information in accordance with, and in respect to, the posted privacy policy. If users have opted out of all communication with the site, or deleted\\/deactivated their account, then they will not be contacted<\\/p><p><strong>Links<\\/strong><br>The Corben Architects website may contain links to other sites. Corben Architects assumes no responsibility for the content or the privacy policies and practices of such websites. Corben Architects encourages you to read the privacy statements of these linked sites; their privacy practices may differ from ours.<\\/p>\",\"32\":\"\"}}','2014-07-01 07:36:17','2014-07-01 07:36:17','3ab54164-b64d-455f-905a-c13f4b6c2e9a'),
 ('216','17','5','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"Disclaimer\",\"slug\":\"disclaimer\",\"postDate\":1402027260,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h4>DISCLAIMER<\\/h4><p><strong>General<\\/strong><br>The materials presented in the Corben Architects web pages are provided voluntarily as a service to our clients.<\\/p><p><strong>Disclaimer of Liability<\\/strong><br>While every effort will be made to ensure that the information contained within the Website is accurate and up to date, Corben Architects makes no warranty, representation or undertaking whether expressed or implied, nor does it assume any legal liability, whether direct or indirect, or responsibility for the accuracy, completeness, or usefulness of any information.<\\/p><p><strong>Copyright<\\/strong><br>Unless otherwise stated, copyright of all material published within this website is reserved by Corben Architects. All rights are reserved.<br>As permitted under the provisions of the Copyright Act 1968, no part may be reproduced or re-used for any purposes whatsoever without the prior written permission of Corben Architects.<\\/p><p>For further information please contact Corben Architects via email: mail@corben.com.au<\\/p>\",\"32\":\"\"}}','2014-07-01 07:37:11','2014-07-01 07:37:11','1d7b5998-a470-4ad5-a5d8-ec11bd90fe08'),
 ('217','19','5','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"About\",\"slug\":\"about\",\"postDate\":1402027560,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h4><\\/h4><h4>ABOUT<\\/h4><p> Corben Architects is an experienced, Sydney based, architectural practice committed to the creation of great buildings.<\\/p><p> The practice specialises in sophisticated and distinctive residential projects, ranging from high quality individual houses to large, multi-unit, apartment developments. Corben Architect\'s work encompasses a wide variety of architectural design approaches ranging from heritage restoration to innovative contemporary design.<\\/p><p> The practice predominantly undertakes work in Sydney within the Municipalities of Sydney City, Mosman, Manly, North Sydney, Willoughby, Warringah, Pittwater and Woollahra. We have also designed and built beach houses, mountain lodges and rural estates throughout Australia.<\\/p><p> Our success is a reflection of our ability to carefully listen to our client\'s brief, assess their needs, fulfil their vision and exceed their expectations by creating buildings that are functional, practical and comfortable living and working environments.<\\/p><p> All our work is the direct result of client recommendations and referrals.<\\/p><p>At Corben Architects we provide practical advice whilst controlling budgets and meeting deadlines. We work as a team with our clients to meet our mutual primary objective; to ensure our clients are as proud of their projects as we are of our architecture.<\\/p>\",\"32\":\"\"}}','2014-07-01 07:37:30','2014-07-01 07:37:30','eb731428-6813-4f3c-8fea-ee9a6d222f19'),
