 ('222','26','6','1','en_us',null,'{\"authorId\":\"1\",\"title\":\"HOPETOUN AVENUE\",\"slug\":\"hopetoun-avenue-house\",\"postDate\":1402184220,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"515 sqm\",\"37\":\"SF Hough Pty Ltd\",\"42\":[\"24\"],\"36\":\"2006\",\"33\":\"<p>Located on a steep site, this modern 5 level home was designed to maximize the views and take advantage of its northern orientation.  The building\\u2019s form combines horizontal bands of rendered masonry which are complimented by a vertical double height glazed entry volume. The large skillion roof completes the building providing shade to the outdoor terraces.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"61\":[\"36\",\"37\",\"38\",\"39\",\"40\",\"41\",\"42\"],\"35\":\"MOSMAN\",\"41\":[\"36\"],\"34\":\"HOPETOUN AVENUE\"}}','2014-07-04 18:33:55','2014-07-04 18:33:55','46e0f8b7-cd1f-48c4-84ed-c4d9017dd8fe'),
 ('223','26','6','1','en_us',null,'{\"authorId\":\"1\",\"title\":\"HOPETOUN AVENUE\",\"slug\":\"hopetoun-avenue-house\",\"postDate\":1402184220,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"515 sqm\",\"37\":\"SF Hough Pty Ltd\",\"42\":[\"24\"],\"36\":\"2006\",\"33\":\"<p>Located on a steep site, this modern 5 level home was designed to maximize the views and take advantage of its northern orientation.  The building\\u2019s form combines horizontal bands of rendered masonry which are complimented by a vertical double height glazed entry volume. The large skillion roof completes the building providing shade to the outdoor terraces.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"61\":[\"36\",\"37\",\"38\",\"39\",\"40\",\"41\",\"42\"],\"35\":\"MOSMAN\",\"41\":[\"36\"],\"34\":\"HOPETOUN AVENUE\"}}','2014-07-04 18:37:25','2014-07-04 18:37:25','ab1b86c3-9064-4864-9976-bb67880e800f'),
 ('224','504','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SWERVE &amp; CO \",\"slug\":\"swerve-amp-co\",\"postDate\":1403838240,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"100 sqm\",\"37\":\"Kevin Brown\",\"42\":[\"33\"],\"36\":\"2010\",\"33\":\"<p>We were commissioned to design the fit-out of a new caf\\u00e9-bar-restaurant inserted in a long narrow commercial space. The space is organised with the work and serving area on one side and a long banquette dining space on the other. A horizontal band of backlit mirror and pendant lighting reinforce the linear arrangement and enhance the dining space. Patterns feature strongly in the timber slat detailing to shelving and wall panels of colourful striped fabric.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"61\":[\"502\",\"501\",\"500\",\"499\",\"498\"],\"35\":\"CAFE\",\"41\":[\"503\"],\"34\":\"SWERVE & CO \"}}','2014-07-07 01:08:33','2014-07-07 01:08:33','b895a8b7-ca81-4a98-a15e-7a0a0949922c'),
 ('225','497','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"THE ESTHERS\",\"slug\":\"the-esthers\",\"postDate\":1403838000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"755 sqm\",\"37\":\"SX Projects Pty Ltd\",\"42\":[\"32\"],\"36\":\"2007\",\"33\":\"<p>This contemporary duplex apartment complex sits on a prominent corner close to the beach. The upper level apartment includes large decks and a wet edge pool, the lower level apartment has a large north facing garden. A central courtyard ensures northern light reaches the complex\\u2019s core. Spacious internal rooms, which combine a casual beachside feel with luxurious finishes, seamlessly connect to outdoor terraces and gardens. The result is a beautiful beachside apartment development cleverly integrated with its surroundings.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":\"\",\"40\":[\"487\"],\"39\":\"Craig Bryant\",\"61\":[\"496\",\"495\",\"494\",\"493\",\"492\",\"491\",\"490\",\"489\"],\"35\":\"\",\"41\":[\"488\"],\"34\":\"THE ESTHERS\"}}','2014-07-07 01:09:47','2014-07-07 01:09:47','d05b18ec-93d0-482c-a7e3-0767ca34410b'),
 ('226','497','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"THE ESTHERS\",\"slug\":\"the-esthers\",\"postDate\":1403838000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"755 sqm\",\"37\":\"SX Projects Pty Ltd\",\"42\":[\"32\"],\"36\":\"2007\",\"33\":\"<p>This contemporary duplex apartment complex sits on a prominent corner close to the beach. The upper level apartment includes large decks and a wet edge pool, the lower level apartment has a large north facing garden. A central courtyard ensures northern light reaches the complex\\u2019s core. Spacious internal rooms, which combine a casual beachside feel with luxurious finishes, seamlessly connect to outdoor terraces and gardens. The result is a beautiful beachside apartment development cleverly integrated with its surroundings.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":\"\",\"40\":[\"487\"],\"39\":\"Craig Bryant\",\"61\":[\"496\",\"495\",\"494\",\"493\",\"492\",\"491\",\"490\",\"489\"],\"35\":\"\",\"41\":[\"488\"],\"34\":\"THE ESTHERS\"}}','2014-07-07 01:09:55','2014-07-07 01:09:55','6673be8a-62f8-45bd-82dc-d7e76d6ca71e'),
 ('227','486','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WONGA ROAD\",\"slug\":\"wonga-road\",\"postDate\":1403837700,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"37\":\"JP Thew Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2014\",\"33\":\"\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"61\":[\"485\",\"484\",\"483\",\"482\",\"481\",\"480\"],\"35\":\"CREMORNE\",\"41\":[\"479\"],\"34\":\"WONGA ROAD\"}}','2014-07-07 01:10:18','2014-07-07 01:10:18','8e6ca118-aff8-4a61-a8f7-8cf0f6cf4be4'),
 ('228','478','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SHADFORTH STREET\",\"slug\":\"shadforth-street\",\"postDate\":1403837460,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"400 sqm\",\"37\":\"J Motherway Constructions     \",\"42\":[\"34\"],\"36\":\"2013\",\"33\":\"<p>This home exemplifies a clever integration of contemporary design with a traditional Federation dwelling. The original cottage was carefully restored and a new two storey living and bedroom pavilion was constructed behind, detached from the house by a courtyard and glass lined circulation volume. Main living areas open out to the rear garden and back to the sheltered courtyard. What was a small cottage is now a generous light filled family home.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"470\"],\"39\":\"Craig Byrant\",\"61\":[\"476\",\"475\",\"474\",\"473\",\"472\",\"471\"],\"35\":\"MOSMAN\",\"41\":[\"477\"],\"34\":\"SHADFORTH STREET\"}}','2014-07-07 01:10:44','2014-07-07 01:10:44','a9406dbb-6b77-4a5a-b169-b8cc636057ab'),
 ('229','469','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SHELLBANK AVENUE\",\"slug\":\"shellbank-avenue-1\",\"postDate\":1403837280,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"760\",\"37\":\"Sandlik Constructions\",\"42\":[\"34\"],\"36\":\"2009\",\"33\":\"<p>We were commissioned to undertake a major renovation to this large waterfront home. The property comprises a two storey garage building, a three storey home and a boatshed. Once stripped back to the bare floor plates, all three buildings were transformed with large window openings, a new zinc roof and sandstone, zinc and stained cedar cladding. Rooms were reorganized and streamlined with a sophisticated interior design by Interni, including the sculptural central staircase. The swimming pool was rebuilt in a new location to improve the connection to the waterfront and the Dangar Group provided a contemporary garden employing interlocking zinc clad boxes with lush planting to complete the design.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Richard Glover\",\"61\":[\"468\",\"467\",\"466\",\"465\",\"464\",\"463\",\"462\",\"461\"],\"35\":\"MOSMAN\",\"41\":[\"460\"],\"34\":\"SHELLBANK AVENUE\"}}','2014-07-07 01:11:34','2014-07-07 01:11:34','18c8dfec-ec5c-478f-b33a-42d27ea0fb5a'),
 ('230','450','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WARWICK AVENUE\",\"slug\":\"warwick-avenue\",\"postDate\":1403836980,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"269 sqm\",\"37\":\"Bellamy Builders Pty Ltd \",\"42\":[\"34\"],\"36\":\"2012\",\"33\":\"<p>Like many of its kind, this federation home required the usual removal of poorly considered additions in order to reach its potential. A small 1980\\u2019s kitchen and bathroom on the northern side blocked access to the garden and sunlight. Once removed a new large living space was created linking to the garden. A second level was incorporated into the roof and provides study, master bedroom suite and balcony. Original rooms were refurnished allowing the owners to enjoy a beautiful character filled home with living areas bathed in sunlight.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"451\"],\"39\":\"Craig Bryant\",\"61\":[\"459\",\"458\",\"457\",\"456\",\"455\",\"454\",\"453\"],\"35\":\"CAMMERAY\",\"41\":[\"452\"],\"34\":\"WARWICK AVENUE\"}}','2014-07-07 01:11:56','2014-07-07 01:11:56','0d430004-5140-452d-b44d-dfefae83b4c3'),
 ('231','448','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WAIWERA STREET \",\"slug\":\"waiwera-street\",\"postDate\":1403836740,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"245 sqm\",\"37\":\"Dobsonei\",\"42\":[\"34\"],\"36\":\"2013\",\"33\":\"\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"439\"],\"39\":\"Craig Bryant\",\"61\":[\"447\",\"446\",\"445\",\"444\",\"443\",\"442\",\"441\"],\"35\":\"McMAHONS POINT\",\"41\":[\"440\"],\"34\":\"WAIWERA STREET \"}}','2014-07-07 01:12:21','2014-07-07 01:12:21','0de0de26-49d2-4a74-b447-f59028012c54'),
 ('232','438','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"NORTH\",\"slug\":\"north\",\"postDate\":1403835480,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"315 sqm\",\"37\":\"J & S Mitchell Pty Ltd\",\"42\":[\"34\"],\"36\":\"2012\",\"33\":\"<p>A 1970\\u2019s two storey home occupied this prime waterfront property and our clients had plans to demolish it and build a new home.  We convinced them to retain the home, reorganise the layout and extend it to improve the relationship with the beachfront. A new single level&nbsp;pavilion&nbsp;was added to the rear and a new covered terrace and kitchen connects this to the original home. The existing building was reorganised to&nbsp;provide 5 bedrooms and a light filled entrance hall.  The home is now a sharp contemporary beach house with a direct connection to the garden and beach beyond.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"428\"],\"39\":\"Craig Bryant\",\"61\":[\"437\",\"436\",\"435\",\"434\",\"433\",\"432\",\"431\",\"430\"],\"35\":\"AVOCA\",\"41\":[\"429\"],\"34\":\"NORTH\"}}','2014-07-07 01:12:52','2014-07-07 01:12:52','f8366456-a355-448d-96ac-002aff380dfd'),
 ('233','421','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SEAFORTH CRESCENT\",\"slug\":\"seaforth-crescent\",\"postDate\":1403834820,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"500\",\"37\":\"FS Hough Pty Ltd\",\"42\":[\"34\"],\"36\":\"2011\",\"33\":\"<p>This challenging project involved the remodelling of a 1960\\u2019s 5 level waterfront home on a precipitous south facing site. The house was stripped back to its concrete framework. A new circulation stair and lift was attached to the rear of the home and a new steel framed structure was attached to the waterfront side supporting balconies for all levels.  A two storey void on the living area floods these spaces with northern light. The restrained&nbsp;palette&nbsp;of materials of white walls, blackbutt timber floors and pietra grey marble enhance the sharp design. A&nbsp;crumbling 1960\\u2019s home has been transformed into a striking contemporary home that now engagtes with its context.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant \",\"61\":[\"426\",\"425\",\"424\",\"423\",\"427\"],\"35\":\"SEAFORTH\",\"41\":[\"422\"],\"34\":\"SEAFORTH CRESCENT\"}}','2014-07-07 01:13:36','2014-07-07 01:13:36','16c055a2-ffd4-43e6-8cb6-900749c7280b'),
 ('234','420','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"MARINE PARADE\",\"slug\":\"marine-parade\",\"postDate\":1403834340,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"480 sqm\",\"37\":\"Gartner Rose\",\"42\":[\"34\"],\"36\":\"2010\",\"33\":\"<p>The project is a transformation of a Victorian terrace house on a waterfront site into a modern open plan 4 bedroom home. While the building shell was retained, the internal layout was reconfigured. A 3<sup style=\\\"font-family: Arial, Helvetica, Verdana, Tahoma, sans-serif; background-color: initial;\\\">rd<\\/sup> level attic was removed to reduce the building scale. A zinc-clad fa\\u00e7ade frames the home; steel and timber framework and coloured glass balustrade add greater complexity. A sophisticated steel interior design with a controlled use of strong colours further enriches the home.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Steve Back\",\"61\":[\"419\",\"418\",\"417\",\"416\",\"415\",\"414\",\"413\",\"412\"],\"35\":\"DOUBLE BAY\",\"41\":[\"411\"],\"34\":\"MARINE PARADE\"}}','2014-07-07 01:14:08','2014-07-07 01:14:08','0c130685-c7d9-4c94-a4ea-148bf1869de1'),
 ('235','409','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"CREMORNE ROAD \",\"slug\":\"cremorne-road\",\"postDate\":1403833920,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"300 sqm\",\"37\":\"John Thew Constructions\",\"42\":[\"34\"],\"36\":\"2009\",\"33\":\"<p>A large federation home with views over Mosman Bay was refurbished and restored. The approach balanced the retention of many period architectural features with the removal of walls and refurbishment of rooms to create a stronger connection between spaces. This allowed light and views to rooms that were otherwise deprived. A palette of dark stained floors, white walls, American walnut veneer and white polyurethane, together with careful selection of furniture and artwork by the interior designer results in a clean aesthetic to compliment the period details.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"408\"],\"39\":\"Craig Bryant\",\"61\":[\"407\",\"406\",\"405\",\"404\",\"403\"],\"35\":\"CREMORNE\",\"41\":[\"402\"],\"34\":\"CREMORNE ROAD \"}}','2014-07-07 01:14:36','2014-07-07 01:14:36','db1d9fd5-dcf1-405c-9fcf-00a7b717b0e1'),
 ('236','401','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"INNER WEST\",\"slug\":\"inner-west\",\"postDate\":1403833680,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"500 sqm\",\"37\":\"Wentworth Projects \",\"42\":[\"34\"],\"36\":\"2009\",\"33\":\"<p>The project involved converting a vacant warehouse into a florist workshop and a luxurious residence. This mixed use building was designed to accommodate a large family and a collection of racing cars. The lower floor living areas revolve around the kitchen that features a 9 metre long polished concrete bench. It is a unique component of the design, folding out of the floor and floating over it. The upper floor contains bedroom suites and a second living space. A central courtyard garden was carved into the building and fills the living areas and bedrooms with sunlight and natural ventilation. The result is a rare living and working environment in an industrial context<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Steve Back\",\"61\":[\"400\",\"399\",\"398\",\"397\",\"396\",\"395\",\"394\",\"393\"],\"35\":\"WAREHOUSE\",\"41\":[\"392\"],\"34\":\"INNER WEST\"}}','2014-07-07 01:15:08','2014-07-07 01:15:08','c415f505-a188-4297-a22c-e43daeed5d64'),
 ('237','384','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"PEARL BAY AVENUE\",\"slug\":\"pearl-bay-avenue\",\"postDate\":1403833080,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"360 sqm\",\"37\":\"Northside Constructions\",\"42\":[\"34\"],\"36\":\"2009\",\"33\":\"<p>We were commissioned to redesign a 1950\\u2019s home perched on a cliff face overlooking a harbour reserve. The existing brick walls of the middle level were rendered and a 3<sup style=\\\"font-family: Arial, Helvetica, Verdana, Tahoma, sans-serif; background-color: initial;\\\">rd<\\/sup> level, added using reverse brick veneer construction with a stained cedar cladding for the external skin. The lowest level was expanded and opened up. The middle entry level containing living areas was also opened up and extended to link with a northfacing terrace covered by a timer framed pergola. The approach to the home is through a lush tropical garden and it is entered via stepping stones set over a fishpond. Dark stained timber floors, crisp white walls create a sophisticated and relaxed family home.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"383\"],\"39\":\"Craig Bryant\",\"61\":[\"391\",\"390\",\"389\",\"388\",\"387\",\"386\"],\"35\":\"MOSMAN\",\"41\":[\"385\"],\"34\":\"PEARL BAY AVENUE\"}}','2014-07-07 01:16:03','2014-07-07 01:16:03','68f5c810-e8f3-4d26-9605-ea5ae200f1e3'),
 ('238','382','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"FAIRFAX ROAD\",\"slug\":\"fairfax-rd\",\"postDate\":1403832900,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"420 sqm\",\"37\":\"J Motherway Constructions\",\"42\":[\"34\"],\"36\":\"2008\",\"33\":\"<p>What was originally a 1970\\u2019s home with awkward hexagonal shaped spaces has been significantly rebuilt to provide a more streamlined home. Internal walls were removed to provide larger open plan living areas, the roofline was squared off and windows were replaced to provide larger opening to optimize light ventilation and the view. New interior finishes of limestone, timber veneer and metallic polyurethane maintain the modern approach<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"373\"],\"39\":\"Crag Bryant\",\"61\":[\"381\",\"380\",\"379\",\"378\",\"377\",\"376\",\"375\"],\"35\":\"MOSMAN\",\"41\":[\"374\"],\"34\":\"FAIRFAX ROAD\"}}','2014-07-07 01:16:23','2014-07-07 01:16:23','05b15a3a-12d4-41c5-9fb4-706a8f83d3bc'),
 ('239','364','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"EUROBIN AVENUE\",\"slug\":\"eurobin-ave\",\"postDate\":1403832360,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"345\",\"37\":\"J Motherway Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2008\",\"33\":\"<p>This heritage listed 1930\\u2019s duplex apartment has been converted to a single family home. The street fa\\u00e7ade was retained but the interior was reorganised and a new addition covered terrace added at the rear. Living areas located on the upper level now enjoy views over Manly lagoon. The lower level includes bedrooms and rumpus room opening onto the north-facing terrace. A 2-storey void at the centre of the home provides an immediate connection between the entry and the upper levels. Traditional detailing was carried throughout the home and combined with more modern and custom joinery.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"61\":[\"363\",\"362\",\"361\",\"360\",\"359\",\"358\"],\"35\":\"MANLY\",\"41\":[\"357\"],\"34\":\"EUROBIN AVENUE\"}}','2014-07-07 01:16:39','2014-07-07 01:16:39','1fc9fb53-e7ba-4019-a9f6-d043ca09a9a2'),
 ('240','356','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"PARRIWI ROAD\",\"slug\":\"parriwi-rd\",\"postDate\":1403832000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"420 sqm\",\"37\":\"J Wallace Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2008\",\"33\":\"<p>This is a major renovation of a classic 1970\\u2019s home located on a steep site overlooking Sydney Harbour and Chinaman\\u2019s Beach. Spread over 3 main levels the confined internal spaces were opened up and enlarged. New services were incorporated, together with an internal lift. A steel framed covered terrace with operable roof was added to the rear of the home and a new roof with clerestory brings light and ventilation to the core of the home. The interior designer introduced contemporary artwork and furnishings to compliment the reinvigorated living spaces.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"347\"],\"39\":\"Craig Bryant\",\"61\":[\"355\",\"354\",\"353\",\"352\",\"351\",\"350\",\"349\"],\"35\":\"MOSMAN\",\"41\":[\"348\"],\"34\":\"PARRIWI ROAD\"}}','2014-07-07 01:17:04','2014-07-07 01:17:04','b9a25be2-4072-4eb4-b1bd-1683350078dd'),
 ('241','345','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WINDWARD\",\"slug\":\"windward\",\"postDate\":1403831760,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"420 sqm\",\"37\":\"J Motherway Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2007\",\"33\":\"<p>This large Federation home required significant restoration and upgrading of living, dining and kitchen areas. Two new covered terraces were added using detailing sympathetic to the original features. These now provide additional outdoor living areas and enjoy views over Sydney Harbour. The careful integration of old and new with selective use of materials gives a traditional home a new lease of life.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"346\"],\"39\":\"Craig Bryant\",\"61\":[\"344\",\"343\",\"342\"],\"35\":\"MOSMAN\",\"41\":[\"341\"],\"34\":\"WINDWARD\"}}','2014-07-07 01:17:28','2014-07-07 01:17:28','8b2e7317-1bb2-493d-8297-ac990bc3f04b'),
 ('242','333','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"BERTHONG\",\"slug\":\"berthong\",\"postDate\":1403831220,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"37\":\"Sandlik Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2004\",\"33\":\"<p>Berthong is a significant historic property in Elizabeth Bay. Having undergone many alterations and a recent conversion into two duplex apartments, we were commissioned to restore the building back to a family home.<\\/p><p>The building fabric was extensively renewed, a new entry hall was created, stairs were rebuilt, a kitchen and bulters pantry was relocated to a more prominent position and 6 bathrooms were built. A large rear stone paved terrace and stairs was added to connect the house to the waterfront. This is a finely detailed grand property. The home received the MBA award in 2005.<\\/p>\",\"46\":[\"showCompleted\",\"showBuilder\"],\"47\":\"\",\"40\":\"\",\"39\":\"\",\"61\":[\"340\",\"339\",\"338\",\"337\",\"336\",\"335\"],\"35\":\"\",\"41\":[\"334\"],\"34\":\"BERTHONG\"}}','2014-07-07 01:17:46','2014-07-07 01:17:46','b5e7b39f-f132-467c-b0d6-98b391ca549c'),
 ('243','323','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"MINNAMURRA ROAD\",\"slug\":\"minnamurra-road\",\"postDate\":1403670360,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"470 sqm\",\"37\":\"Joe Motherway Constructions\",\"42\":[\"24\"],\"36\":\"2011\",\"33\":\"<p>Overlooking Sailors Bay, this contemporary low maintenance home was designed for a large family. The home is organised around a central circulation spine.  An open timber stair allows through views from the middle level entry. Living areas and a study\\/guest room are also at this level. The upper level includes 5 bedrooms, dressing rooms, bathrooms and access to the garage. The lowest level provides a rumpus room, gym, music room and another bathroom. This leads out to the swimming pool and terraced lawn. The skillion roof follows the site\\u2019s gradient. Materials include sandstone walls, spotted gum floors, aluminium framed windows and privacy screens.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"61\":[\"314\",\"315\",\"316\",\"317\",\"318\",\"319\",\"320\",\"321\"],\"35\":\"NORTHBRIDGE\",\"41\":[\"322\"],\"34\":\"MINNAMURRA ROAD\"}}','2014-07-07 01:18:36','2014-07-07 01:18:36','40d5fefe-031d-4dec-8037-221976b2299e'),
 ('244','292','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"LIGHTHOUSE ROAD\",\"slug\":\"lighthouse-rd\",\"postDate\":1403670000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"250 sqm\",\"37\":\"Todd Knaus Constructions SX Projects\",\"42\":\"\",\"36\":\"2011\",\"33\":\"<p>This home is situated on a beachfront property overlooking Byron Bay. It was designed as part of a 2 home subdivision and incorporates local weathered basalt stone, fibre cement sheet cladding, dark stained timber and a large metal skillion roof with large eaves. The floor plan efficiently utilizes the available space and allows for generous living areas and 4 bedrooms. Timber framed sliding doors and louvered windows with wide covered decks create the ideal sub-tropical beach house.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"291\"],\"39\":\"Saul Goodwin\",\"61\":[\"293\",\"294\",\"295\",\"296\",\"297\",\"298\",\"299\",\"300\",\"301\",\"302\",\"303\"],\"35\":\"BYRON BAY\",\"41\":[\"304\"],\"34\":\"LIGHTHOUSE ROAD\"}}','2014-07-07 01:19:19','2014-07-07 01:19:19','ab1cef5e-0a81-4a3c-b9f5-08164e4d6f12'),
 ('245','273','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"DORSET ROAD\",\"slug\":\"dorset-rd\",\"postDate\":1403669460,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"405 sqm\",\"37\":\"Yuncken Construction Group\",\"42\":[\"24\"],\"36\":\"2011\",\"33\":\"<p>Designed to exploit its position, this 5 level contemporary home steps up a steep hill creating large roof terraces that maximise views over Middle Harbour. The home is wide and is typically 1 room deep. The glazed circulation space with stairs and a lift create a vertical tower at one end. Counterpoint to this, are the horizontal bands created by a bedroom wing with roof terrace above. Living areas are located on the upper level with a large terrace and access to the garden, while the master bedroom is on the top level.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"61\":[\"277\",\"274\",\"275\",\"276\",\"278\",\"279\",\"280\",\"281\"],\"35\":\"NORTHBRIDGE\",\"41\":[\"282\"],\"34\":\"DORSET ROAD\"}}','2014-07-07 01:19:53','2014-07-07 01:19:53','a42543bd-11fa-4553-8319-0ca807c008a7'),
 ('246','254','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"CARRINGTON AVENUE\",\"slug\":\"carrington-ave\",\"postDate\":1403669160,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"560 sqm\",\"37\":\"FS Hough\",\"42\":[\"24\"],\"36\":\"2010\",\"33\":\"<p>This modern 3 level home is located on a north facing waterfront site overlooking Quaker\\u2019s Hat Bay. It is a composition of sharp rectangular forms clad with a mix of timber, painted render, zinc and sandstone. The home presents to the street front a predominantly opaque fa\\u00e7ade, but inside the home\\u2019s central circulation core is flooded with natural light from clerestory windows. At the rear, the house is predominantly translucent, large areas of glazing open up to terraces. Living areas are located on the middle entry level, bedrooms are above and the lowest level includes a gym, playroom and self contained flat. A lawn leads onto a large pool and entertainment terrace to extend the living areas.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"253\"],\"39\":\"Steve Back\",\"61\":[\"262\",\"255\",\"256\",\"257\",\"258\",\"259\",\"260\",\"261\"],\"35\":\"MOSMAN\",\"41\":[\"263\"],\"34\":\"CARRINGTON AVENUE\"}}','2014-07-07 01:20:22','2014-07-07 01:20:22','22f6b9ac-1686-4201-af1f-9764d572f948'),
 ('247','235','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"BRONTE ROAD\",\"slug\":\"bronte-rd\",\"postDate\":1403668200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"445 sqm\",\"37\":\"F S Hough Pty Ltd\",\"42\":[\"24\"],\"36\":\"2010\",\"33\":\"<p>This contemporary home, located on a wedge shaped site on the headland overlooking Bronte Beach, takes maximum advantage of the the beach and coastal views. The linear footprint of the home ensures all rooms enjoy the northeast views. A large skillion roof shelters the upper level. This contains the entry and living areas, a study and master bedroom suite. The lower floor provides more bedrooms and a playroom. The use of operable louvres provides semi transparency to the external terraces, this is balanced by sandstone walls and rendered masonry below.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"234\"],\"39\":\"Craig Bryant\",\"61\":[\"243\",\"236\",\"237\",\"238\",\"239\",\"240\",\"241\",\"242\"],\"35\":\"BRONTE\",\"41\":[\"244\"],\"34\":\"BRONTE ROAD\"}}','2014-07-07 01:20:43','2014-07-07 01:20:43','747ecd4f-3054-4aa8-8e18-1e617ab6a482'),
 ('248','224','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WARRINGAH ROAD\",\"slug\":\"warringah-road\",\"postDate\":1403667840,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"450 sqm\",\"37\":\"SX Projects\",\"42\":[\"24\"],\"36\":\"2009\",\"33\":\"<p>This contemporary 3 level home sits on a battle-axe site. The careful placement ensured neighbours water views were protected. The sensitive design maintains privacy to both owners and neighbours. The strong rectangular form comprises planes of concrete and masonry separated by panels of timber battens, split face sandstone and large expanses of glazing. This is a sophisticated contemporary home inserted into a challenging site.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"213\"],\"39\":\"Alina Gozina\",\"61\":[\"216\",\"215\",\"217\",\"218\",\"219\",\"220\",\"221\",\"222\",\"223\"],\"35\":\"MOSMAN\",\"41\":[\"214\"],\"34\":\"WARRINGAH ROAD\"}}','2014-07-07 01:21:17','2014-07-07 01:21:17','79d6b941-338b-449c-8d78-aac4789129bc'),
 ('249','204','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WAMBERAL\",\"slug\":\"wamberal\",\"postDate\":1403667240,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"435 sqm\",\"37\":\"Gledhill Developments\",\"42\":[\"24\"],\"36\":\"2009\",\"33\":\"<p>This beachfront home sits on top of sand dunes overlooking Wamberal Beach and rests on 25 metre deep concrete piers. The home was designed as two separate pavilions. A two storey beach side pavillion contains living areas and kitchen with a master bedroom suite, a study and sitting room above. The second street side pavillion  accommodates a double garage, storerooms with guest bedrooms and self contained living areas above. The design is a sophisticated reinterpretation of the skillion roofed beach shack. It combines sandstone, rendered masonry, timber floors doors and windows to create a warm and inviting beach house retreat.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"203\"],\"39\":\"Craig Bryant\",\"61\":[\"199\",\"192\",\"193\",\"194\",\"195\",\"200\",\"201\",\"202\"],\"35\":\"BEACH\",\"41\":[\"191\"],\"34\":\"WAMBERAL\"}}','2014-07-07 01:21:48','2014-07-07 01:21:48','7e1545c2-be96-4f5e-912d-b87d2bf87a16'),
 ('250','160','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"GORDON STREET\",\"slug\":\"gordon-street\",\"postDate\":1403666520,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"350 sqm\",\"37\":\"Northern Building Pty Ltd\",\"42\":[\"24\"],\"36\":\"2009\",\"33\":\"<p>This house adopts an \\u2018H\\u2019 plan, the connecting link contains the entry and circulation spaces with living spaces at either end. The principal living area has 3.3m high ceilings with sliding doors that retract into the walls to provide a clean opening to a terrace, which leads onto the lawn and swimming pool area. A large reflection pond sits adjacent to the stair and is separated by 2 storey high sliding glass doors. While the core of the home has large expanses of glazing flooding the home with light, dense bamboo planting provides privacy. A colour palette of black zinc, white walls, grey stone floors reinforce the clean contemporary design.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"190\"],\"39\":\"Sharrin Rees\",\"61\":[\"161\",\"162\",\"163\",\"164\",\"165\",\"166\"],\"35\":\"MOSMAN\",\"41\":[\"167\"],\"34\":\"GORDON STREET\"}}','2014-07-07 01:22:07','2014-07-07 01:22:07','cc3c0cef-c0b1-4fd6-8aa9-328c4f906735'),
 ('251','151','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"CLOUDBREAK\",\"slug\":\"cloudbreak\",\"postDate\":1403666100,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"530 sqm\",\"37\":\"SX Projects\",\"42\":[\"24\"],\"36\":\"2008\",\"33\":\"<p>This large home was designed as an interpretation of a Balinese resort. The home is made up of 3 linked pavilions. A separate boathouse with pool house above provides separate accommodation and services a large wet edge pool. Extensive use of both new and recycled timber for wall cladding, floors and windows create a warm and comfortable relaxed environment. This is a unique house located on a prominent waterfront site.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":\"\",\"40\":[\"141\"],\"39\":\"Rodney Weidland\",\"61\":[\"145\",\"143\",\"144\",\"146\",\"147\",\"148\",\"149\",\"150\"],\"35\":\"\",\"41\":[\"142\"],\"34\":\"CLOUDBREAK\"}}','2014-07-07 01:22:42','2014-07-07 01:22:42','b3cccaf9-a22d-4639-bb4f-6a2ed96d1b1d'),
 ('252','123','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"STANTON ROAD\",\"slug\":\"stanton-road\",\"postDate\":1403665020,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"860 sqm\",\"37\":\"F S Hough Pty Ltd\",\"42\":[\"24\"],\"36\":\"2008\",\"33\":\"<p>This substantial home is located on a 1700m<sup style=\\\"font-family: Arial, Helvetica, Verdana, Tahoma, sans-serif; background-color: initial;\\\">2 site<\\/sup> with outstanding views over Balmoral Beach. The design combines contemporary elements and traditional architectural forms. A strong masonry lower floor, with formal and informal living areas, provides the base. The upper level, slightly recessed, contains the bedrooms. Wide eaves on the large shallow pitched roof complete the home. The use of deep colours and rich materials provides a luxurious backdrop for our client\\u2019s possessions.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"122\"],\"39\":\"Craig Bryant\",\"61\":[\"126\",\"124\",\"125\",\"127\",\"128\",\"129\",\"130\"],\"35\":\"MOSMAN\",\"41\":[\"131\"],\"34\":\"STANTON ROAD\"}}','2014-07-07 01:23:05','2014-07-07 01:23:05','e2e80ffb-3db2-4394-96db-8e62d4ca585c'),
 ('253','114','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SHELLBANK AVENUE\",\"slug\":\"shellbank-avenue\",\"postDate\":1403664600,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"810 sqm\",\"37\":\"Hoi Constructions Pty Ltd\",\"42\":[\"24\"],\"36\":\"2006\",\"33\":\"<p>Located on a large waterfront land holding, this substantial home was designed as two volumes. The entry hall, lift, stairwell, guest accommodation and garaging is in one part. Below this is located the 3 storey main house. A large carp pond and waterfall separate the two buildings. The home adopts a modern classical aesthetic where symmetry, a sense of balance and order dominate. All of this is complimented with Asian influences and an emphasis on natural stone and timbers.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"121\"],\"39\":\"Brett Boardman\",\"61\":[\"109\",\"104\",\"105\",\"106\",\"107\",\"108\",\"110\",\"111\",\"112\"],\"35\":\"MOSMAN\",\"41\":[\"113\"],\"34\":\"SHELLBANK AVENUE\"}}','2014-07-07 01:23:29','2014-07-07 01:23:29','3bdc4baa-5e8e-4ff2-a4ed-00c5d3173633'),
 ('254','96','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"HAMPDEN STREET\",\"slug\":\"hampden-street\",\"postDate\":1403664240,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"390 sqm\",\"37\":\"Tifad Developments Pty Ltd\",\"42\":[\"24\"],\"36\":\"2005\",\"33\":\"<p>This modern family home is designed as 2 volumes separated by a single storey entry core and a north facing central courtyard. At the street side is a 3 storey volume containing garaging, living areas and bedrooms, at the rear a 2 storey volume contains the main living area with further bedrooms above. This leads onto the rear garden with wet edge pool. Strategically placed large window openings flood the home with light while maintaining privacy.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"61\":[\"90\",\"88\",\"89\",\"91\",\"92\",\"93\",\"94\"],\"35\":\"MOSMAN\",\"41\":[\"95\"],\"34\":\"HAMPDEN STREET\"}}','2014-07-07 01:23:54','2014-07-07 01:23:54','b9445018-d88e-471a-b1c3-cc20a9d411fb'),
 ('255','96','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"HAMPDEN STREET\",\"slug\":\"hampden-street\",\"postDate\":1403664240,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"390 sqm\",\"37\":\"Tifad Developments Pty Ltd\",\"42\":[\"24\"],\"36\":\"2005\",\"33\":\"<p>This modern family home is designed as 2 volumes separated by a single storey entry core and a north facing central courtyard. At the street side is a 3 storey volume containing garaging, living areas and bedrooms, at the rear a 2 storey volume contains the main living area with further bedrooms above. This leads onto the rear garden with wet edge pool. Strategically placed large window openings flood the home with light while maintaining privacy.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"61\":[\"90\",\"88\",\"89\",\"91\",\"92\",\"93\",\"94\"],\"35\":\"MOSMAN\",\"41\":[\"95\"],\"34\":\"HAMPDEN STREET\"}}','2014-07-07 01:23:54','2014-07-07 01:23:54','0ec1aac0-e40a-4f32-9f35-da6eac4d1332'),
 ('256','79','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"\\u200bBALMORAL AVENUE\",\"slug\":\"balmoral-avenue\",\"postDate\":1403662380,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"309 sqm\",\"37\":\"Yuncken Construction Group\",\"42\":[\"24\"],\"36\":\"2003\",\"33\":\"<p>Located on a steeply sloping north-facing site, this modern 3 level home was designed to maximise views on each level. The top level is a light filled steel and timber framed pavilion resting on a masonry base. The roof is a simple floating skillion that follows the topography. Below are 2 levels providing bedrooms and a second living area that links to the swimming pool and the garden. Controlled material palettes both inside and outside reflect the simple functional design approach.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"78\"],\"39\":\"Craig Bryant\",\"61\":[\"70\",\"71\",\"72\",\"73\",\"74\",\"75\",\"76\",\"77\"],\"35\":\"MOSMAN\",\"41\":[\"87\"],\"34\":\"\\u200bBALMORAL AVENUE\"}}','2014-07-07 01:24:43','2014-07-07 01:24:43','8ac6e2ec-eb09-437b-aa12-1303febbd86b'),
 ('257','19','5','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"About\",\"slug\":\"about\",\"postDate\":1402027560,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h2>ABOUT<\\/h2><p> Corben Architects is an experienced, Sydney based, architectural practice committed to the creation of great buildings.<\\/p><p> The practice specialises in sophisticated and distinctive residential projects, ranging from high quality individual houses to large, multi-unit, apartment developments. Corben Architect\'s work encompasses a wide variety of architectural design approaches ranging from heritage restoration to innovative contemporary design.<\\/p><p> The practice predominantly undertakes work in Sydney within the Municipalities of Sydney City, Mosman, Manly, North Sydney, Willoughby, Warringah, Pittwater and Woollahra. We have also designed and built beach houses, mountain lodges and rural estates throughout Australia.<\\/p><p> Our success is a reflection of our ability to carefully listen to our client\'s brief, assess their needs, fulfil their vision and exceed their expectations by creating buildings that are functional, practical and comfortable living and working environments.<\\/p><p> All our work is the direct result of client recommendations and referrals.<\\/p><p>At Corben Architects we provide practical advice whilst controlling budgets and meeting deadlines. We work as a team with our clients to meet our mutual primary objective; to ensure our clients are as proud of their projects as we are of our architecture.<\\/p>\",\"32\":\"\"}}','2014-07-08 00:39:01','2014-07-08 00:39:01','f4354e31-c3e0-4c17-9d35-bd7be11ebcd7'),
 ('258','22','5','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"FEES\",\"slug\":\"fees\",\"postDate\":1402027680,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h2>FEES<\\/h2><p> Although we work on a variety of fee arrangements, most  residential projects are undertaken on a percentage fee, based on the final cost of the project including all internal fitout, external works and landscaping (exc gst). We adopt this approach as it is the fairest means of remuneration for the work we actually design, document and administer during construction.<\\/p><p> The percentage fee for a full services commission on a new domestic project range from 9-15% depending on the value of the project and the level of finish. Alterations and additions generally attract an additional fee depending on the complexity of the works and the degree of alteration. Multi unit residential projects generally attract a lesser fee in the range of 5-9% depending the value of the project, the number of units, the degree of repetition and the level of finish and detail.<\\/p><p> Percentage based fees are generally divided into the following stages:\\u2028Master planning \\/ initial sketch design 5%\\u2028Full sketch design 5%\\u2028Design development to Development Application 15%\\u2028Contract documentation to Construction Certificate 20%\\u2028Contract documentation to tender 20%\\u2028Tendering and contract negotiation 5%\\u2028Contract administration during construction 30%<\\/p><p> We also work on a time plus disbursements basis or a lump sum fee for a defined stage or specific scope of work.<\\/p><p> Due to the adhoc nature of the Development Application assessment process and inevitable neighbour objections, all council and neighbour negotiations are undertaken on a time and disbursement basis.<\\/p><p> We are able to provide partial services as may be required although we do not encourage this approach as we maintain the finest and most successful projects are the result of the architect maintaining a close involvement throughout the entire design, documentation and construction process.<\\/p><p>Whilst our fees are consistent with the industry standard we provide a high level of skill and expertise and an even higher level of client service.<\\/p>\",\"32\":\"\"}}','2014-07-08 00:39:20','2014-07-08 00:39:20','55fdeb7a-3171-49df-8304-7fda2a9f9d89'),
 ('259','20','5','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"Architecture\",\"slug\":\"architecture\",\"postDate\":1402027620,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h2>ARCHITECTURE<\\/h2><p> Corben Architects approach to every project is to analyse the brief and context of the site to arrive at a clear design and planning solution.This approach is undertaken without limiting design innovation to achieve practical, cost effective design solutions that create great looking buildings and comfortable, living and working environments.<\\/p><p> Able to adapt to a wide variety of project styles, from historic restorations to contemporary modern design, the key objective of each commision is to design and build projects that fit comfortably within their urban context or natural surrounding. This approach is extended in the integration between old and new architecture.<\\/p><p>As part of the overall project strategy, we keep the design principles simple and uncomplicated to allow our ideas to develop with clarity. Our buildings are distinctive by their individuality rather than their similarity.<\\/p>\",\"32\":[\"16\"]}}','2014-07-08 00:39:31','2014-07-08 00:39:31','c6b1a605-9237-4c40-8608-8415ac18ffce'),
 ('260','20','5','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"Architecture\",\"slug\":\"architecture\",\"postDate\":1402027620,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h2><\\/h2><h2>ARCHITECTURE<\\/h2><p> Corben Architects approach to every project is to analyse the brief and context of the site to arrive at a clear design and planning solution.This approach is undertaken without limiting design innovation to achieve practical, cost effective design solutions that create great looking buildings and comfortable, living and working environments.<\\/p><p> Able to adapt to a wide variety of project styles, from historic restorations to contemporary modern design, the key objective of each commision is to design and build projects that fit comfortably within their urban context or natural surrounding. This approach is extended in the integration between old and new architecture.<\\/p><p>As part of the overall project strategy, we keep the design principles simple and uncomplicated to allow our ideas to develop with clarity. Our buildings are distinctive by their individuality rather than their similarity.<\\/p>\",\"32\":[\"16\"]}}','2014-07-08 00:39:46','2014-07-08 00:39:46','cdcb2797-8c7c-4ce4-af6b-28c10fa6182a');
insert into `craft_entryversions` values('261','21','5','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"Service\",\"slug\":\"service\",\"postDate\":1402027620,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h2>SERVICE<\\/h2><p>The team of architects, designers, project managers and support staff at Corben Architects are dedicated to excellence and motivated by client satisfaction.<\\/p><p> As Managing Director, Philip Corben maintains a personal involvement in all the design work and client liaison. The execution of the projects is undertaken by an experienced staff, comprising three Directors , two Associates and nine Project Architects assisted by CAD draftspersons and administration staff.<\\/p><p> The practice utilises sophisticated computer systems including Archicad and Vectorworks CAD software for 2D design and documentation and 3D modelling and Total Synergy for back of house office management.<\\/p><p> Corben Architects has a close liaison with a broad range of experienced consultants and building contractors who readily combine together on a project by project basis to provide a total and comprehensive service.<\\/p><p>The practice is renowned for providing practical advice to fulfil client and project briefs and control budgets whilst meeting their deadlines. At Corben Architects we work as a team with our clients to meet our mutual primary objective; to ensure our clients are as proud of their projects as we are of our architecture.<\\/p>\",\"32\":[\"533\"]}}','2014-07-08 00:40:34','2014-07-08 00:40:34','004b32dc-5160-4dc4-b87e-933487e1e4c9'),
