 ('271','536','2','1','en_us',null,'{\"authorId\":\"1\",\"title\":\"External URL Example Post\",\"slug\":\"external-url-example-post\",\"postDate\":1406348197,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"24\":\"\",\"22\":\"\",\"26\":[\"534\"],\"23\":\"<p>Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Vestibulum tortor quam, feugiat vitae, ultricies eget, tempor sit amet, ante. Donec eu libero sit amet quam egestas semper. Aenean ultricies mi vitae est. Mauris placerat eleifend leo.<\\/p>\",\"63\":{\"new1\":{\"type\":\"readMoreButton\",\"enabled\":\"1\",\"fields\":{\"buttonTitle\":\"All Things Visual\",\"linkToExternalUrl\":\"1\",\"externalUrl\":\"http:\\/\\/petercrumpton.com.au\\/\"}}}}}','2014-07-26 04:16:41','2014-07-26 04:16:41','f9093307-0173-42a2-9081-6b0795eb0dbf'),
 ('272','2','1','4','en_us',null,'{\"authorId\":null,\"title\":\"Homepage\",\"slug\":\"homepage\",\"postDate\":1402450722,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"61\":[\"524\",\"520\",\"523\",\"522\",\"521\",\"538\"]}}','2014-08-05 02:19:43','2014-08-05 02:19:43','e7e5794e-b960-4e6c-935c-a4afc427e32f'),
 ('273','2','1','4','en_us',null,'{\"authorId\":null,\"title\":\"Homepage\",\"slug\":\"homepage\",\"postDate\":1402450722,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"61\":[\"524\",\"520\",\"523\",\"522\",\"521\"]}}','2014-08-05 02:20:23','2014-08-05 02:20:23','8b1bba98-c208-40d2-8591-83ba8eb34e99'),
 ('274','19','5','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"About\",\"slug\":\"about\",\"postDate\":1402027560,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h2>ABOUT<\\/h2><p> Corben Architects is an experienced, Sydney based, architectural practice committed to the creation of great buildings.<\\/p><p> The practice specialises in sophisticated and distinctive residential projects, ranging from high quality individual houses to large, multi-unit, apartment developments. Corben Architect\'s work encompasses a wide variety of architectural design approaches ranging from heritage restoration to innovative contemporary design.<\\/p><p> The practice predominantly undertakes work in Sydney within the Municipalities of Sydney City, Mosman, Manly, North Sydney, Willoughby, Warringah, Pittwater and Woollahra. We have also designed and built beach houses, mountain lodges and rural estates throughout Australia.<\\/p><p> Our success is a reflection of our ability to carefully listen to our client\'s brief, assess their needs, fulfil their vision and exceed their expectations by creating buildings that are functional, practical and comfortable living and working environments.<\\/p><p> All our work is the direct result of client recommendations and referrals.<\\/p><p>At Corben Architects we provide practical advice whilst controlling budgets and meeting deadlines. We work as a team with our clients to meet our mutual primary objective; to ensure our clients are as proud of their projects as we are of our architecture.<\\/p>\",\"32\":[\"532\"]}}','2014-08-05 02:56:35','2014-08-05 02:56:35','afd774f3-8c8f-433c-9c59-e7a1c962fa2a'),
 ('275','6','4','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"Philip  Corben\",\"slug\":\"ryan-belisle\",\"postDate\":1402011780,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"18\":\"<p>Philip worked for ten years with the respected firms of Philip Cox and Partners, Clarke Perry Blackmore and Architecture Oceania. In 1990, he established Corben Architects with the overriding commitment to quality design and a high level of client service.<\\/p><p>Whilst Philip overviews every project within the office he is predominantly involved in the client liaison and design review. As the Managing Director, Philip is also responsible for the business management of the practice, assisted by Janelle Alexander and Debra Lane.<\\/p>\",\"17\":\"B.Sc. (Arch) B Arch (Hon) FRAIA\\u00a0 Registration number 4616\",\"21\":[\"true\"],\"14\":\"Philip \",\"15\":\"Corben\",\"19\":[\"9\"],\"16\":\"Managing Director\",\"20\":\"director\"}}','2014-08-05 04:01:11','2014-08-05 04:01:11','94253896-d604-42de-a1a6-93f3cc385586'),
 ('276','6','4','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"Philip  Corben\",\"slug\":\"ryan-belisle\",\"postDate\":1402011780,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"18\":\"<p>Philip worked for ten years with the respected firms of Philip Cox and Partners, Clarke Perry Blackmore and Architecture Oceania. In 1990, he established Corben Architects with the overriding commitment to quality design and a high level of client service.<\\/p><p>Whilst Philip overviews every project within the office he is predominantly involved in the client liaison and design review. As the Managing Director, Philip is also responsible for the business management of the practice, assisted by Janelle Alexander and Debra Lane.<\\/p>\",\"17\":\"B.Sc. (Arch) B Arch (Hon) FRAIA\\u00a0 Registration number 4616\",\"21\":[\"true\"],\"14\":\"Philip \",\"15\":\"Corben\",\"19\":[\"539\"],\"16\":\"Managing Director\",\"20\":\"director\"}}','2014-08-05 04:04:06','2014-08-05 04:04:06','1ab9d7ac-0b4c-4ab2-a005-ddabcec594d8'),
