 ('293','79','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"\\u200bBALMORAL AVENUE\",\"slug\":\"balmoral-avenue\",\"postDate\":1403662380,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"309 sqm\",\"37\":\"Yuncken Construction Group\",\"42\":[\"24\"],\"36\":\"2003\",\"33\":\"<p>Located on a steeply sloping north-facing site, this modern 3 level home was designed to maximise views on each level. The top level is a light filled steel and timber framed pavilion resting on a masonry base. The roof is a simple floating skillion that follows the topography. Below are 2 levels providing bedrooms and a second living area that links to the swimming pool and the garden. Controlled material palettes both inside and outside reflect the simple functional design approach.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"78\"],\"39\":\"Craig Bryant\",\"61\":[\"70\",\"71\",\"72\",\"73\",\"74\",\"75\",\"76\",\"77\"],\"35\":\"MOSMAN\",\"41\":[\"570\"],\"34\":\"\\u200bBALMORAL AVENUE\"}}','2014-08-05 04:28:19','2014-08-05 04:28:19','177b461f-381e-4db8-9741-d836feb72f15'),
 ('294','79','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"\\u200bBALMORAL AVENUE\",\"slug\":\"balmoral-avenue\",\"postDate\":1403662380,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"309 sqm\",\"37\":\"Yuncken Construction Group\",\"42\":[\"24\"],\"36\":\"2003\",\"33\":\"<p>Located on a steeply sloping north-facing site, this modern 3 level home was designed to maximise views on each level. The top level is a light filled steel and timber framed pavilion resting on a masonry base. The roof is a simple floating skillion that follows the topography. Below are 2 levels providing bedrooms and a second living area that links to the swimming pool and the garden. Controlled material palettes both inside and outside reflect the simple functional design approach.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"78\"],\"39\":\"Craig Bryant\",\"61\":[\"70\",\"71\",\"72\",\"73\",\"74\",\"75\",\"76\",\"77\"],\"35\":\"MOSMAN\",\"41\":[\"570\"],\"34\":\"\\u200bBALMORAL AVENUE\"}}','2014-08-05 04:29:26','2014-08-05 04:29:26','25b444cb-d4d0-462e-a81d-d471a65c8975'),
 ('295','26','6','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"HOPETOUN AVENUE\",\"slug\":\"hopetoun-avenue-house\",\"postDate\":1402184220,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"515 sqm\",\"37\":\"SF Hough Pty Ltd\",\"42\":[\"24\"],\"36\":\"2006\",\"33\":\"<p>Located on a steep site, this modern 5 level home was designed to maximize the views and take advantage of its northern orientation.  The building\\u2019s form combines horizontal bands of rendered masonry which are complimented by a vertical double height glazed entry volume. The large skillion roof completes the building providing shade to the outdoor terraces.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"61\":[\"571\",\"572\",\"573\",\"574\",\"575\",\"576\",\"577\"],\"35\":\"MOSMAN\",\"41\":[\"578\"],\"34\":\"HOPETOUN AVENUE\"}}','2014-08-05 04:31:52','2014-08-05 04:31:52','5b58e677-b0e4-46ca-a62e-ca54456210e1'),
 ('296','114','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SHELLBANK AVENUE\",\"slug\":\"shellbank-avenue\",\"postDate\":1403664600,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"810 sqm\",\"37\":\"Hoi Constructions Pty Ltd\",\"42\":[\"24\"],\"36\":\"2006\",\"33\":\"<p>Located on a large waterfront land holding, this substantial home was designed as two volumes. The entry hall, lift, stairwell, guest accommodation and garaging is in one part. Below this is located the 3 storey main house. A large carp pond and waterfall separate the two buildings. The home adopts a modern classical aesthetic where symmetry, a sense of balance and order dominate. All of this is complimented with Asian influences and an emphasis on natural stone and timbers.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"121\"],\"39\":\"Brett Boardman\",\"61\":[\"580\",\"581\",\"582\",\"583\",\"584\",\"585\",\"586\",\"587\",\"588\"],\"35\":\"MOSMAN\",\"41\":[\"579\"],\"34\":\"SHELLBANK AVENUE\"}}','2014-08-05 04:35:39','2014-08-05 04:35:39','79220fe8-dccf-4f9c-b73b-3ff1889c96f5'),
 ('297','20','5','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"Architecture\",\"slug\":\"architecture\",\"postDate\":1402027620,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h2>ARCHITECTURE<\\/h2><p> Corben Architects approach to every project is to analyse the brief and context of the site to arrive at a clear design and planning solution.This approach is undertaken without limiting design innovation to achieve practical, cost effective design solutions that create great looking buildings and comfortable, living and working environments.<\\/p><p> Able to adapt to a wide variety of project styles, from historic restorations to contemporary modern design, the key objective of each commision is to design and build projects that fit comfortably within their urban context or natural surrounding. This approach is extended in the integration between old and new architecture.<\\/p><p>As part of the overall project strategy, we keep the design principles simple and uncomplicated to allow our ideas to develop with clarity. Our buildings are distinctive by their individuality rather than their similarity.<\\/p>\",\"32\":[\"589\"]}}','2014-08-05 04:43:17','2014-08-05 04:43:17','98cce5ea-085c-49a3-9ca1-0e1e89a8a16d'),
 ('298','19','5','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"About\",\"slug\":\"about\",\"postDate\":1402027560,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h2>ABOUT<\\/h2><p> Corben Architects is an experienced, Sydney based, architectural practice committed to the creation of great buildings.<\\/p><p> The practice specialises in sophisticated and distinctive residential projects, ranging from high quality individual houses to large, multi-unit, apartment developments. Corben Architect\'s work encompasses a wide variety of architectural design approaches ranging from heritage restoration to innovative contemporary design.<\\/p><p> The practice predominantly undertakes work in Sydney within the Municipalities of Sydney City, Mosman, Manly, North Sydney, Willoughby, Warringah, Pittwater and Woollahra. We have also designed and built beach houses, mountain lodges and rural estates throughout Australia.<\\/p><p> Our success is a reflection of our ability to carefully listen to our client\'s brief, assess their needs, fulfil their vision and exceed their expectations by creating buildings that are functional, practical and comfortable living and working environments.<\\/p><p> All our work is the direct result of client recommendations and referrals.<\\/p><p>At Corben Architects we provide practical advice whilst controlling budgets and meeting deadlines. We work as a team with our clients to meet our mutual primary objective; to ensure our clients are as proud of their projects as we are of our architecture.<\\/p>\",\"32\":[\"590\"]}}','2014-08-05 04:43:55','2014-08-05 04:43:55','44364bd8-399d-4ae9-b8ba-f962e71990e7');
insert into `craft_entryversions` values('299','22','5','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"FEES\",\"slug\":\"fees\",\"postDate\":1402027680,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h2>FEES<\\/h2><p> Although we work on a variety of fee arrangements, most  residential projects are undertaken on a percentage fee, based on the final cost of the project including all internal fitout, external works and landscaping (exc gst). We adopt this approach as it is the fairest means of remuneration for the work we actually design, document and administer during construction.<\\/p><p> The percentage fee for a full services commission on a new domestic project range from 9-15% depending on the value of the project and the level of finish. Alterations and additions generally attract an additional fee depending on the complexity of the works and the degree of alteration. Multi unit residential projects generally attract a lesser fee in the range of 5-9% depending the value of the project, the number of units, the degree of repetition and the level of finish and detail.<\\/p><p> Percentage based fees are generally divided into the following stages:\\u2028Master planning \\/ initial sketch design 5%\\u2028Full sketch design 5%\\u2028Design development to Development Application 15%\\u2028Contract documentation to Construction Certificate 20%\\u2028Contract documentation to tender 20%\\u2028Tendering and contract negotiation 5%\\u2028Contract administration during construction 30%<\\/p><p> We also work on a time plus disbursements basis or a lump sum fee for a defined stage or specific scope of work.<\\/p><p> Due to the adhoc nature of the Development Application assessment process and inevitable neighbour objections, all council and neighbour negotiations are undertaken on a time and disbursement basis.<\\/p><p> We are able to provide partial services as may be required although we do not encourage this approach as we maintain the finest and most successful projects are the result of the architect maintaining a close involvement throughout the entire design, documentation and construction process.<\\/p><p>Whilst our fees are consistent with the industry standard we provide a high level of skill and expertise and an even higher level of client service.<\\/p>\",\"32\":[\"593\"]}}','2014-08-05 04:46:48','2014-08-05 04:46:48','17de77bd-f8cf-4d2f-9764-2734b0c72c8f'),
 ('300','21','5','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"Service\",\"slug\":\"service\",\"postDate\":1402027620,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h2>SERVICE<\\/h2><p>The team of architects, designers, project managers and support staff at Corben Architects are dedicated to excellence and motivated by client satisfaction.<\\/p><p> As Managing Director, Philip Corben maintains a personal involvement in all the design work and client liaison. The execution of the projects is undertaken by an experienced staff, comprising three Directors , two Associates and nine Project Architects assisted by CAD draftspersons and administration staff.<\\/p><p> The practice utilises sophisticated computer systems including Archicad and Vectorworks CAD software for 2D design and documentation and 3D modelling and Total Synergy for back of house office management.<\\/p><p> Corben Architects has a close liaison with a broad range of experienced consultants and building contractors who readily combine together on a project by project basis to provide a total and comprehensive service.<\\/p><p>The practice is renowned for providing practical advice to fulfil client and project briefs and control budgets whilst meeting their deadlines. At Corben Architects we work as a team with our clients to meet our mutual primary objective; to ensure our clients are as proud of their projects as we are of our architecture.<\\/p>\",\"32\":[\"597\"]}}','2014-08-05 04:49:18','2014-08-05 04:49:18','87eb5aee-13c7-487c-ac24-369784cd1db9'),
 ('301','20','5','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"Architecture\",\"slug\":\"architecture\",\"postDate\":1402027620,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h2>ARCHITECTURE<\\/h2><p> Corben Architects approach to every project is to analyse the brief and context of the site to arrive at a clear design and planning solution.This approach is undertaken without limiting design innovation to achieve practical, cost effective design solutions that create great looking buildings and comfortable, living and working environments.<\\/p><p> Able to adapt to a wide variety of project styles, from historic restorations to contemporary modern design, the key objective of each commision is to design and build projects that fit comfortably within their urban context or natural surrounding. This approach is extended in the integration between old and new architecture.<\\/p><p>As part of the overall project strategy, we keep the design principles simple and uncomplicated to allow our ideas to develop with clarity. Our buildings are distinctive by their individuality rather than their similarity.<\\/p>\",\"32\":[\"533\"]}}','2014-08-05 04:51:00','2014-08-05 04:51:00','36cd44df-7254-4533-8658-7a1687400ca3'),
 ('302','22','5','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"FEES\",\"slug\":\"fees\",\"postDate\":1402027680,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h2>FEES<\\/h2><p> Although we work on a variety of fee arrangements, most  residential projects are undertaken on a percentage fee, based on the final cost of the project including all internal fitout, external works and landscaping (exc gst). We adopt this approach as it is the fairest means of remuneration for the work we actually design, document and administer during construction.<\\/p><p> The percentage fee for a full services commission on a new domestic project range from 9-15% depending on the value of the project and the level of finish. Alterations and additions generally attract an additional fee depending on the complexity of the works and the degree of alteration. Multi unit residential projects generally attract a lesser fee in the range of 5-9% depending the value of the project, the number of units, the degree of repetition and the level of finish and detail.<\\/p><p> Percentage based fees are generally divided into the following stages:\\u2028Master planning \\/ initial sketch design 5%\\u2028Full sketch design 5%\\u2028Design development to Development Application 15%\\u2028Contract documentation to Construction Certificate 20%\\u2028Contract documentation to tender 20%\\u2028Tendering and contract negotiation 5%\\u2028Contract administration during construction 30%<\\/p><p> We also work on a time plus disbursements basis or a lump sum fee for a defined stage or specific scope of work.<\\/p><p> Due to the adhoc nature of the Development Application assessment process and inevitable neighbour objections, all council and neighbour negotiations are undertaken on a time and disbursement basis.<\\/p><p> We are able to provide partial services as may be required although we do not encourage this approach as we maintain the finest and most successful projects are the result of the architect maintaining a close involvement throughout the entire design, documentation and construction process.<\\/p><p>Whilst our fees are consistent with the industry standard we provide a high level of skill and expertise and an even higher level of client service.<\\/p>\",\"32\":[\"594\"]}}','2014-08-05 04:51:42','2014-08-05 04:51:42','b4dec381-a430-4e5c-beb5-1dd85ce824f5'),
