 ('319','96','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"HAMPDEN STREET\",\"slug\":\"hampden-street\",\"postDate\":1403664240,\"expiryDate\":null,\"enabled\":0,\"fields\":{\"38\":\"390 sqm\",\"37\":\"Tifad Developments Pty Ltd\",\"42\":[\"24\"],\"36\":\"2005\",\"33\":\"<p>This modern family home is designed as 2 volumes separated by a single storey entry core and a north facing central courtyard. At the street side is a 3 storey volume containing garaging, living areas and bedrooms, at the rear a 2 storey volume contains the main living area with further bedrooms above. This leads onto the rear garden with wet edge pool. Strategically placed large window openings flood the home with light while maintaining privacy.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"61\":[\"90\",\"88\",\"89\",\"91\",\"92\",\"93\",\"94\"],\"35\":\"MOSMAN\",\"41\":[\"95\"],\"34\":\"HAMPDEN STREET\"}}','2014-08-05 06:53:17','2014-08-05 06:53:17','52b05b69-9615-430f-a48a-6ee6bee05574'),
 ('320','114','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SHELLBANK AVENUE\",\"slug\":\"shellbank-avenue\",\"postDate\":1403664600,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"810 sqm\",\"37\":\"Hoi Constructions Pty Ltd\",\"42\":[\"24\"],\"36\":\"2006\",\"33\":\"<p>Located on a large waterfront land holding, this substantial home was designed as two volumes. The entry hall, lift, stairwell, guest accommodation and garaging is in one part. Below this is located the 3 storey main house. A large carp pond and waterfall separate the two buildings. The home adopts a modern classical aesthetic where symmetry, a sense of balance and order dominate. All of this is complimented with Asian influences and an emphasis on natural stone and timbers.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"603\"],\"39\":\"Brett Boardman\",\"61\":[\"580\",\"581\",\"582\",\"583\",\"584\",\"585\",\"586\",\"587\",\"588\"],\"35\":\"MOSMAN\",\"41\":[\"579\"],\"34\":\"SHELLBANK AVENUE\"}}','2014-08-05 06:58:01','2014-08-05 06:58:01','ba54be06-ff34-4868-932c-5d708d0e78dd'),
 ('321','123','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"STANTON ROAD\",\"slug\":\"stanton-road\",\"postDate\":1403665020,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"860 sqm\",\"37\":\"F S Hough Pty Ltd\",\"42\":[\"24\"],\"36\":\"2008\",\"33\":\"<p>This substantial home is located on a 1700m<sup style=\\\"font-family: Arial, Helvetica, Verdana, Tahoma, sans-serif; \\\">2 site<\\/sup> with outstanding views over Balmoral Beach. The design combines contemporary elements and traditional architectural forms. A strong masonry lower floor, with formal and informal living areas, provides the base. The upper level, slightly recessed, contains the bedrooms. Wide eaves on the large shallow pitched roof complete the home. The use of deep colours and rich materials provides a luxurious backdrop for our client\\u2019s possessions.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"605\"],\"39\":\"Craig Bryant\",\"61\":[\"654\",\"655\",\"657\",\"658\",\"659\",\"660\",\"661\"],\"35\":\"MOSMAN\",\"41\":[\"662\"],\"34\":\"STANTON ROAD\"}}','2014-08-05 07:05:11','2014-08-05 07:05:11','440a1f77-8565-4460-808e-bff495aec392'),
