 ('343','673','7','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"Hopetoun Avenue House Mosman\",\"slug\":\"hopetoun-avenue-house-mosman-1\",\"postDate\":1407290100,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"60\":{\"date\":\"8\\/1\\/2012\"},\"58\":\"\",\"56\":\"\",\"59\":\"\",\"55\":\"Winner MBA Housing Award Contract House $10M & over 2012\"}}','2014-08-06 01:58:21','2014-08-06 01:58:21','89c0f1d1-99cb-43bf-ad32-9a6021e37d77'),
 ('344','469','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SHELLBANK AVENUE III\",\"slug\":\"shellbank-avenue-1\",\"postDate\":1403837280,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"760\",\"37\":\"Sandlik Constructions\",\"42\":[\"34\"],\"36\":\"2009\",\"33\":\"<p>We were commissioned to undertake a major renovation to this large waterfront home. The property comprises a two storey garage building, a three storey home and a boatshed. Once stripped back to the bare floor plates, all three buildings were transformed with large window openings, a new zinc roof and sandstone, zinc and stained cedar cladding. Rooms were reorganized and streamlined with a sophisticated interior design by Interni, including the sculptural central staircase. The swimming pool was rebuilt in a new location to improve the connection to the waterfront and the Dangar Group provided a contemporary garden employing interlocking zinc clad boxes with lush planting to complete the design.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Richard Glover\",\"61\":[\"468\",\"467\",\"466\",\"465\",\"464\",\"463\",\"462\",\"461\"],\"35\":\"MOSMAN\",\"41\":[\"460\"],\"34\":\"SHELLBANK AVENUE III\"}}','2014-08-06 02:09:15','2014-08-06 02:09:15','6e2bd987-19d2-444f-bd62-e65301dae33a'),
 ('345','114','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SHELLBANK AVENUE I\",\"slug\":\"shellbank-avenue\",\"postDate\":1403664600,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"810 sqm\",\"37\":\"Hoi Constructions Pty Ltd\",\"42\":[\"24\"],\"36\":\"2006\",\"33\":\"<p>Located on a large waterfront land holding, this substantial home was designed as two volumes. The entry hall, lift, stairwell, guest accommodation and garaging is in one part. Below this is located the 3 storey main house. A large carp pond and waterfall separate the two buildings. The home adopts a modern classical aesthetic where symmetry, a sense of balance and order dominate. All of this is complimented with Asian influences and an emphasis on natural stone and timbers.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"603\"],\"39\":\"Brett Boardman\",\"61\":[\"580\",\"581\",\"582\",\"583\",\"584\",\"585\",\"586\",\"587\",\"588\"],\"35\":\"MOSMAN\",\"41\":[\"579\"],\"34\":\"SHELLBANK AVENUE I\"}}','2014-08-06 02:10:30','2014-08-06 02:10:30','baacae07-8549-4e40-9ebd-16147f7bc721'),
 ('346','384','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"PEARL BAY AVENUE\",\"slug\":\"pearl-bay-avenue\",\"postDate\":1403833080,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"360 sqm\",\"37\":\"Northside Constructions\",\"42\":[\"34\"],\"36\":\"2009\",\"33\":\"<p>We were commissioned to redesign a 1950\\u2019s home perched on a cliff face overlooking a harbour reserve. The existing brick walls of the middle level were rendered and a 3<sup style=\\\"font-family: Arial, Helvetica, Verdana, Tahoma, sans-serif; \\\">rd<\\/sup> level, added using reverse brick veneer construction with a stained cedar cladding for the external skin. The lowest level was expanded and opened up. The middle entry level containing living areas was also opened up and extended to link with a northfacing terrace covered by a timer framed pergola. The approach to the home is through a lush tropical garden and it is entered via stepping stones set over a fishpond. Dark stained timber floors, crisp white walls create a sophisticated and relaxed family home.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"383\"],\"39\":\"Craig Bryant\",\"61\":[\"674\",\"675\",\"676\",\"677\",\"678\",\"679\"],\"35\":\"MOSMAN\",\"41\":[\"680\"],\"34\":\"PEARL BAY AVENUE\"}}','2014-08-06 02:20:02','2014-08-06 02:20:02','48a4a23d-b59b-4a6d-a7e1-fc591719e02f'),
 ('347','384','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"PEARL BAY AVENUE\",\"slug\":\"pearl-bay-avenue\",\"postDate\":1403833080,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"360 sqm\",\"37\":\"Northside Constructions\",\"42\":[\"24\"],\"36\":\"2009\",\"33\":\"<p>We were commissioned to redesign a 1950\\u2019s home perched on a cliff face overlooking a harbour reserve. The existing brick walls of the middle level were rendered and a 3<sup style=\\\"font-family: Arial, Helvetica, Verdana, Tahoma, sans-serif; \\\">rd<\\/sup> level, added using reverse brick veneer construction with a stained cedar cladding for the external skin. The lowest level was expanded and opened up. The middle entry level containing living areas was also opened up and extended to link with a northfacing terrace covered by a timer framed pergola. The approach to the home is through a lush tropical garden and it is entered via stepping stones set over a fishpond. Dark stained timber floors, crisp white walls create a sophisticated and relaxed family home.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"383\"],\"39\":\"Craig Bryant\",\"61\":[\"674\",\"675\",\"676\",\"677\",\"678\",\"679\"],\"35\":\"MOSMAN\",\"41\":[\"680\"],\"34\":\"PEARL BAY AVENUE\"}}','2014-08-06 02:20:58','2014-08-06 02:20:58','d978b54b-0874-46f4-b193-72b978f981b1'),
 ('348','160','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"GORDON STREET\",\"slug\":\"gordon-street\",\"postDate\":1403666520,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"350 sqm\",\"37\":\"Northern Building Pty Ltd\",\"42\":[\"24\"],\"36\":\"2009\",\"33\":\"<p>This house adopts an \\u2018H\\u2019 plan, the connecting link contains the entry and circulation spaces with living spaces at either end. The principal living area has 3.3m high ceilings with sliding doors that retract into the walls to provide a clean opening to a terrace, which leads onto the lawn and swimming pool area. A large reflection pond sits adjacent to the stair and is separated by 2 storey high sliding glass doors. While the core of the home has large expanses of glazing flooding the home with light, dense bamboo planting provides privacy. A colour palette of black zinc, white walls, grey stone floors reinforce the clean contemporary design.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"190\"],\"39\":\"Sharrin Rees\",\"61\":[\"681\",\"682\",\"683\",\"684\",\"685\",\"686\"],\"35\":\"MOSMAN\",\"41\":[\"687\"],\"34\":\"GORDON STREET\"}}','2014-08-06 02:22:59','2014-08-06 02:22:59','5f0d1d7e-d70a-42f1-86c3-845dbd9a63dd'),
 ('349','204','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WAMBERAL\",\"slug\":\"wamberal\",\"postDate\":1403667240,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"435 sqm\",\"37\":\"Gledhill Developments\",\"42\":[\"24\"],\"36\":\"2009\",\"33\":\"<p>This beachfront home sits on top of sand dunes overlooking Wamberal Beach and rests on 25 metre deep concrete piers. The home was designed as two separate pavilions. A two storey beach side pavillion contains living areas and kitchen with a master bedroom suite, a study and sitting room above. The second street side pavillion  accommodates a double garage, storerooms with guest bedrooms and self contained living areas above. The design is a sophisticated reinterpretation of the skillion roofed beach shack. It combines sandstone, rendered masonry, timber floors doors and windows to create a warm and inviting beach house retreat.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"203\"],\"39\":\"Craig Bryant\",\"61\":[\"688\",\"689\",\"690\",\"691\",\"692\",\"693\",\"694\",\"695\"],\"35\":\"BEACH\",\"41\":[\"696\"],\"34\":\"WAMBERAL\"}}','2014-08-06 02:25:37','2014-08-06 02:25:37','ea4647b8-c0bd-4776-9626-d5b9d5380450'),
 ('350','224','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WARRINGAH ROAD\",\"slug\":\"warringah-road\",\"postDate\":1403667840,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"450 sqm\",\"37\":\"SX Projects\",\"42\":[\"24\"],\"36\":\"2009\",\"33\":\"<p>This contemporary 3 level home sits on a battle-axe site. The careful placement ensured neighbours water views were protected. The sensitive design maintains privacy to both owners and neighbours. The strong rectangular form comprises planes of concrete and masonry separated by panels of timber battens, split face sandstone and large expanses of glazing. This is a sophisticated contemporary home inserted into a challenging site.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"213\"],\"39\":\"Alina Gozina\",\"61\":[\"697\",\"698\",\"699\",\"700\",\"701\",\"702\",\"703\",\"704\",\"705\"],\"35\":\"MOSMAN\",\"41\":[\"706\"],\"34\":\"WARRINGAH ROAD\"}}','2014-08-06 02:29:15','2014-08-06 02:29:15','d57a020d-d5e4-447e-a1aa-a655b8ecd16f'),
 ('351','707','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"MISTRAL AVENUE\",\"slug\":\"mistral-avenue\",\"postDate\":1407292351,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"380m2\",\"37\":\"FS Hough Pty Ltd\",\"42\":[\"24\"],\"36\":\"2009\",\"33\":\"<p>This home was designed to sit comfortably within its context. Its shape and form was influenced by the views enjoyed by the neighbouring federation homes over the site. Appearing as 3 storeys at the street front it steps up to become a single storey home at the rear. The main living area has a raked ceiling with exposed trusses. The base of the house is clad in sandstone and zinc clad bay window projections articulate the fa\\u00e7ade. The result is a modern interpretation of a traditional home.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"61\":\"\",\"35\":\"MOSMAN\",\"41\":\"\",\"34\":\"MISTRAL AVENUE\"}}','2014-08-06 02:32:31','2014-08-06 02:32:31','98533ba6-a113-4851-9e80-1566122cc0a1'),
 ('352','707','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"MISTRAL AVENUE\",\"slug\":\"mistral-avenue\",\"postDate\":1407292320,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"380m2\",\"37\":\"FS Hough Pty Ltd\",\"42\":[\"24\"],\"36\":\"2009\",\"33\":\"<p>This home was designed to sit comfortably within its context. Its shape and form was influenced by the views enjoyed by the neighbouring federation homes over the site. Appearing as 3 storeys at the street front it steps up to become a single storey home at the rear. The main living area has a raked ceiling with exposed trusses. The base of the house is clad in sandstone and zinc clad bay window projections articulate the fa\\u00e7ade. The result is a modern interpretation of a traditional home.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"611\"],\"39\":\"Craig Bryant\",\"61\":\"\",\"35\":\"MOSMAN\",\"41\":\"\",\"34\":\"MISTRAL AVENUE\"}}','2014-08-06 02:33:52','2014-08-06 02:33:52','745e4c6f-c1cf-49dc-a9d1-053f825c8d14'),
 ('353','707','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"MISTRAL AVENUE\",\"slug\":\"mistral-avenue\",\"postDate\":1407292320,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"380m2\",\"37\":\"FS Hough Pty Ltd\",\"42\":[\"24\"],\"36\":\"2009\",\"33\":\"<p>This home was designed to sit comfortably within its context. Its shape and form was influenced by the views enjoyed by the neighbouring federation homes over the site. Appearing as 3 storeys at the street front it steps up to become a single storey home at the rear. The main living area has a raked ceiling with exposed trusses. The base of the house is clad in sandstone and zinc clad bay window projections articulate the fa\\u00e7ade. The result is a modern interpretation of a traditional home.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"611\"],\"39\":\"Craig Bryant\",\"61\":[\"713\",\"714\",\"715\",\"716\"],\"35\":\"MOSMAN\",\"41\":[\"717\"],\"34\":\"MISTRAL AVENUE\"}}','2014-08-06 02:39:19','2014-08-06 02:39:19','796a2e63-f361-4d5b-acd1-28b5c1f7d83e'),
 ('354','235','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"BRONTE ROAD\",\"slug\":\"bronte-rd\",\"postDate\":1403668200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"445 sqm\",\"37\":\"F S Hough Pty Ltd\",\"42\":[\"24\"],\"36\":\"2010\",\"33\":\"<p>This contemporary home, located on a wedge shaped site on the headland overlooking Bronte Beach, takes maximum advantage of the the beach and coastal views. The linear footprint of the home ensures all rooms enjoy the northeast views. A large skillion roof shelters the upper level. This contains the entry and living areas, a study and master bedroom suite. The lower floor provides more bedrooms and a playroom. The use of operable louvres provides semi transparency to the external terraces, this is balanced by sandstone walls and rendered masonry below.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"234\"],\"39\":\"Craig Bryant\",\"61\":[\"718\",\"719\",\"720\",\"721\",\"722\",\"723\",\"724\",\"725\"],\"35\":\"BRONTE\",\"41\":[\"726\"],\"34\":\"BRONTE ROAD\"}}','2014-08-06 03:15:55','2014-08-06 03:15:55','08833146-8d32-4cdb-915f-e3b5f185d638'),
 ('355','254','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"CARRINGTON AVENUE\",\"slug\":\"carrington-ave\",\"postDate\":1403669160,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"560 sqm\",\"37\":\"FS Hough\",\"42\":[\"24\"],\"36\":\"2010\",\"33\":\"<p>This modern 3 level home is located on a north facing waterfront site overlooking Quaker\\u2019s Hat Bay. It is a composition of sharp rectangular forms clad with a mix of timber, painted render, zinc and sandstone. The home presents to the street front a predominantly opaque fa\\u00e7ade, but inside the home\\u2019s central circulation core is flooded with natural light from clerestory windows. At the rear, the house is predominantly translucent, large areas of glazing open up to terraces. Living areas are located on the middle entry level, bedrooms are above and the lowest level includes a gym, playroom and self contained flat. A lawn leads onto a large pool and entertainment terrace to extend the living areas.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"253\"],\"39\":\"Steve Back\",\"61\":[\"727\",\"728\",\"729\",\"730\",\"731\",\"732\"],\"35\":\"MOSMAN\",\"41\":[\"733\"],\"34\":\"CARRINGTON AVENUE\"}}','2014-08-06 03:17:34','2014-08-06 03:17:34','58924100-3a2e-4f71-99b0-54d3b9449bf7'),
 ('356','486','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WONGA ROAD II\",\"slug\":\"wonga-road\",\"postDate\":1403837700,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"37\":\"JP Thew Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2014\",\"33\":\"\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"61\":[\"485\",\"484\",\"483\",\"482\",\"481\",\"480\"],\"35\":\"CREMORNE\",\"41\":[\"479\"],\"34\":\"WONGA ROAD II\"}}','2014-08-06 03:19:48','2014-08-06 03:19:48','b17219d9-1447-443c-96b9-508b1a99e627'),
 ('357','741','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WONGA ROAD\",\"slug\":\"wonga-road-1\",\"postDate\":1407295457,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"736m2\",\"37\":\"Yuncken Constructions\",\"42\":\"\",\"36\":\"2010\",\"33\":\"<p>This substantial home sits on a sizable waterfront property with views over Long Bay and Northbridge. The accommodation is arranged across 2 pavillions which step down a steeply sloping site. A number of significant angophora trees on the site dictated the placement of the building. The home is divided over 6 levels, large terraces from each level provide an immediate connection with the unique setting. A warm palette of timer and travertine flooring, stone wall cladding and liberal expanses of glazing combine to create a luxurious living environment.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"614\"],\"39\":\"Marian Rabic\",\"61\":[\"734\",\"735\",\"736\",\"737\",\"738\",\"739\"],\"35\":\"CREMORNE\",\"41\":[\"740\"],\"34\":\"WONGA ROAD\"}}','2014-08-06 03:24:17','2014-08-06 03:24:17','e1d45e18-6aee-422c-a332-ca7529b49eec'),
 ('358','741','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WONGA ROAD\",\"slug\":\"wonga-road-1\",\"postDate\":1407295440,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"736m2\",\"37\":\"Yuncken Constructions\",\"42\":[\"24\"],\"36\":\"2010\",\"33\":\"<p>This substantial home sits on a sizable waterfront property with views over Long Bay and Northbridge. The accommodation is arranged across 2 pavillions which step down a steeply sloping site. A number of significant angophora trees on the site dictated the placement of the building. The home is divided over 6 levels, large terraces from each level provide an immediate connection with the unique setting. A warm palette of timer and travertine flooring, stone wall cladding and liberal expanses of glazing combine to create a luxurious living environment.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"614\"],\"39\":\"Marian Rabic\",\"61\":[\"734\",\"735\",\"736\",\"737\",\"738\",\"739\"],\"35\":\"CREMORNE\",\"41\":[\"740\"],\"34\":\"WONGA ROAD\"}}','2014-08-06 03:25:29','2014-08-06 03:25:29','0751814e-fa0d-4aa4-b929-d67975e70436'),
 ('359','273','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"DORSET ROAD\",\"slug\":\"dorset-rd\",\"postDate\":1403669460,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"405 sqm\",\"37\":\"Yuncken Construction Group\",\"42\":[\"24\"],\"36\":\"2011\",\"33\":\"<p>Designed to exploit its position, this 5 level contemporary home steps up a steep hill creating large roof terraces that maximise views over Middle Harbour. The home is wide and is typically 1 room deep. The glazed circulation space with stairs and a lift create a vertical tower at one end. Counterpoint to this, are the horizontal bands created by a bedroom wing with roof terrace above. Living areas are located on the upper level with a large terrace and access to the garden, while the master bedroom is on the top level.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"61\":[\"742\",\"743\",\"744\",\"745\",\"746\",\"747\",\"748\",\"749\"],\"35\":\"NORTHBRIDGE\",\"41\":[\"750\"],\"34\":\"DORSET ROAD\"}}','2014-08-06 03:27:09','2014-08-06 03:27:09','26ea76da-4e16-4379-a018-8c1182294835'),
 ('360','292','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"LIGHTHOUSE ROAD\",\"slug\":\"lighthouse-rd\",\"postDate\":1403670000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"250 sqm\",\"37\":\"Todd Knaus Constructions SX Projects\",\"42\":[\"24\"],\"36\":\"2011\",\"33\":\"<p>This home is situated on a beachfront property overlooking Byron Bay. It was designed as part of a 2 home subdivision and incorporates local weathered basalt stone, fibre cement sheet cladding, dark stained timber and a large metal skillion roof with large eaves. The floor plan efficiently utilizes the available space and allows for generous living areas and 4 bedrooms. Timber framed sliding doors and louvered windows with wide covered decks create the ideal sub-tropical beach house.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"291\"],\"39\":\"Saul Goodwin\",\"61\":[\"751\",\"752\",\"753\",\"754\",\"755\",\"756\",\"757\",\"758\"],\"35\":\"BYRON BAY\",\"41\":[\"759\"],\"34\":\"LIGHTHOUSE ROAD\"}}','2014-08-06 03:29:13','2014-08-06 03:29:13','1df84e77-2e4e-4ab4-8e10-f69e34d5e866'),
 ('361','323','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"MINNAMURRA ROAD\",\"slug\":\"minnamurra-road\",\"postDate\":1403670360,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"470 sqm\",\"37\":\"Joe Motherway Constructions\",\"42\":[\"24\"],\"36\":\"2011\",\"33\":\"<p>Overlooking Sailors Bay, this contemporary low maintenance home was designed for a large family. The home is organised around a central circulation spine.  An open timber stair allows through views from the middle level entry. Living areas and a study\\/guest room are also at this level. The upper level includes 5 bedrooms, dressing rooms, bathrooms and access to the garage. The lowest level provides a rumpus room, gym, music room and another bathroom. This leads out to the swimming pool and terraced lawn. The skillion roof follows the site\\u2019s gradient. Materials include sandstone walls, spotted gum floors, aluminium framed windows and privacy screens.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"61\":[\"760\",\"761\",\"762\",\"763\",\"764\",\"765\",\"766\",\"767\"],\"35\":\"NORTHBRIDGE\",\"41\":[\"768\"],\"34\":\"MINNAMURRA ROAD\"}}','2014-08-06 03:30:54','2014-08-06 03:30:54','8e859fee-5d42-4ebf-abda-102cf8700c5f'),
 ('362','778','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SHELLBANK AVENUE II\",\"slug\":\"shellbank-avenue-ii\",\"postDate\":1407296167,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"595m2\",\"37\":\"RJC Constructions\",\"42\":[\"24\"],\"36\":\"2012\",\"33\":\"<p>Built on a steep north facing waterfront site, this home is organized in 2 parts. At the uppermost level is a stone blade wall abutting a dark stained timber box that incorporates a garage and entry pavilion including the stair and lift. Two storeys below rests the main house built over 3 levels. The uppermost floor is dedicated to living areas, the middle floor accommodates bedrooms and the lowest floor is an open-air pool cabana with wet edge pool and terraces leading onto the garden. A central courtyard ensures light reaches rooms facing the hillside. Clean lines and a restrained palette of materials ensure that the magnificent views take precedence over the built form.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"616\"],\"39\":\"Steve Back\",\"61\":[\"769\",\"770\",\"771\",\"772\",\"773\",\"774\",\"775\",\"776\"],\"35\":\"MOSMAN\",\"41\":[\"777\"],\"34\":\"SHELLBANK AVENUE II\"}}','2014-08-06 03:36:08','2014-08-06 03:36:08','0eac50da-dc58-4c60-8677-f458b3b8d630'),
 ('363','469','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SHELLBANK AVENUE III\",\"slug\":\"shellbank-avenue-1\",\"postDate\":1403837280,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"760\",\"37\":\"Sandlik Constructions\",\"42\":[\"24\"],\"36\":\"2009\",\"33\":\"<p>We were commissioned to undertake a major renovation to this large waterfront home. The property comprises a two storey garage building, a three storey home and a boatshed. Once stripped back to the bare floor plates, all three buildings were transformed with large window openings, a new zinc roof and sandstone, zinc and stained cedar cladding. Rooms were reorganized and streamlined with a sophisticated interior design by Interni, including the sculptural central staircase. The swimming pool was rebuilt in a new location to improve the connection to the waterfront and the Dangar Group provided a contemporary garden employing interlocking zinc clad boxes with lush planting to complete the design.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Richard Glover\",\"61\":[\"779\",\"780\",\"781\",\"782\",\"783\",\"784\",\"785\",\"786\"],\"35\":\"MOSMAN\",\"41\":[\"787\"],\"34\":\"SHELLBANK AVENUE III\"}}','2014-08-06 03:39:42','2014-08-06 03:39:42','529febd7-7386-4b10-a4c9-110e227fa025'),
 ('364','797','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"REDAN STREET\",\"slug\":\"redan-street\",\"postDate\":1407296622,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"460m2\",\"37\":\"AIM Partnership\\/FS Hough Builders\",\"42\":[\"24\"],\"36\":\"2013\",\"33\":\"<p>Built on the Balmoral slopes this 3 level residence is designed to maximise the east facing water view from every level. The journey from front gate to the middle main living level two floors down, where the panoramic view is unveiled, is made interesting with carefully considered experiences and framed snippets of the view. Bedrooms are located on the top floor and casual living on the bottom leading out to the garden, pool and spa. Double height volume is strategically positioned to maximise solar access. A restrained palette of materials is used to create sophisticated and calm interior that is in harmony with the serene water view.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"618\"],\"39\":\"Richard Glover\",\"61\":\"\",\"35\":\"MOSMAN\",\"41\":\"\",\"34\":\"REDAN STREET\"}}','2014-08-06 03:43:43','2014-08-06 03:43:43','0cf4dad0-a3e5-4fce-a255-4bc080ea4865'),
 ('365','797','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"REDAN STREET\",\"slug\":\"redan-street\",\"postDate\":1407296580,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"460m2\",\"37\":\"AIM Partnership\\/FS Hough Builders\",\"42\":[\"24\"],\"36\":\"2013\",\"33\":\"<p>Built on the Balmoral slopes this 3 level residence is designed to maximise the east facing water view from every level. The journey from front gate to the middle main living level two floors down, where the panoramic view is unveiled, is made interesting with carefully considered experiences and framed snippets of the view. Bedrooms are located on the top floor and casual living on the bottom leading out to the garden, pool and spa. Double height volume is strategically positioned to maximise solar access. A restrained palette of materials is used to create sophisticated and calm interior that is in harmony with the serene water view.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"618\"],\"39\":\"Richard Glover\",\"61\":[\"788\",\"789\",\"790\",\"791\",\"792\",\"793\",\"794\",\"795\"],\"35\":\"MOSMAN\",\"41\":[\"796\"],\"34\":\"REDAN STREET\"}}','2014-08-06 03:44:51','2014-08-06 03:44:51','3c41cef8-9f21-46f9-8b3d-288582b418ec'),
 ('366','333','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"BERTHONG\",\"slug\":\"berthong\",\"postDate\":1403831220,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"37\":\"Sandlik Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2004\",\"33\":\"<p>Berthong is a significant historic property in Elizabeth Bay. Having undergone many alterations and a recent conversion into two duplex apartments, we were commissioned to restore the building back to a family home.<\\/p><p>The building fabric was extensively renewed, a new entry hall was created, stairs were rebuilt, a kitchen and bulters pantry was relocated to a more prominent position and 6 bathrooms were built. A large rear stone paved terrace and stairs was added to connect the house to the waterfront. This is a finely detailed grand property. The home received the MBA award in 2005.<\\/p>\",\"46\":[\"showCompleted\",\"showBuilder\"],\"47\":\"\",\"40\":\"\",\"39\":\"\",\"61\":[\"798\",\"799\",\"800\",\"801\",\"802\",\"803\"],\"35\":\"\",\"41\":[\"804\"],\"34\":\"BERTHONG\"}}','2014-08-06 03:51:48','2014-08-06 03:51:48','b1d4328d-3cce-40fc-9c53-eebefd6c26bf');
insert into `craft_entryversions` values('367','345','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WINDWARD\",\"slug\":\"windward\",\"postDate\":1403831760,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"420 sqm\",\"37\":\"J Motherway Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2007\",\"33\":\"<p>This large Federation home required significant restoration and upgrading of living, dining and kitchen areas. Two new covered terraces were added using detailing sympathetic to the original features. These now provide additional outdoor living areas and enjoy views over Sydney Harbour. The careful integration of old and new with selective use of materials gives a traditional home a new lease of life.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"346\"],\"39\":\"Craig Bryant\",\"61\":[\"805\",\"806\",\"807\"],\"35\":\"MOSMAN\",\"41\":[\"808\"],\"34\":\"WINDWARD\"}}','2014-08-06 03:54:01','2014-08-06 03:54:01','a46e5fca-73f2-4b47-b751-917191b935b5'),
 ('368','345','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WINDWARD ROAD\",\"slug\":\"windward\",\"postDate\":1403831760,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"420 sqm\",\"37\":\"J Motherway Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2007\",\"33\":\"<p>This large Federation home required significant restoration and upgrading of living, dining and kitchen areas. Two new covered terraces were added using detailing sympathetic to the original features. These now provide additional outdoor living areas and enjoy views over Sydney Harbour. The careful integration of old and new with selective use of materials gives a traditional home a new lease of life.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"619\"],\"39\":\"Craig Bryant\",\"61\":[\"805\",\"806\",\"807\"],\"35\":\"MOSMAN\",\"41\":[\"808\"],\"34\":\"WINDWARD ROAD\"}}','2014-08-06 03:55:37','2014-08-06 03:55:37','ca88d7b6-0bb9-4a3d-ad4d-462543d10abc'),
 ('369','333','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"BERTHONG\",\"slug\":\"berthong\",\"postDate\":1403831220,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"37\":\"Sandlik Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2004\",\"33\":\"<p>Berthong is a significant historic property in Elizabeth Bay. Having undergone many alterations and a recent conversion into two duplex apartments, we were commissioned to restore the building back to a family home.<\\/p><p>The building fabric was extensively renewed, a new entry hall was created, stairs were rebuilt, a kitchen and bulters pantry was relocated to a more prominent position and 6 bathrooms were built. A large rear stone paved terrace and stairs was added to connect the house to the waterfront. This is a finely detailed grand property. The home received the MBA award in 2005.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"\",\"61\":[\"798\",\"799\",\"800\",\"801\",\"802\",\"803\"],\"35\":\"ELIZABETH BAY\",\"41\":[\"804\"],\"34\":\"BERTHONG\"}}','2014-08-06 03:57:06','2014-08-06 03:57:06','5dbb045f-2885-4f52-8be6-9b68ae81e117'),
 ('370','356','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"PARRIWI ROAD\",\"slug\":\"parriwi-rd\",\"postDate\":1403832000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"420 sqm\",\"37\":\"J Wallace Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2008\",\"33\":\"<p>This is a major renovation of a classic 1970\\u2019s home located on a steep site overlooking Sydney Harbour and Chinaman\\u2019s Beach. Spread over 3 main levels the confined internal spaces were opened up and enlarged. New services were incorporated, together with an internal lift. A steel framed covered terrace with operable roof was added to the rear of the home and a new roof with clerestory brings light and ventilation to the core of the home. The interior designer introduced contemporary artwork and furnishings to compliment the reinvigorated living spaces.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"347\"],\"39\":\"Craig Bryant\",\"61\":[\"809\",\"810\",\"811\",\"812\",\"813\",\"814\",\"815\"],\"35\":\"MOSMAN\",\"41\":[\"816\"],\"34\":\"PARRIWI ROAD\"}}','2014-08-06 03:59:07','2014-08-06 03:59:07','26b223cf-46ef-4262-9000-bd785760c93b'),
 ('371','364','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"EUROBIN AVENUE\",\"slug\":\"eurobin-ave\",\"postDate\":1403832360,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"345\",\"37\":\"J Motherway Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2008\",\"33\":\"<p>This heritage listed 1930\\u2019s duplex apartment has been converted to a single family home. The street fa\\u00e7ade was retained but the interior was reorganised and a new addition covered terrace added at the rear. Living areas located on the upper level now enjoy views over Manly lagoon. The lower level includes bedrooms and rumpus room opening onto the north-facing terrace. A 2-storey void at the centre of the home provides an immediate connection between the entry and the upper levels. Traditional detailing was carried throughout the home and combined with more modern and custom joinery.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"824\"],\"39\":\"Craig Bryant\",\"61\":[\"817\",\"818\",\"819\",\"820\",\"821\",\"822\"],\"35\":\"MANLY\",\"41\":[\"823\"],\"34\":\"EUROBIN AVENUE\"}}','2014-08-06 04:02:38','2014-08-06 04:02:38','ff2c68c6-d8ff-467f-b952-7df6b0426776'),
 ('372','382','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"FAIRFAX ROAD\",\"slug\":\"fairfax-rd\",\"postDate\":1403832900,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"420 sqm\",\"37\":\"J Motherway Constructions\",\"42\":[\"34\"],\"36\":\"2008\",\"33\":\"<p>What was originally a 1970\\u2019s home with awkward hexagonal shaped spaces has been significantly rebuilt to provide a more streamlined home. Internal walls were removed to provide larger open plan living areas, the roofline was squared off and windows were replaced to provide larger opening to optimize light ventilation and the view. New interior finishes of limestone, timber veneer and metallic polyurethane maintain the modern approach<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"373\"],\"39\":\"Crag Bryant\",\"61\":[\"825\",\"826\",\"827\",\"828\",\"829\",\"830\",\"831\"],\"35\":\"MOSMAN\",\"41\":[\"832\"],\"34\":\"FAIRFAX ROAD\"}}','2014-08-06 04:05:04','2014-08-06 04:05:04','422a1964-e402-4705-9306-5baf1fe41977'),
 ('373','401','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"INNER WEST\",\"slug\":\"inner-west\",\"postDate\":1403833680,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"500 sqm\",\"37\":\"Wentworth Projects \",\"42\":[\"34\"],\"36\":\"2009\",\"33\":\"<p>The project involved converting a vacant warehouse into a florist workshop and a luxurious residence. This mixed use building was designed to accommodate a large family and a collection of racing cars. The lower floor living areas revolve around the kitchen that features a 9 metre long polished concrete bench. It is a unique component of the design, folding out of the floor and floating over it. The upper floor contains bedroom suites and a second living space. A central courtyard garden was carved into the building and fills the living areas and bedrooms with sunlight and natural ventilation. The result is a rare living and working environment in an industrial context<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"842\"],\"39\":\"Steve Back\",\"61\":[\"833\",\"834\",\"835\",\"836\",\"837\",\"838\",\"839\",\"840\"],\"35\":\"WAREHOUSE\",\"41\":[\"841\"],\"34\":\"INNER WEST\"}}','2014-08-06 04:19:27','2014-08-06 04:19:27','9dcea09f-d4e5-4b72-8494-55229987e46c'),
 ('374','401','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"INNER WEST WAREHOUSE\",\"slug\":\"inner-west\",\"postDate\":1403833680,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"500 sqm\",\"37\":\"Wentworth Projects \",\"42\":[\"34\"],\"36\":\"2009\",\"33\":\"<p>The project involved converting a vacant warehouse into a florist workshop and a luxurious residence. This mixed use building was designed to accommodate a large family and a collection of racing cars. The lower floor living areas revolve around the kitchen that features a 9 metre long polished concrete bench. It is a unique component of the design, folding out of the floor and floating over it. The upper floor contains bedroom suites and a second living space. A central courtyard garden was carved into the building and fills the living areas and bedrooms with sunlight and natural ventilation. The result is a rare living and working environment in an industrial context<\\/p>\",\"46\":[\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":\"\",\"40\":[\"842\"],\"39\":\"Steve Back\",\"61\":[\"833\",\"834\",\"835\",\"836\",\"837\",\"838\",\"839\",\"840\"],\"35\":\"\",\"41\":[\"841\"],\"34\":\"INNER WEST WAREHOUSE\"}}','2014-08-06 04:21:06','2014-08-06 04:21:06','80ca48e0-2932-4cf5-a548-dd21b7e3170b'),
 ('375','409','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"CREMORNE ROAD \",\"slug\":\"cremorne-road\",\"postDate\":1403833920,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"300 sqm\",\"37\":\"John Thew Constructions\",\"42\":[\"34\"],\"36\":\"2009\",\"33\":\"<p>A large federation home with views over Mosman Bay was refurbished and restored. The approach balanced the retention of many period architectural features with the removal of walls and refurbishment of rooms to create a stronger connection between spaces. This allowed light and views to rooms that were otherwise deprived. A palette of dark stained floors, white walls, American walnut veneer and white polyurethane, together with careful selection of furniture and artwork by the interior designer results in a clean aesthetic to compliment the period details.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"408\"],\"39\":\"Craig Bryant\",\"61\":[\"843\",\"844\",\"845\",\"846\",\"847\"],\"35\":\"CREMORNE POINT\",\"41\":[\"848\"],\"34\":\"CREMORNE ROAD \"}}','2014-08-06 04:23:43','2014-08-06 04:23:43','0c78f9f5-97ff-442d-bcba-2928cb657739'),
 ('376','420','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"MARINE PARADE\",\"slug\":\"marine-parade\",\"postDate\":1403834340,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"480 sqm\",\"37\":\"Gartner Rose\",\"42\":[\"34\"],\"36\":\"2010\",\"33\":\"<p>The project is a transformation of a Victorian terrace house on a waterfront site into a modern open plan 4 bedroom home. While the building shell was retained, the internal layout was reconfigured. A 3<sup style=\\\"font-family: Arial, Helvetica, Verdana, Tahoma, sans-serif; \\\">rd<\\/sup> level attic was removed to reduce the building scale. A zinc-clad fa\\u00e7ade frames the home; steel and timber framework and coloured glass balustrade add greater complexity. A sophisticated steel interior design with a controlled use of strong colours further enriches the home.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"858\"],\"39\":\"Steve Back\",\"61\":[\"849\",\"850\",\"851\",\"852\",\"853\",\"854\",\"855\",\"856\"],\"35\":\"DOUBLE BAY\",\"41\":[\"857\"],\"34\":\"MARINE PARADE\"}}','2014-08-06 04:38:32','2014-08-06 04:38:32','06fc8c2f-0e34-4a9b-8a1b-5876a4cc897a'),
 ('377','421','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SEAFORTH CRESCENT\",\"slug\":\"seaforth-crescent\",\"postDate\":1403834820,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"500\",\"37\":\"FS Hough Pty Ltd\",\"42\":[\"34\"],\"36\":\"2011\",\"33\":\"<p>This challenging project involved the remodelling of a 1960\\u2019s 5 level waterfront home on a precipitous south facing site. The house was stripped back to its concrete framework. A new circulation stair and lift was attached to the rear of the home and a new steel framed structure was attached to the waterfront side supporting balconies for all levels.  A two storey void on the living area floods these spaces with northern light. The restrained&nbsp;palette&nbsp;of materials of white walls, blackbutt timber floors and pietra grey marble enhance the sharp design. A&nbsp;crumbling 1960\\u2019s home has been transformed into a striking contemporary home that now engagtes with its context.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"865\"],\"39\":\"Craig Bryant \",\"61\":[\"859\",\"860\",\"861\",\"862\",\"863\"],\"35\":\"SEAFORTH\",\"41\":[\"864\"],\"34\":\"SEAFORTH CRESCENT\"}}','2014-08-06 04:44:56','2014-08-06 04:44:56','849675dc-6a95-489e-b693-9bd7d00f960f'),
 ('378','438','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"NORTH AVOCA\",\"slug\":\"north\",\"postDate\":1403835480,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"315 sqm\",\"37\":\"J & S Mitchell Pty Ltd\",\"42\":[\"34\"],\"36\":\"2012\",\"33\":\"<p>A 1970\\u2019s two storey home occupied this prime waterfront property and our clients had plans to demolish it and build a new home.  We convinced them to retain the home, reorganise the layout and extend it to improve the relationship with the beachfront. A new single level&nbsp;pavilion&nbsp;was added to the rear and a new covered terrace and kitchen connects this to the original home. The existing building was reorganised to&nbsp;provide 5 bedrooms and a light filled entrance hall.  The home is now a sharp contemporary beach house with a direct connection to the garden and beach beyond.<\\/p>\",\"46\":[\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":\"\",\"40\":[\"428\"],\"39\":\"Craig Bryant\",\"61\":[\"437\",\"436\",\"435\",\"434\",\"433\",\"432\",\"431\",\"430\"],\"35\":\"\",\"41\":[\"429\"],\"34\":\"NORTH AVOCA\"}}','2014-08-06 04:46:08','2014-08-06 04:46:08','56c4efb6-9fb9-4b47-9a41-319f305ed37e'),
 ('379','438','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"NORTH AVOCA\",\"slug\":\"north\",\"postDate\":1403835480,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"315 sqm\",\"37\":\"J & S Mitchell Pty Ltd\",\"42\":[\"34\"],\"36\":\"2012\",\"33\":\"<p>A 1970\\u2019s two storey home occupied this prime waterfront property and our clients had plans to demolish it and build a new home.  We convinced them to retain the home, reorganise the layout and extend it to improve the relationship with the beachfront. A new single level&nbsp;pavilion&nbsp;was added to the rear and a new covered terrace and kitchen connects this to the original home. The existing building was reorganised to&nbsp;provide 5 bedrooms and a light filled entrance hall.  The home is now a sharp contemporary beach house with a direct connection to the garden and beach beyond.<\\/p>\",\"46\":[\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":\"\",\"40\":[\"428\"],\"39\":\"Craig Bryant\",\"61\":[\"866\",\"867\",\"868\",\"869\",\"870\",\"871\",\"872\",\"873\"],\"35\":\"\",\"41\":[\"874\"],\"34\":\"NORTH AVOCA\"}}','2014-08-06 04:47:52','2014-08-06 04:47:52','51bf249d-7b44-4e25-9b84-214d8b61d1ca'),
 ('380','448','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WAIWERA STREET \",\"slug\":\"waiwera-street\",\"postDate\":1403836740,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"245 sqm\",\"37\":\"Dobsonei\",\"42\":[\"34\"],\"36\":\"2013\",\"33\":\"\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"439\"],\"39\":\"Craig Bryant\",\"61\":[\"875\",\"876\",\"877\",\"878\",\"879\",\"880\",\"881\"],\"35\":\"McMAHONS POINT\",\"41\":[\"882\"],\"34\":\"WAIWERA STREET \"}}','2014-08-06 04:50:20','2014-08-06 04:50:20','62d57e06-4abc-4c62-a333-4477faaa8fee'),
 ('381','450','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WARWICK AVENUE\",\"slug\":\"warwick-avenue\",\"postDate\":1403836980,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"269 sqm\",\"37\":\"Bellamy Builders Pty Ltd \",\"42\":[\"34\"],\"36\":\"2012\",\"33\":\"<p>Like many of its kind, this federation home required the usual removal of poorly considered additions in order to reach its potential. A small 1980\\u2019s kitchen and bathroom on the northern side blocked access to the garden and sunlight. Once removed a new large living space was created linking to the garden. A second level was incorporated into the roof and provides study, master bedroom suite and balcony. Original rooms were refurnished allowing the owners to enjoy a beautiful character filled home with living areas bathed in sunlight.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"451\"],\"39\":\"Craig Bryant\",\"61\":[\"883\",\"884\",\"885\",\"886\",\"887\",\"888\",\"889\"],\"35\":\"CAMMERAY\",\"41\":[\"890\"],\"34\":\"WARWICK AVENUE\"}}','2014-08-06 04:52:47','2014-08-06 04:52:47','5aa2d2a8-305d-4558-b5e6-fa4465a580b5'),
 ('382','478','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SHADFORTH STREET\",\"slug\":\"shadforth-street\",\"postDate\":1403837460,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"400 sqm\",\"37\":\"J Motherway Constructions     \",\"42\":[\"34\"],\"36\":\"2013\",\"33\":\"<p>This home exemplifies a clever integration of contemporary design with a traditional Federation dwelling. The original cottage was carefully restored and a new two storey living and bedroom pavilion was constructed behind, detached from the house by a courtyard and glass lined circulation volume. Main living areas open out to the rear garden and back to the sheltered courtyard. What was a small cottage is now a generous light filled family home.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"470\"],\"39\":\"Craig Byrant\",\"61\":[\"891\",\"892\",\"893\",\"894\",\"895\",\"896\"],\"35\":\"MOSMAN\",\"41\":[\"897\"],\"34\":\"SHADFORTH STREET\"}}','2014-08-06 05:03:36','2014-08-06 05:03:36','dcdf3ed7-9f1c-4717-96ad-298faaa3e8de'),
 ('383','486','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WONGA ROAD II\",\"slug\":\"wonga-road\",\"postDate\":1403837700,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"470m2\",\"37\":\"JP Thew Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2014\",\"33\":\"<p>We were commissioned to design alterations and additions to a newly built 3 level waterfront home recently purchased by our clients. The brief was to add a lift, wine cellar, guest bathroom and generally refurbish the home to provide a richer background for the clients possessions.<\\/p><p>The lift shaft has 2 walls of full height glazing to reduce the additional building bulk and afford views to the passengers. These windows are screened with vertical aluminium battens. The wine cellar enjoys water views through the lift shaft into the courtyard beyond. The new bathroom was crafted from a space that was two bathrooms. Interior stylist, Lucy Purchas worked closely with the clients, commissioning new furniture, selecting wall finishes to compliment the client\\u2019s extensive collection of art work and sculpture. Hugh Main of Spirit Level landscape design created a series of unique garden spaces, grounding the home in a visually striking landscape.&nbsp;<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"629\"],\"39\":\"Craig Bryant\",\"61\":\"\",\"35\":\"CREMORNE\",\"41\":\"\",\"34\":\"WONGA ROAD II\"}}','2014-08-06 05:06:49','2014-08-06 05:06:49','93460565-69c6-453b-b364-e4698cde2a11'),
 ('384','486','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WONGA ROAD II\",\"slug\":\"wonga-road\",\"postDate\":1403837700,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"470m2\",\"37\":\"JP Thew Constructions Pty Ltd\",\"42\":[\"34\"],\"36\":\"2014\",\"33\":\"<p>We were commissioned to design alterations and additions to a newly built 3 level waterfront home recently purchased by our clients. The brief was to add a lift, wine cellar, guest bathroom and generally refurbish the home to provide a richer background for the clients possessions.<\\/p><p>The lift shaft has 2 walls of full height glazing to reduce the additional building bulk and afford views to the passengers. These windows are screened with vertical aluminium battens. The wine cellar enjoys water views through the lift shaft into the courtyard beyond. The new bathroom was crafted from a space that was two bathrooms. Interior stylist, Lucy Purchas worked closely with the clients, commissioning new furniture, selecting wall finishes to compliment the client\\u2019s extensive collection of art work and sculpture. Hugh Main of Spirit Level landscape design created a series of unique garden spaces, grounding the home in a visually striking landscape.&nbsp;<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"629\"],\"39\":\"Craig Bryant\",\"61\":[\"898\",\"899\",\"900\",\"901\",\"902\",\"903\",\"904\",\"905\"],\"35\":\"CREMORNE\",\"41\":[\"906\"],\"34\":\"WONGA ROAD II\"}}','2014-08-06 05:07:45','2014-08-06 05:07:45','7a4134d7-c5b0-40e6-9f06-b369b4307fd5'),
 ('385','497','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"THE ESTHERS\",\"slug\":\"the-esthers\",\"postDate\":1403838000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"755 sqm\",\"37\":\"SX Projects Pty Ltd\",\"42\":[\"32\"],\"36\":\"2007\",\"33\":\"<p>This contemporary duplex apartment complex sits on a prominent corner close to the beach. The upper level apartment includes large decks and a wet edge pool, the lower level apartment has a large north facing garden. A central courtyard ensures northern light reaches the complex\\u2019s core. Spacious internal rooms, which combine a casual beachside feel with luxurious finishes, seamlessly connect to outdoor terraces and gardens. The result is a beautiful beachside apartment development cleverly integrated with its surroundings.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"487\"],\"39\":\"Craig Bryant\",\"61\":[\"907\",\"908\",\"909\",\"910\",\"911\",\"912\",\"913\",\"914\"],\"35\":\"MOSMAN\",\"41\":[\"915\"],\"34\":\"THE ESTHERS\"}}','2014-08-06 05:28:28','2014-08-06 05:28:28','0b5a34cd-5052-4f48-88fe-a46d31c256fe'),
 ('386','923','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"POMEROY\",\"slug\":\"pomeroy\",\"postDate\":1407305043,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"12,600m2\",\"37\":\"A W Edwards Pty Ltd\",\"42\":[\"32\"],\"36\":\"2004\",\"33\":\"<p>This classically styled apartment complex includes 39 luxury apartments and a commercial space. The building has 11 levels and the lift core services 6 apartments per level. It was designed as an infill to the adjacent heritage listed apartment buildings of Macleay Street. All apartments include generous living spaces, large undercover terraces and high quality finishes and joinery elements.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"631\"],\"39\":\"Craig Bryant\",\"61\":[\"919\",\"920\",\"921\"],\"35\":\"POTTS POINT\",\"41\":[\"922\"],\"34\":\"POMEROY\"}}','2014-08-06 06:04:03','2014-08-06 06:04:03','d43f5cb8-b972-4536-9714-d3c8f6c1cac2'),
 ('387','924','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"WYLDE STREET\",\"slug\":\"wylde-street\",\"postDate\":1407305312,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"7,200m2\",\"37\":\"Abigroup\",\"42\":[\"32\"],\"36\":\"2000\",\"33\":\"<p>Located on a large site in Potts Point overlooking Elizabeth Bay this 8 level building comprises 24 luxury 2 and 3 bedroom apartments and 2 penthouses. The building is divided into 2 parts with 2 lift cores. At the street level the building is spread over 4 levels with an indoor swimming pool on the lowest floor. At the rear the apartments are spread over 8 levels. Each apartment benefits from large covered terraces, many with retractable louvres for sun control and privacy. High quality finishes and detailed joinery have been used throughout.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":[\"630\"],\"39\":\": Craig Bryant\",\"61\":[\"916\",\"917\"],\"35\":\"POTTS POINT\",\"41\":[\"918\"],\"34\":\"WYLDE STREET\"}}','2014-08-06 06:08:32','2014-08-06 06:08:32','c8bf6e8b-a4b7-4c3d-8d69-ca056700cec2'),
 ('388','504','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"SWERVE &amp; CO CAFE\",\"slug\":\"swerve-amp-co\",\"postDate\":1403838240,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"100 sqm\",\"37\":\"Kevin Brown\",\"42\":[\"33\"],\"36\":\"2010\",\"33\":\"<p>We were commissioned to design the fit-out of a new caf\\u00e9-bar-restaurant inserted in a long narrow commercial space. The space is organised with the work and serving area on one side and a long banquette dining space on the other. A horizontal band of backlit mirror and pendant lighting reinforce the linear arrangement and enhance the dining space. Patterns feature strongly in the timber slat detailing to shelving and wall panels of colourful striped fabric.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\",\"showPhotographer\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"Craig Bryant\",\"61\":[\"925\",\"926\",\"927\",\"928\",\"929\"],\"35\":\"MOSMAN\",\"41\":[\"930\"],\"34\":\"SWERVE & CO CAFE\"}}','2014-08-06 06:11:07','2014-08-06 06:11:07','a5849651-893e-4500-8f23-d03a6885b0a2'),
 ('389','933','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"HERON COVE MARINA\",\"slug\":\"heron-cove-marina\",\"postDate\":1407306212,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"1000m2\",\"37\":\"Harson Pty Ltd\",\"42\":[\"33\"],\"36\":\"1995\",\"33\":\"<p>This project involved the construction of a new over-water marina complex comprising a commercial office, retail and workshop building, a new elevated hardstand with a 50 ton boat lifting facility and 30 floating marina berths with associated car parking. The new 2-storey steel framed building, built over the water, is clad in CFC panels with a curved metal roof. The building incorporates wide verandahs along the northern elevation providing access to the offices and marina berths.  Council and Waterways owned land was reclaimed to create a car park and cul-de-sac road with integrated landscaping. The development is a fine example of a successfully operated and appropriately scaled marina facility.<\\/p>\",\"46\":[\"showCompleted\",\"showBuilder\",\"showArea\"],\"47\":\"\",\"40\":[\"633\"],\"39\":\"\",\"61\":[\"931\"],\"35\":\"\",\"41\":[\"932\"],\"34\":\"HERON COVE MARINA\"}}','2014-08-06 06:23:32','2014-08-06 06:23:32','7af4f9cb-cfe6-47db-b9a7-19d4771c708e'),
 ('390','940','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"PRINCES STREET MARINA\",\"slug\":\"princes-street-marina\",\"postDate\":1407307170,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"1000m2\",\"37\":\"Construction Pacific\",\"42\":[\"33\"],\"36\":\"1996\",\"33\":\"<p>This project involved the rebuilding of a 1970\\u2019s steel framed marina workshop. The building was stripped back to the original frame and a new floor structure was inserted within the 2- storey height workshop space. The structure was re-clad in compressed fc sheet, and a new cantilevered verandah wraps around the building providing access to upper level offices. This addition breaks down the fa\\u00e7ade creating 2 distinct levels. The new roof sheeting extends down the upper section of walls to further reduce the building\\u2019s scale. The refurbishment upgraded the marina facility and provided an extra 500m<sup>2 <\\/sup>of additional floor space within the existing structure and received a BHP award in 1996.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\",\"showBuilder\",\"showArea\"],\"47\":[\"showSuburb\"],\"40\":\"\",\"39\":\"\",\"61\":[\"934\"],\"35\":\"NEWPORT\",\"41\":[\"935\"],\"34\":\"PRINCES STREET MARINA\"}}','2014-08-06 06:39:30','2014-08-06 06:39:30','99f6e55f-85cc-4511-a673-3de000bb51ab'),
 ('391','941','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"D&#039;ALBORA MARINA\",\"slug\":\"d-039-albora-marina\",\"postDate\":1407307260,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"37\":\"\",\"42\":[\"33\"],\"36\":\"\",\"33\":\"<p>We have been commissioned to design a new commercial marina to replace the existing building and marina facility. The new building will provide workshops, boat showroom, management offices for charter boat hire, yacht brokerage and a restaurant and kiosk. An additional 35 marina berths will be added to the existing facility. In keeping with the \\u2018clean marina\\u2019 approach, the new facility will incorporate recycled building materials, rainwater harvesting and photovoltaic panels for energy generation. Importantly, the new facility will improve public access to the waterfront.<\\/p>\",\"46\":[\"showSuburb\",\"showCompleted\"],\"47\":[\"showSuburb\"],\"40\":[\"636\"],\"39\":\"\",\"61\":\"\",\"35\":\"MOSMAN\",\"41\":\"\",\"34\":\"D\'ALBORA MARINA\"}}','2014-08-06 06:41:29','2014-08-06 06:41:29','8b7ff4d7-bbf3-4443-8acf-d72370955136'),
 ('392','941','6','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"D&#039;ALBORA MARINA\",\"slug\":\"d-039-albora-marina\",\"postDate\":1407307260,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"37\":\"\",\"42\":[\"33\"],\"36\":\"\",\"33\":\"<p>We have been commissioned to design a new commercial marina to replace the existing building and marina facility. The new building will provide workshops, boat showroom, management offices for charter boat hire, yacht brokerage and a restaurant and kiosk. An additional 35 marina berths will be added to the existing facility. In keeping with the \\u2018clean marina\\u2019 approach, the new facility will incorporate recycled building materials, rainwater harvesting and photovoltaic panels for energy generation. Importantly, the new facility will improve public access to the waterfront.<\\/p>\",\"46\":[\"showSuburb\"],\"47\":[\"showSuburb\"],\"40\":[\"636\"],\"39\":\"\",\"61\":[\"936\",\"937\"],\"35\":\"MOSMAN\",\"41\":[\"939\"],\"34\":\"D\'ALBORA MARINA\"}}','2014-08-06 06:42:11','2014-08-06 06:42:11','16a33c9d-d56c-448e-805c-2b81a4709c13'),
 ('393','6','4','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"Philip  Corben\",\"slug\":\"ryan-belisle\",\"postDate\":1402011780,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"18\":\"<p>Architect, sailor, snow skier, surfer, cyclist, yoga enthusiast.<\\/p><p>Philip worked for ten years with the respected firms of Cox Architects, Clarke Perry Blackmore and Architecture Oceania. In 1990, he established Corben Architects with the overriding commitment to quality design and a high level of client service.<\\/p><p>Whilst Philip overviews every project within the office he is predominantly involved in the client liaison and design review. As the Managing Director, Philip is also responsible for the business management of the practice, assisted by office manager Janelle Alexander and book keeper Debra Lane. <\\/p><p>Outside work, Philip shares his time between his outgoing wife Lucy,his three daughters and also tries to find time for his love of competitive sailing, long board surfing, the slopes of Thredbo, cycling, &nbsp;yoga and escaping to his beachside hideaway in Byron Bay.<\\/p>\",\"17\":\"B.Sc. (Arch) B Arch (Hon) FRAIA\\u00a0 Registration number 4616\",\"21\":[\"true\"],\"14\":\"Philip \",\"15\":\"Corben\",\"19\":[\"539\"],\"16\":\"Managing Director\",\"20\":\"director\"}}','2014-08-06 06:51:32','2014-08-06 06:51:32','a719eab1-45fb-49bf-9983-019772aa4e04'),
 ('394','7','4','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"Mohit Keni\",\"slug\":\"first-last\",\"postDate\":1402012740,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"18\":\"<p><p>Architect, computer guru, cricketer and keen golfer.<\\/p><p>After graduating in Architecture from India in 1992, Mohit moved to Sydney to undertake his Masters degree from University of NSW. Mohit then worked at Baker Associate Architects for 4 years before joining Corben Architects in 1999. Mohit is responsible for the IT development and management of the CADD systems and given his strong design and documentation skills, acts as one of the Directors in charge of the medium to large-scale high quality domestic residential projects in the office. Mohit was appointed an Associate  in 2000 and a Director in 2007.<\\/p><p>Outside of work, Mohit shares his time between the two loves of his life, his young family and sport. He is passionate about cricket and still chasing that elusive \'ace\' on the golf course.<\\/p><\\/p>\",\"17\":\"M.Arch (UNSW)\",\"21\":[\"true\"],\"14\":\"Mohit\",\"15\":\"Keni\",\"19\":[\"548\"],\"16\":\"Director\",\"20\":\"director\"}}','2014-08-06 06:52:08','2014-08-06 06:52:08','901e2394-1014-4453-bd8b-62cbbce9a01a'),
 ('395','8','4','4','en_us',null,'{\"authorId\":\"1\",\"title\":\"Mark Clark\",\"slug\":\"staff-lastname\",\"postDate\":1402012860,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"18\":\"<p><p>Architect, art lover, northern beaches escapist.<\\/p><p>Following a five year career as a solicitor, Mark moved to Architecture and graduated with Honors in 1995. He worked for Andre Porebski and Associates for three-years and joined Corben Architects in 1998 to work on the Wylde Street Apartment project in Potts Point. Mark now acts as one of the Directors in charge on the large scale domestic residential projects in the office. Mark has strong design and documentation skills and is an excellent communicator. He was appointed an Associate in 2000 and a Director in 2007.<\\/p><p>He has a strong interest in art, architecture and landscape design. While Mark enjoys city life during the week, he often escapes to his Palm Beach residence where he spends most weekends.<\\/p><\\/p>\",\"17\":\"LLB., B.Arch (hons) (UA)\",\"21\":[\"true\"],\"14\":\"Mark\",\"15\":\"Clark\",\"19\":[\"546\"],\"16\":\"Director\",\"20\":\"director\"}}','2014-08-06 06:52:47','2014-08-06 06:52:47','f48ddd25-f2b8-4270-b17d-de3977a11793'),
 ('396','552','4','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"Andrew Vingilis\",\"slug\":\"andrew-vingilis\",\"postDate\":1407211680,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"18\":\"<p><p>Andrew commenced working in Architectural Practice in 1981, graduating from the University of Technology Sydney in 1989.<\\/p><p>Andrew worked for several Sydney practices including Tanner Architects, Feiko Bouman Architects, Andre Porebski and Associates and Stokes, Hayes and Kanas Pty Ltd as the Design and Project Architect on numerous single and multi unit residential projects, large educational, commercial and heritage projects.<\\/p><p>Prior to joining Corben Architects in 2007 Andrew worked in his own practice for 5 years specializing in single and multi unit residential projects throughout New South Wales.  Andrew was appointed as an Associate Director to Corbens in 2011.<\\/p><\\/p>\",\"17\":\"B.Arch (UTS), NSW ARAIA\",\"21\":[\"true\"],\"14\":\"Andrew\",\"15\":\"Vingilis\",\"19\":[\"541\"],\"16\":\"Associate Director\",\"20\":\"director\"}}','2014-08-06 06:53:14','2014-08-06 06:53:14','13c8da90-e4bf-4464-b960-10fd9ef6d5e3'),
 ('397','553','4','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"Anita Kane\",\"slug\":\"anita-kane\",\"postDate\":1407211860,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"18\":\"<p><p>Architect, beach & music lover, sports enthusiast & adventurer.<\\/p><p>Anita commenced her architectural professional from an early age, providing drafting services for her father, a sole practitioner before working with Mark Hurcum Design Practice as an Architectural Assistant. &nbsp;In 2003, Anita graduated from the University of Sydney and joined the team at Corben Architects. Anita was instrumental in establishing Corben Architects CAD protocol and is responsible for managing small to medium sized high-end residential projects.Anita was appointed an Associate in 2007.<\\/p><p>In 2009, Anita took an extended honeymoon, cycle touring through South America and Cuba, covering some ten thousand kilometers on a bicycle. In May 2010, she returned to Corben Architects to resume her position.<\\/p><p>Outside of work, Anita shares her time between a busy social life, discovering Sydney\\u2019s art scene, sampling many of the northern beaches culinary delights, enjoying the outdoors or chasing her husband up a mountain.<\\/p><\\/p>\",\"17\":\"B.Arch, NSW ARAIA\",\"21\":[\"true\"],\"14\":\"Anita\",\"15\":\"Kane\",\"19\":[\"542\"],\"16\":\"Associate\",\"20\":\"director\"}}','2014-08-06 06:54:07','2014-08-06 06:54:07','575cd87c-5036-4ffe-b436-d7ba0599b3ae'),
 ('398','20','5','4','en_us',null,'{\"authorId\":\"4\",\"title\":\"Architecture\",\"slug\":\"architecture\",\"postDate\":1402027620,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<h2>ARCHITECTURE<\\/h2><p> Corben Architects approach to every project is to analyse the brief and context of the site to arrive at a clear design and planning solution.This approach is undertaken without limiting design innovation to achieve practical, cost effective design solutions that create great looking buildings and comfortable, living and working environments.<\\/p><p> Able to adapt to a wide variety of project styles, from historic restorations to contemporary modern design, the key objective of each commision is to design and build projects that fit comfortably within their urban context or natural surrounding. This approach is extended in the integration between old and new architecture.<\\/p><p>As part of the overall project strategy, we keep the design principles simple and uncomplicated to allow our ideas to develop with clarity. Our buildings are distinctive by their individuality rather than their similarity.<\\/p>\",\"32\":[\"595\"]}}','2014-08-06 23:00:48','2014-08-06 23:00:48','498ebf4e-e9bc-4750-b80e-79cd7b5317e6'),
