 ('6','field','17','en_us',' b sc arch b arch hon fraia registration number 4616 '),
 ('6','field','18','en_us',' architect sailor snow skier surfer cyclist yoga enthusiast philip worked for ten years with the respected firms of cox architects clarke perry blackmore and architecture oceania in 1990 he established corben architects with the overriding commitment to quality design and a high level of client service whilst philip overviews every project within the office he is predominantly involved in the client liaison and design review as the managing director philip is also responsible for the business management of the practice assisted by office manager janelle alexander and book keeper debra lane outside work philip shares his time between his outgoing wife lucy his three daughters and also tries to find time for his love of competitive sailing long board surfing the slopes of thredbo cycling yoga and escaping to his beachside hideaway in byron bay '),
 ('6','field','20','en_us',' director '),
