 ('7','field','15','en_us',' keni '),
 ('7','field','16','en_us',' director '),
 ('7','field','17','en_us',' m arch unsw '),
 ('7','field','18','en_us',' architect computer guru cricketer and keen golfer after graduating in architecture from india in 1992 mohit moved to sydney to undertake his masters degree from university of nsw mohit then worked at baker associate architects for 4 years before joining corben architects in 1999 mohit is responsible for the it development and management of the cadd systems and given his strong design and documentation skills acts as one of the directors in charge of the medium to large scale high quality domestic residential projects in the office mohit was appointed an associate in 2000 and a director in 2007 outside of work mohit shares his time between the two loves of his life his young family and sport he is passionate about cricket and still chasing that elusive ace on the golf course '),
