 ('8','field','17','en_us',' llb b arch hons ua '),
 ('8','field','18','en_us',' architect art lover northern beaches escapist following a five year career as a solicitor mark moved to architecture and graduated with honors in 1995 he worked for andre porebski and associates for three years and joined corben architects in 1998 to work on the wylde street apartment project in potts point mark now acts as one of the directors in charge on the large scale domestic residential projects in the office mark has strong design and documentation skills and is an excellent communicator he was appointed an associate in 2000 and a director in 2007 he has a strong interest in art architecture and landscape design while mark enjoys city life during the week he often escapes to his palm beach residence where he spends most weekends '),
