 ('21','title','0','en_us',' service '),
 ('22','field','32','en_us',''),
 ('22','field','2','en_us',' fees although we work on a variety of fee arrangements most residential projects are undertaken on a percentage fee based on the final cost of the project including all internal fitout external works and landscaping exc gst we adopt this approach as it is the fairest means of remuneration for the work we actually design document and administer during construction the percentage fee for a full services commission on a new domestic project range from 9 15% depending on the value of the project and the level of finish alterations and additions generally attract an additional fee depending on the complexity of the works and the degree of alteration multi unit residential projects generally attract a lesser fee in the range of 5 9% depending the value of the project the number of units the degree of repetition and the level of finish and detail percentage based fees are generally divided into the following stages ?master planning initial sketch design 5%?full sketch design 5%?design development to development application 15%?contract documentation to construction certificate 20%?contract documentation to tender 20%?tendering and contract negotiation 5%?contract administration during construction 30% we also work on a time plus disbursements basis or a lump sum fee for a defined stage or specific scope of work due to the adhoc nature of the development application assessment process and inevitable neighbour objections all council and neighbour negotiations are undertaken on a time and disbursement basis we are able to provide partial services as may be required although we do not encourage this approach as we maintain the finest and most successful projects are the result of the architect maintaining a close involvement throughout the entire design documentation and construction process whilst our fees are consistent with the industry standard we provide a high level of skill and expertise and an even higher level of client service '),
