 ('486','field','33','en_us',' we were commissioned to design alterations and additions to a newly built 3 level waterfront home recently purchased by our clients the brief was to add a lift wine cellar guest bathroom and generally refurbish the home to provide a richer background for the clients possessions the lift shaft has 2 walls of full height glazing to reduce the additional building bulk and afford views to the passengers these windows are screened with vertical aluminium battens the wine cellar enjoys water views through the lift shaft into the courtyard beyond the new bathroom was crafted from a space that was two bathrooms interior stylist lucy purchas worked closely with the clients commissioning new furniture selecting wall finishes to compliment the client s extensive collection of art work and sculpture hugh main of spirit level landscape design created a series of unique garden spaces grounding the home in a visually striking landscape '),
