 ('933','field','33','en_us',' this project involved the construction of a new over water marina complex comprising a commercial office retail and workshop building a new elevated hardstand with a 50 ton boat lifting facility and 30 floating marina berths with associated car parking the new 2 storey steel framed building built over the water is clad in cfc panels with a curved metal roof the building incorporates wide verandahs along the northern elevation providing access to the offices and marina berths council and waterways owned land was reclaimed to create a car park and cul de sac road with integrated landscaping the development is a fine example of a successfully operated and appropriately scaled marina facility '),
